INSERT INTO `app_blog_post` (`id`, `blog_category_id`, `counter`, `slug`, `title`, `content`, `enabled`, `meta_keywords`, `meta_description`, `meta_tags`, `created_at`, `author`, `seoText`) VALUES
(12, 1, 29, 'hello-world', 'hello world', '<p><strong>BimmerTech\'s BMW CarPlay retrofit has been reborn... </strong></p>\n<p><span style=\"font-weight: 400;\">Our fully integrated CarPlay MMI has taken the BMW world by storm, and now it\'s back and better than ever! Our CarPlay MMI PLUS has all the features of our groundbreaking CarPlay MMI, </span><em><span style=\"font-weight: 400;\">plus</span></em><span style=\"font-weight: 400;\"> a few extras to make it an even better way to add Apple CarPlay to your 2016 or older BMW.</span></p>\n<p><span style=\"font-weight: 400;\">With CarPlay it\'s easy to use many of your iPhone\'s apps, including Apple Maps, Waze, Spotify, WhatsApp and more in your BMW, on the factory dashboard screen. For maximum convenience, control and navigate between apps with your vehicle\'s in-built controls, or with your voice thanks to Siri voice command.</span></p>', 1, '', 'hello world ', '', '2019-05-16 10:44:11', 'Marketing Marketing_Michal', ''),
(13, NULL, 2, '100-hello-there', 'Hello there', '<p>akhglakslaslalfa</p>\n<p>akjbgalkdgnladglakdg</p>\n<p>ajgnalkndglandlgalgakl</p>', 0, 'kjaflKFLfF', '', 'HBKjwlf', '2019-05-10 15:01:24', 'John Smith', 'KUHSIHIGALI\nKJL\nlagnaljg;ajd;glja;d\n\nakjfbalksnglaksglkjalgja');
