INSERT INTO `app_home` (`id`, `title`, `slug`, `description`, `meta_title`, `meta_description`, `meta_keywords`, `sub_title`) VALUES
(4, 'Home', NULL, '<p>Due to the OEM origin, the kit perfectly integrates into the bodywork of your car as well as your iDrive system. What&rsquo;s more, this BMW backup camera produces the highest picture quality on the market. But these are not the only features that make it stand out.</p>\r\n\r\n<p>Our Rear View Camera (OEM) is the only park assist retrofit compatible with Surround View, that provides 360 degree visibility, and Trailer Hitch mode. The latter makes it possible to change the angle of the camera and see the trailer hitch while backing up.</p>\r\n\r\n<p>In addition, the wide-angle lens shows you a detailed, full-color and perspective-corrected view of every obstacle behind your car, making parking safe and easy.&nbsp;</p>', 'Bimmer-tech Web Shop', 'bmw', 'bmw', 'subheader');
