INSERT INTO `app_page` (`id`, `title`, `slug`, `created_at`, `meta_title`, `meta_description`, `meta_keywords`, `content`) VALUES
(2, 'About Us', 'about-us', '2019-01-22 14:19:12', 'About Us', 'About Us', 'About Us', '<p><strong>Company</strong><br />BimmerTech&nbsp;was established with the sole purpose of providing BMW owners with the most advanced and up-to-date OEM retrofits, coding and software updates not commonly available anywhere else. With more than 10 years of professional experience, our team of software and hardware engineers, technicians and, above all, BMW enthusiasts are dedicated to the complete understanding and expertise of BMW electronics and software.</p>\r\n<p>Our products are seamlessly integrated to each vehicle like they were factory-installed - even when they are actually not factory-available as retrofits. From complete 4th Generation iDrive CIC retrofits to the latest BMW Apps, BMW Live and Internet features, our expertise in surpassing customers expectations in product performance, installations and service quality has been our job from day one.</p>\r\n<p>Our customer service, warranty and aftersales support are exceptional. A global network of professional technicians and engineers install and support our products as an extension of our vast capabilities. We use only OEM tried and proven parts and software to guarantee that your BMW will just be a much better equipped BMW. Our personalization program provides a flexible and efficient platform from which the most demanding customers can select specific features and retrofits for their vehicles if so desired.&nbsp;</p>\r\n<p>Make your BMW a&nbsp;BimmerTech&nbsp;BMW...</p>\r\n<p><strong>Services</strong><br />From the very beginning,&nbsp;BimmerTech&nbsp;has set the standard in OEM retrofits not available anywhere else.&nbsp;<br />The days of lamenting that your car is missing a particular option and the dealer is of no help are over.<br />Our constant and extensive R&amp;D allows us to offer the most innovative solutions to any OEM retrofit.&nbsp;<br />The results speak by themselves.</p>\r\n<p>We were the first in the world to offer a full OEM CIC Navigation retrofit including the VIN-matched enabling codes.<br />The first in the world to offer the BMW Apps OEM retrofit.<br />The first in the world to offer a direct TCU replacement with Combox, no wires tapped, cut or spliced.<br />The first in the world to offer BMW Live and BMW Internet services.</p>\r\n<p>No BMW dealer is able to offer any of these services. At any price.&nbsp;</p>\r\n<p>Our services extend to:</p>\r\n<ul>\r\n<li>OEM Bluetooth retrofits</li>\r\n<li>OEM iPod/USB retrofits</li>\r\n<li>OEM rearview cameras</li>\r\n<li>OEM Park Distance Control retrofits</li>\r\n</ul>\r\n<p>We only use tested and proven OEM parts. For those extreme cases for which there are no OEM parts available we use the highest quality aftermarket parts, guaranteeing a hassle-free installation. And with the highest customer service and support possible, we can guarantee 100% customer satisfaction.</p>\r\n<p><strong>We are hiring</strong><br />BimmerTech offers the best BMW retrofits on the market, a feat we accomplish not only thanks to our high-quality products but because of the people who steer our business in the right direction. If you have passion and talent, we want to hear from you. Send us your CV and cover letter today at&nbsp;jobs@bimmer-tech.net&nbsp;to join a company that&rsquo;s going places!</p>\r\n<p>Most Wanted<br />1.Online Sales Specialist (Location: USA, home office) -&nbsp;Read more<br />2.Graphic designer /&nbsp;Front-end developer (Location: worldwide, home office) -&nbsp;Read more</p>'),
(3, 'Privacy Policy', 'privacy-policy', '2019-01-22 14:19:12', 'bmw', NULL, NULL, '<p>This Privacy Policy covers the entirety of the BVzine.com site (\"Website\")<em>.</em> The policy governs your access to and use of the services offered by the maintainers of BVzine.com (\"us\" or \"we\"). Your use of this Website indicates that you have read and understood this policy and agree to abide by our Terms of Use.</p>\r\n<p><strong>Mailing list</strong><br />BVzine.com may run a mailing list, in order to provide subscribers with relevant information, including but not limited to recent news stories and promotional material. In order to subscribe to this mailing list, users must submit a valid email address, which may be shared with our Service Provider. This email, in association with your mailing list subscription status, may be used by us, on our own behalf or on behalf of our partners, to assess interest in our materials and to present targetted content.</p>\r\n<p><strong>Comments</strong><br />BVzine.com may make it possible to post comments to the site through our own or a third-party commenting system. All comments posted may be made public, alongside personally identifying information (such as full name, picture etc. if given). Comments made through a third-party commenting system may be shared with the service provider, who may store or otherwise use this data.</p>\r\n<p><strong>Server logs</strong></p>\r\n<p>As most websites, BVzine.com is hosted on a server that logs a small amount of information about users accessing it. This information includes your IP address along with a timestamp, and is used to ensure security of our server and to diagnose any issues we experience with the running of the Website.</p>\r\n<p>Our servers are located in the United States and managed in accordance with local law.</p>\r\n<p><strong>Third-party services</strong><br />BVzine.com uses third-party services to provide features for our users, to gather information that helps us improve the quality of our service and to earn enough to cover the costs associated with running the Website.</p>\r\n<p>Third-party services currently in use are:</p>\r\n<ul>\r\n<li>Facebook Analytics: Website traffic and audience insights.</li>\r\n<li>Facebook social plugins: Hosting and moderating comments.</li>\r\n<li>Google AdSense: Displaying third-party advertisements.</li>\r\n<li>Google Analytics: Measuring website traffic and user activity.</li>\r\n<li>OneSignal: Email and push notifications and measuring their performance.</li>\r\n<li>Quantcast Measure: Audience insights.</li>\r\n<li>VigLink: Managing affiliate links and measuring their performance.</li>\r\n</ul>\r\n<p>These services may install cookies on your computer or collect information about you through your use of BVzine.com. Please review the privacy policy of these third parties for further clarification.</p>\r\n<p>Some content on BVzine.com &mdash; including images, videos and social media content &mdash; is embedded from third-party sources. These content providers may place cookies on your computer to track your engagement with the embedded content or for other purposes. We endeavour to restrict third party tracking through BVzine.com as appropriate.</p>\r\n<p><strong>Mailing list</strong><br />BVzine.com may run a mailing list, in order to provide subscribers with relevant information, including but not limited to recent news stories and promotional material. In order to subscribe to this mailing list, users must submit a valid email address, which may be shared with our Service Provider. This email, in association with your mailing list subscription status, may be used by us, on our own behalf or on behalf of our partners, to assess interest in our materials and to present targetted content.</p>\r\n<p><strong>Contact</strong><br />If you have any questions about this policy, please contact us for guidance.</p>\r\n<p>This page was last updated September 21 2018.</p>'),
(4, 'Terms and Conditions', 'terms-and-conditions', '2019-01-22 14:19:12', NULL, NULL, NULL, '<p>This document covers the entirety of the BVzine.com site (\"Website\"). The policy governs your access to and use of the services offered by the maintainers of BVzine.com (\"us\" or \"we\"). Your use of this Website indicates that you agree to abide by these terms and have read and understood our Privacy Policy.</p>\r\n<p><strong>Copyright</strong><br />BVzine.com respects the intellectual property rights of others and expects users to do the same. All third party content is provided in good faith. We are happy to respond to notices of alleged copyright infringement where necessary.</p>\r\n<p>Unless otherwise stated, all other content published on the website, including texts, images and other assets remains our exclusive intellectual property and may not be reproduced in any form without explicit consent from BVzine.com or a representative.</p>\r\n<p><strong>Comments</strong><br />BVzine.com may allow users to post comments to the Website. Users shall not use comments posted to the Website to transmit, directly or indirectly, any content or information that:</p>\r\n<ol>\r\n<li>Is grossly harmful, defamatory, libelous, menacing, hateful or otherwise unlawful or objectionable;</li>\r\n<li>Infringes any patent, trademark, copyright or other proprietary rights;</li>\r\n<li>Impersonates another person or seeks to mislead the addressee about the origin of the message;</li>\r\n<li>Discloses any personally identifying information or private information about any third parties without their express consent;</li>\r\n<li>Solicits anybody to buy or sell any product or service, to make donations of any kind or to engage in any fraudulent or illegal transation, financial or otherwise.</li>\r\n</ol>\r\n<p>BVzine.com reserves the right to remove any comments deemed to violate the above guidelines and restrict future posting capabilities of any individual responsible for the posting of inappropriate comments.</p>\r\n<p><strong>Links</strong><br />BVzine.com may contain links to other sites. We are not responsible for the availability, content or practices of any other site. All links are provided for information, and should not be assumed to constitute an endorsement of the site linked to or any of its services. BVzine.com shall not be held liable, directly or indirectly, for any damage or loss caused or alleged to be caused by or in connection with the use of or reliance on any content, goods or services available on or through such links.</p>\r\n<p><strong>Advertising</strong><br />We may display image or text ads on BVzine.com, either through a third party web advertising vendor or through our own ad delivery software. We or third parties may collect information about your activity on BVzine.com or elsewhere to help provide better targetted ads. We may use data gathered through BVzine.com to issue targeted ads, on our Website or elsewhere, on our own behalf or on behalf of our partners.</p>\r\n<p>BVzine.com may include affiliate marketing links, allowing us to earn commission on purchases made after a referral from this Website. Affiliate partners may use cookies and other technology to track your activity on their website in order to correctly allocate commission to BVzine.com.</p>\r\n<p><strong>Contact</strong><br />If you have any questions about this policy, please contact us for guidance.</p>\r\n<p>This page was last updated September 21 2018.</p>'),
(5, 'Cookies policy', 'cookies-policy', '2019-01-22 14:19:12', NULL, NULL, 'Cookies policy', '<p>We use cookies to help us understand how you use BVzine.com. By accessing and using this site, you are agreeing to our privacy policy and terms of use.</p>'),
