INSERT INTO `app_pop_up_option` (`id`, `code`, `title`, `description`, `vin_check_service_id`) VALUES
(6, 'Head_unit', 'head unit', 'Head unit is the central component of the BMW’s iDrive system that defines its processing power, features and functionalities.', NULL),
(7, 'BMW_Software_Update', 'BMW software update', 'It is a process of updating several or all modules in a vehicle. The software version is usually identified as the BMW i-Level and looks like this F020-16-07-503. 16-07 tell you the date of the software version; 16 as 2016, and 07 as July.', NULL),
(8, 'MMI', 'MMI', 'BimmerTech Multimedia Interface (MMI) is a module that seamlessly integrates with the iDrive system. It extends the multimedia capabilities of your BMW making it possible to add an aftermarket rear view camera, front view camera, mirroring device, etc.', NULL),
(9, 'nativ_iDrive_display', 'native iDrive display', 'A screen that was installed into your BMW from factory.', NULL),
(10, 'mirroring_devices', 'mirroring devices', 'A mirroring device is a retrofit that allows you to copy the screen of your smartphone/tablet onto the iDrive display. It also provides audio playback through BMW’s AUX port.', NULL),
(11, 'factory_navigation', 'factory navigation', 'It is a system that equips the car with multimedia features like screen, smartphone integration, etc., as well as navigation tools like maps.', NULL),
(12, 'coding_cable', 'coding cable', 'The proper coding interface for your BMW - E-series cars require a DCAN coding interface, while F- and G-series cars can only work with an ENET coding interface.', NULL),
(13, 'NBT', 'NBT', 'NBT (Next Big Thing) is a navigation system which comes as an improved version of CIC. It was first launched in 2012 and is still installed in 5- & 6-Series as well as i3 & i8. It’s a part of Navigation System Professional (S609A) package.', NULL),
(14, 'NBT_Evo', 'NBT Evo', 'NBT Evo is an iDrive system with 3 types of interfaces: ID4 (has the same design as NBT), ID5 & ID6 (have new menu designs). It was launched in 2013 and is installed in new F- & G-Series. It’s a part of Navigation System Professional (S609A) package.', NULL),
(15, 'Navigation_System_Professional', 'Navigation System Professional', 'Navigation System Professional (S609A option) is an enhanced iDrive system package that has advanced multimedia features like BMW Apps, smartphone integration, etc.', NULL),
(16, 'carplaymmi_iDrive', 'iDrive', 'iDrive is an in-car BMW system that allows you to control settings, use navigation and take advantage of such multimedia features like listening to music, integrating a smartphone with the car or watching videos on the BMW’s screen.', NULL),
(17, 'Hands-Free Calling', 'Hands-Free Calling', 'With the help of Bluetooth, this feature allows you to accept/make calls without using your smartphone and taking your eyes off the road.', NULL),
(18, 'iDrive_screen', 'iDrive screen', 'A screen that was installed into your BMW from factory.', NULL),
(19, 'BMW_iDrive_system', 'BMW iDrive system', 'iDrive is an in-car BMW system that allows you to control settings, use navigation and take advantage of such multimedia features like listening to music, integrating a smartphone with the car or watching videos on the BMW’s screen.', NULL),
(20, 'Remote_coding_session', 'remote coding session', 'During a coding session, a professional BimmerTech technician programs the car remotely. To prepare for the session, you would need a Windows laptop (in some cases Mac with Windows can work too), additional software and coding cable.', NULL),
(21, 'Obstacle_Marking', 'Obstacle Marking', 'Spatially-shaped markings appear on the backup camera image in front of the objects to simplify the estimation of the distance to those objects.', NULL),
(22, 'Dynamic_Parking_Lines', 'Dynamic Parking Lines', 'These are colorful lines on the screen that move with the steering wheel to indicate the projected path and help avoid obstruction & back up/park safely.', NULL),
(23, 'Park_Distance_Control', 'Park Distance Control', 'This is a feature that uses ultrasound sensors integrated into the rear/front /rear & front of the vehicle. They measure the distance to the nearest large object behind the vehicle.', NULL),
(24, 'HUD', 'HUD', 'HUD is a Head-Up Display that projects drive and multimedia related information onto the front windshield of the car. The projected data can include various driving status, system warnings, directional messages, etc.', NULL),
(25, 'BirdsEyeCamSystem', 'bird\'s-eye camera system', 'A system that produces a simulated top-down view of the vehicle and what’s around it.', NULL),
(26, 'AirPlay', 'AirPlay', 'Apple AirPlay lets you stream music or movies from iTunes or your mobile Apple device to any AirPlay-enabled device on the same network.', NULL),
(27, 'Miracast', 'Miracast', 'Miracast is a wireless display standard designed for mirroring a smartphone, tablet, or PC’s screen, without requiring any physical HDMI cables.', NULL),
(28, 'Voice_control', 'Voice Control', 'It lets you manipulate the car’s system with voice commands. Pressing the voice command button on the steering wheel you can navigate to any menu section, manage calls and text messages when your telephone is connected to the car via Bluetooth.', NULL),
(29, 'BMW_navsystem', 'BMW navigation system', 'It is an in-car BMW system that allows you to control settings, use navigation and take advantage of such multimedia features like listening to music, integrating a smartphone with the car or watching videos on the BMW’s screen.', NULL),
(30, 'Vid_Serv_InMotion', 'Video &amp; Services in motion', 'It enables you to play videos on the BMW screen while the car is in motion. It also unlocks Office Messages, Online Entertainment, Bluetooth Pairing and the User Manual for use while driving if they are already available in your vehicle.', NULL),
(31, 'BMW_Ycable_adapter', 'BMW Y cable adapter', 'This is a cable that splits from an iOS device connector to USB and Aux (3.5mm stereo jack) thus using both ports in your arm rest. It is required to connect an iOS device to your car when Enhanced Bluetooth/USB port is not unlocked in your vehicle.', NULL),
(32, 'BMWApps', 'BMW Apps', 'The BMW Connected app for iPhone gives you one more way to interact with your vehicle. Use Twitter, Pandora, Spotify and more, thanks to the connection with your iPhone. Built-in text-to-speech functionality makes it easy to use the apps behind the wheel.', NULL),
(33, 'FSC-certifiedcodes', 'FSC-certified codes', 'FSC (Freischaltcode) is the activation code released by BMW. This activation code is always a 20-position combination of characters, which is usually entered manually via the iDrive controller.', NULL);
