INSERT INTO `faq_header` (`id`, `name`, `code`, `position`) VALUES
(1, 'Installation & Support', 'installation_tech_support', 3),
(2, 'Payment & Delivery', 'payment_delivery', 2),
(3, 'Returns & Refunds', 'returns_and_refunds', 4),
(4, 'Your order', 'your_order', 1);
INSERT INTO `faq_question` (`id`, `code`, `position`, `enabled`, `question`, `answer`, `header_id`) VALUES
(73, 'Vertical', 0, 1, 'Where to find the information about my order?', '<p>If you place an order, the system automatically creates an account for you. To learn any information about your order, please log into your account in the top right corner of the website. Navigate to the Orders tab where you can find such info as the Order ID, Payment Status, Shipping Status, etc.</p>', 4),
(74, 'Vertical', 3, 1, 'Where can I find the password to log into my account?', '<p>If you place an order or just register on our website, after typing in your email address twice, you get a confirmation email. It contains a link that is used to confirm your email address and an automatically generated password that you can use to sign in.\nYou can change the password in your account, in the Change Password tab.\nPlease note that you won’t be able to log in without confirming your email address. </p>', 4),
(75, 'Vertical', 4, 1, 'Why can’t I log into my account?', '<p>If you can’t log into your account, it means you haven’t confirmed your email address.\nWhen you place an order or just register on our website, after typing in your email address twice, you get a confirmation email. It contains a link that is used to confirm your email address and an automatically generated password that you can use to sign in.\nIf you can’t locate this email in your inbox, check the spam folder. If it isn’t there either, go to the Log in tab in the top right corner, type in your email and press Enter. There will be a message with a link to resend this email. After you click it, you need to input your email address once more.\nAfter this process, the confirmation email should be in your inbox where you will be able to confirm your email address.</p>', 4),
(76, 'Vertical', 5, 1, 'What’s my order status?', '<p>Log into your personal account in the top right corner of the website and navigate to the Orders tab. The 3rd column will inform you about your order status.</p>', 4),
(77, 'Vertical', 6, 1, 'How to find my order number?', '<p>Log into personal account in the top right corner of the website and navigate to the Orders tab. The 1st column will contain the Order ID which is your order number. </p>', 4),
(78, 'Vertical', 7, 1, 'Can I change my shipping address after I’ve completed the order?', '<p>If you would like to change the shipping destination after the order is placed, please contact us at info@bimmer-tech.net with your order number as soon as possible for details. Please note that we can only ship to a PayPal registered address.</p>', 4),
(79, 'Vertical', 8, 1, 'How can I change / add / remove items in my order?', '<p>Contact us at info@bimmer-tech.net with your order number and we will handle it.</p>', 4),
(80, 'Vertical', 9, 1, 'How do I cancel my order?', '<p>Contact us at info@bimmer-tech.net with your order number and we will handle it.</p>', 4),
(81, 'Vertical', 1, 1, 'What does the status “Backorder” mean?', '<p>It means that product is out of stock and we&rsquo;re waiting for delivery. You will be notified when we have it in stock again - you&rsquo;ll receive an email with the parcel tracking number. The status in your personal account will also change in the Orders tab.</p>', 4),
(82, 'Vertical', 2, 1, 'Why is my order partially shipped?', '<p>This situation may appear in 2 cases: When you ordered several products and some of them ship from different locations; When you ordered several products and some of them are out of stock at the moment. When everything is sent, the status will change to Shipped.</p>', 4),
(83, 'Vertical', 12, 1, 'How can I pay for my order?', '<p>All the payments on our website are done through the PayPal paying system. While placing an order, you will be redirected to the PayPal website to complete your payment. On the PayPal website you can log in to your PayPal account, select one of your existing shipping addresses or add a new one and pay for your order.</p>', 2),
(84, 'Vertical', 13, 1, 'If I don\'t have PayPal, can I pay by card?', '<p>Yes, you can. If you don’t have a PayPal account or just prefer to pay directly with your credit or debit card, click \"Pay with Debit or Credit Card\" on the PayPal website.</p>', 2),
(85, 'Vertical', 14, 1, 'PayPal isn’t supported in my country. Can I still order from you?', '<p>If PayPal doesn’t work or is blocked in your country, you can pay for your order using a wire transfer.\nIf this is your case, write an email to info@bimmer-tech.net and our sales representatives will guide you step-by-step through the process.</p>', 2),
(86, 'Vertical', 15, 1, 'How will I know you have received my payment?', '<p>You can log into your account, navigate to the Orders tab and check the Payment Status column. When we receive the payment, the status will be changed to Paid.</p>', 2),
(87, 'Vertical', 16, 1, 'Where don’t you ask for the delivery address when I place an order?', '<p>We ship only to PayPal registered addresses. While placing an order, you will be redirected to the PayPal website to complete your payment. On the PayPal website you can log in to your PayPal account, select one of your existing shipping addresses or add a new one.</p>', 2),
(88, 'Vertical', 17, 1, 'Where is my order being sent from?', '<p>Most of our products are shipped from our headquarters in Dubai, UAE. However, certain upgrades can also be sent from Warsaw, Poland, or Orlando, USA.</p>', 2),
(89, 'Vertical', 18, 1, 'How much does the delivery cost?', '<p>We provide free worldwide delivery.\nHowever, the delivery & handling don’t include duties, import taxes and brokerage fees, if applicable. We do what we can to comply with the value limits, but they vary widely from country to country. Please check with your local customs agency for details on estimated costs.</p>', 2),
(90, 'Vertical', 19, 1, 'How long does the delivery usually take?', '<p>Our standard delivery time is 2-5 business days. It might take longer than that if the retrofit you’ve ordered  is out of stock. If such a situation takes place, you will be informed and the Shipping & Order Status in your personal account will be changed accordingly. </p>', 2),
(91, 'Vertical', 20, 1, 'Where can I find my parcel tracking number?', '<p>Log into your personal account in the top right corner of the website and navigate to the Orders tab. Under the Shipping status you will find the tracking numbers for all items in your order.</p>', 2),
(92, 'Vertical', 21, 1, 'Why do I need to pay to DHL if the delivery is free?', '<p>The delivery is free. But we don’t cover duties, import taxes and brokerage fees, if applicable.We do what we can to comply with the value limits, but they vary widely from country to country, and even low value items might be subject to import tax. Please check with your local customs agency for details on estimated costs.</p>', 2),
(93, 'Vertical', 22, 1, 'How are the USB coding options delivered?', '<p>If you order USB coding options for your car, they are delivered via email in a form of a link for download together with instructions. No physical delivery is involved.</p>', 2),
(94, 'Vertical', 23, 1, 'How are the cable coding options delivered?', '<p>If you order cable coding options for your car, we send out a coding interface together with instructions. After it is delivered in 2-3 business days, you can schedule a remote coding session during which our technician activates the features you ordered.</p>', 2),
(95, 'Vertical', 24, 1, 'How is the Navigation Map Update delivered?', '<p>After you’ve placed an order and completed the payment, we ship a USB stick with a map update on it.</p>', 2);
