" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The SiriusXM cable package includes everything necessary for adding satellite radio to your radio options:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Remote activation service</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface (if you add it to your order in the top <em>Option</em> section)</span></li>\r\n<li style=\"font-weight: 400;\">SiriusXM activation number</li>\r\n</ul>', NULL, NULL),
(449, 190, 'SiriusActivationCable_convFGSeries', '2019-04-19 12:56:56', '2019-05-15 13:40:59', 1, 'choice', 0, 'Get up to 150 satellite radio channels activated in your car in less than 30 minutes.', 1, NULL, NULL, NULL, 'codding', '<p>Looking for the easiest way to add Sirius XM car subscription to your BMW or MINI? Our remote SiriusXM activation process means you&rsquo;ll be enjoying satellite radio in less than 30 minutes, without even leaving your home.</p>\r\n<p>With around 150 <a rel=\"noopener\" href=\"https://www.bimmer-tech.net/blog/item/51-4-satellite-radio-stations-worth-activating-siriusxm-in-your-bmw-for\" target=\"_blank\">XM radio channels</a> to choose from, including news, music, sports and entertainment, you and your family will always find something worth listening to.</p>\r\n<p>BMW owners often ask: &ldquo;How to get Sirius radio in my car for free for a year?&rdquo;, and the answer is that with BimmerTech it&rsquo;s pretty simple. We use a genuine BMW activation code to add satellite radio to your vehicle, meaning you can benefit from the <a rel=\"noopener\" href=\"https://www.siriusxm.com/sxm-learnmore?intcmp=hp_cta_0218_learn&amp;hpid=HP_NEW_LearnAboutMyTrial\" target=\"_blank\">Sirius XM free trial period</a>. If you&rsquo;re the original owner of the car, you may receive the All Access SiriusXM subscription free of charge for up to 12 months (or 2 months in case the BMW/MINI is Certified Pre-Owned).</p>\r\n<p>What XM radio stations are available for your car depends on its hardware. Visit the <a rel=\"noopener\" href=\"http://www.siriusxm.com/channellineup\" target=\"_blank\">SiriusXM official website</a> to check the lineup for your BMW/MINI. Also, have a look at the <a rel=\"noopener\" href=\"https://www.siriusxm.com/servlet/Satellite?blobcol=urlimage&amp;blobheadername1=Content-Type&amp;blobheadervalue1=application%2Fpdf&amp;blobkey=id&amp;blobtable=ImageAsset&amp;blobwhere=1283879646761&amp;ssbinary=true\" target=\"_blank\">Sirius XM channels list 2019</a><span style=\"font-weight: 400;\">.</span></p>', '<p><span style=\"font-weight: 400;\">SiriusXM Satellite Radio is activated through a remote cable coding session. It is a very simple process that takes no more than 30 minutes. After you complete your order, we send you </span><span style=\"font-weight: 400;\">a </span><span style=\"font-weight: 400;\">coding cable (if you don\'t have one and add it in the top <em>Option</em> section). Once you receive it, you will be able to schedule a coding session for the time that suits you best. During the session, just plug in the cable, follow the instructions from our technician and SiriusXM will be added to your radio options.</span></p>\r\n<p><span style=\"font-weight: 400;\">To prepare for your coding session you will need a laptop running Microsoft Windows and a WiFi internet network that you can connect to in your car. A Mac computer running Windows should work too. The coding cable must be plugged into y</span><span style=\"font-weight: 400;\"><span>our laptop&rsquo;s&nbsp;</span><a rel=\"noopener\" href=\"https://www.bimmer-tech.net/customer_support/Remote_coding/Instructions/EthernetPort.jpg\" target=\"_blank\"><span>Ethernet port</span></a><span>&nbsp;(if you don&rsquo;t have one, you can use an&nbsp;</span><a rel=\"noopener\" href=\"https://www.bimmer-tech.net/customer_support/Remote_coding/Instructions/LAN_MAC.jpg\" target=\"_blank\"><span>adapter</span></a><span>).</span></span></p>\r\n<p>The last step to enjoying your All Access subscription is to call SiriusXM directly and specify your activation code.</p>\r\n<p>Watch the video to understand the cable activation process better.</p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/ua7O1oOp4Io\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The SiriusXM cable package includes everything necessary for adding satellite radio to your radio options:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Remote activation service</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface (if you add it to your order in the top <em>Option</em> section)</span></li>\r\n<li style=\"font-weight: 400;\">SiriusXM activation number</li>\r\n</ul>\r\n<p>IMPORTANT: For the satellite radio to work, the vehicle must be equipped with the Sirius car radio antenna. Your BMW doesn&rsquo;t come with it from factory, but you can add a BMW original antenna to your order at the top <em>Option </em><span style=\"font-weight: 400;\">section during the purchase. It takes just minutes to install it (in case you buy it, the installation instructions will be added to your BimmerTech customer account).</span></p>', NULL, NULL),
