?v=rhtbr1D9rnc\"></a></p>\r\n<p><span style=\"font-weight: 400;\">CarPlay MMI gives you the chance to play music through the BMW stereo system with the help of the AUX input. In case you don&rsquo;t have an AUX port, we can code your car to enable the input. </span></p>\r\n<p><span style=\"font-weight: 400;\">Our BimmerTech original CarPlay also uses the factory car microphone for Siri Voice commands. This means that you can access your iTunes library, learn the latest news or send texts hands-free. </span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/NE0oAxqBRYg\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe><a href=\"https://www.youtube.com/watch?v=NE0oAxqBRYg&amp;feature=youtu.be\"></a></p>\r\n<p><span style=\"font-weight: 400;\">The kit contains a Multimedia Interface (MMI), an original BimmerTech module that makes it easy to add a Rear View Camera to your order for a much lower price. </span></p>\r\n<p><span style=\"font-weight: 400;\">Please note that if you want to use such features of BMW CarPlay iPhone integration like Siri, your iPhone can\'t be connected to your BMW via Bluetooth, but only through the cable. Otherwise, it will not work. Hands-Free Calling will not work if your iPhone is connected to CarPlay and Bluetooth simultaneously.</span></p>', '<p><span style=\"font-weight: 400;\">The installation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help.</span></p>\r\n<p><span style=\"font-weight: 400;\">BMW CarPlay setup is absolutely plug &amp; play. It doesn&rsquo;t require any remote coding and takes up to 2h. Moreover, no permanent modifications are needed, so the kit is completely lease-friendly. </span></p>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">MMI</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n</ul>', NULL, NULL),
(456, NULL, 'RearViewCamAddOn', '2019-04-23 13:28:20', '2019-04-23 13:30:07', 1, 'choice', 0, NULL, 0, NULL, NULL, 'This BMW backup camera overrides the native iDrive display with a full-screen high-quality  camera image. It’s mounted into the trunk handle just like an OEM rear view camera and supports Static/Dynamic Parking Lines.', NULL, NULL, NULL, NULL, NULL),
