(462, 196, 'VividScreenE60_E61_6', '2019-04-24 06:58:42', '2019-04-24 07:22:16', 1, 'choice', 0, 'A big, beautiful, high-res screen that will extend your BMW’s multimedia capabilities.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Want to revitalize your iDrive system? There is no need to replace it with a newer generation. All you need to do is swap your stock display for BimmerTech&rsquo;s VividScreen &mdash; a BMW display upgrade that lets you add the latest technology upgrades to your car and realize its potential. </span></p>\r\n<p><span style=\"font-weight: 400;\">The new 8.8&Prime; 1280x480</span> <span style=\"font-weight: 400;\">display doubles or triples the pixel density of the stock screen options, as well as sporting noticeably improved contrast for a better overall image quality. It&rsquo;s completely compatible with the BMW iDrive system and designed to look the same as a factory installed screen to smoothly fit into your interior. </span></p>\r\n<p><span style=\"font-weight: 400;\">With this BMW screen upgrade your car becomes compatible with SmartView mirroring devices. It means that you can choose among SmartView Apple TV3 and SmartView Apple TV4, both of which will let you stream the screen of your iOS phone onto the dashboard display. You can also opt for SmartView HD Flex that makes it possible to mirror the Android as well as iOS devices onto the BMW native screen. If you opt for one of the mirroring upgrades, make sure your car is equipped with the AUX port responsible for better sound transferring. If your vehicle doesn&rsquo;t have it, you can add it to your order in the top </span><em><span style=\"font-weight: 400;\">Options </span></em><span style=\"font-weight: 400;\">section. </span></p>\r\n<p><span style=\"font-weight: 400;\">Thanks to the inbuilt Multimedia Interface (MMI), you can also add our rear &amp; front view cameras as well as the above mentioned streaming devices for a much lower price.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/KmLpZSdKbSc\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">Please note that due to the higher resolution of the replacement screen, after the installation the images will appear slightly bigger.</span></p>', '<p><span style=\"font-weight: 400;\">The installation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. In case of any additional questions, our technical support is always ready to help. </span></p>\r\n<p><span style=\"font-weight: 400;\">The installation process takes up to 2 hours and is fully plug &amp; play. The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">VividScreen with inbuilt MMI</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">To learn more about the installation, watch this video:</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/20r7ZpkXddw\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>', NULL, NULL),
(463, NULL, 'FrontCamAddOn', '2019-04-24 07:24:03', '2019-04-30 09:44:56', 1, 'choice', 0, NULL, 0, NULL, NULL, 'With the help of the BimmerTech front view camera you will avoid scratches, dents and other damages on your bumper. The wide angle lens will help you avoid all the low obstacles in front of your BMW and save loads of money on repairs.', NULL, NULL, NULL, NULL, NULL),
(464, NULL, 'AUXportAddOn', '2019-04-24 07:26:58', '2019-04-24 07:32:47', 1, 'choice', 0, NULL, 0, NULL, NULL, 'It’s a retrofit that provides better sound transferring through BMW’s stereo system and allows you to connect almost any audio device to your car.', NULL, NULL, NULL, NULL, NULL),
(465, 196, 'VividScreen_E60_E61_8', '2019-04-24 07:36:56', '2019-05-14 08:22:41', 1, 'choice', 0, 'A big, beautiful, high-res screen and extend your BMW’s multimedia capabilities.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Want to revitalize your iDrive system? There is no need to replace the whole iDrive system with a newer generation. All you need to do is swap your stock display for BimmerTech&rsquo;s VividScreen &mdash; a BMW display upgrade that lets you add the latest technology upgrades to your car and realize its potential. </span></p>\r\n<p><span style=\"font-weight: 400;\">The new 8.8&Prime; 1280x480</span> <span style=\"font-weight: 400;\">display doubles or triples the pixel density of the stock screen options, as well as sporting noticeably improved contrast for a better overall image quality. It&rsquo;s completely compatible with the BMW iDrive system and designed to look the same as a factory installed screen to smoothly fit into your interior. </span></p>\r\n<p><span style=\"font-weight: 400;\">With this BMW screen upgrade your car becomes compatible with SmartView mirroring functionality. It means that you can choose among SmartView Apple TV3 and SmartView Apple TV4, both of which will let you stream the screen of your iOS device onto the dashboard display. You can also opt for SmartView HD Flex that makes it possible to mirror the Android as well as iOS devices onto the BMW native screen. If you opt for one of the mirroring upgrades, make sure your car is equipped with the AUX port responsible for sound transferring. If your vehicle doesn&rsquo;t have it, you can add it to your order in the top </span><em><span style=\"font-weight: 400;\">Options </span></em><span style=\"font-weight: 400;\">section. </span></p>\r\n<p><span style=\"font-weight: 400;\">Thanks to the inbuilt Multimedia Interface (MMI), you can also add our rear &amp; front view cameras as well as the above mentioned streaming devices for a much lower price.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/KmLpZSdKbSc\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>', '<p><span style=\"font-weight: 400;\">The installation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help. </span></p>\r\n<p><span style=\"font-weight: 400;\">The process takes up to 2 hours and is fully plug &amp; play. The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">VividScreen with inbuilt MMI</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">To learn more about the installation, watch this video:</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/20r7ZpkXddw\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>', NULL, NULL),
