ue to the higher resolution of the replacement screen, after the installation the images will appear slightly bigger.</span></p>', '<p><span style=\"font-weight: 400;\">The installation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help. </span></p>\r\n<p><span style=\"font-weight: 400;\">The process takes up to 2 hours and is fully plug &amp; play. The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">VividScreen with inbuilt MMI</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">If you add a screen resolution correction to your order, you&rsquo;ll also receive a coding interface. You will need to schedule a remote coding session during which our technician will adjust the image and make sure it&rsquo;s not stretched on your new screen. </span></p>\r\n<p><span style=\"font-weight: 400;\">To learn more about the installation, watch this video:</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/VTsmg2-oKUA\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>', NULL, NULL),
(469, 196, 'VividScreenF3x_6_ENTRYNAV', '2019-04-24 08:51:02', '2019-05-14 08:50:23', 1, 'choice', 0, 'A big, beautiful, high-res screen and extend your BMW’s multimedia capabilities (for cars with 6” displays).', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Want to revitalize your iDrive system? There is no need to replace the whole iDrive system with a newer generation. All you need to do is swap your stock display for BimmerTech&rsquo;s VividScreen &mdash; a BMW display upgrade that lets you add the latest technology upgrades to your car and realize its potential. </span></p>\r\n<p><span style=\"font-weight: 400;\">The new 8.8&Prime; 1280x480</span> <span style=\"font-weight: 400;\">display doubles or triples the pixel density of the stock screen options, as well as sporting noticeably improved contrast for a better overall image quality. It&rsquo;s completely compatible with the BMW iDrive system and designed to look the same as a factory installed screen to smoothly fit into your interior. </span></p>\r\n<p><span style=\"font-weight: 400;\">With this BMW screen upgrade your car becomes compatible with SmartView mirroring devices. It means that you can choose among SmartView Apple TV3 and SmartView Apple TV4, both of which will let you stream the screen of your iOS device onto the dashboard display. You can also opt for SmartView HD Flex that makes it possible to mirror the Android as well as iOS devices onto the BMW native screen. Thanks to the inbuilt Multimedia Interface (MMI), you can also add our rear &amp; front view cameras and the above mentioned streaming devices for a much lower price.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/KmLpZSdKbSc\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">Please note that due to the higher resolution of the replacement screen, after the installation the image will be slightly stretched. However, it can be corrected during a remote coding session. You can add this service (<em>Stretch Correction</em>) to your order at the top </span><em><span style=\"font-weight: 400;\">Options </span></em><span style=\"font-weight: 400;\">section. </span></p>', '<p><span style=\"font-weight: 400;\">The installation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help. </span></p>\r\n<p><span style=\"font-weight: 400;\">The process takes up to 2 hours and is fully plug &amp; play. The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">VividScreen with inbuilt MMI</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">If you add a screen resolution correction to your order, you&rsquo;ll also receive a coding interface. You will need to schedule a remote coding session during which our technician will adjust the image and make sure it&rsquo;s not stretched on your new screen. </span></p>\r\n<p><span style=\"font-weight: 400;\">To learn more about the installation, watch this video:</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/VTsmg2-oKUA\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>', NULL, NULL),
