(476, 197, 'Power-Trunk-Retrofit-F30F80F10', '2019-04-25 09:34:18', '2019-05-13 14:17:10', 1, 'choice', 0, 'A push of a button is all you’ll need to open & close your car trunk.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">When your hands are full of packages, bags and kids, what could be better than being able to close your trunk just by pressing a button? You will say &ldquo;nothing&rdquo; after you experience the convenience of BimmerTech&rsquo;s Power Trunk retrofit.</span></p>\r\n<p><span style=\"font-weight: 400;\">With this kit installed in your BMW, you&rsquo;ll be able to control the lid with:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The trunk release button on the remote key fob</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The button in the trunk handle, and an additional button built in to the inside of the trunk lid</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The trunk release button on the dashboard (if your vehicle has it)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The kick feature if your car is equipped with &nbsp;a factory or retrofitted Comfort Access system with this functionality</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">You can easily operate the trunk whenever you are around your car, and despite the convenience of using the key fob, you&rsquo;re not bound only to it. </span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/kRAhlbDViWY\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">You can customize the upgrade and choose the position the trunk lid opens to. Just set the lid to the preferred position with your hands and hold the button in the trunk lid for five seconds.</span></p>\r\n<p><span style=\"font-weight: 400;\">In addition, our Power Trunk features anti-pinch technology. It means that the lid will stop closing automatically in case there is any obstacle on its way, whether it&rsquo;s your or your children\'s hand, or you\'ve just overloaded your trunk.</span></p>', '<p><span style=\"font-weight: 400;\">The installation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help.</span></p>\r\n<p><span style=\"font-weight: 400;\">The process takes up to 3 hours and is fully plug &amp; play. The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Actuator </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Lock </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Trunk lid button </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Module</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness </span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">To learn more about the installation, watch this video:</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/pEVYHW6-41c\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>', NULL, NULL),
(477, 197, 'Power-Trunk-Retrofit-F25', '2019-04-25 12:29:01', '2019-04-25 12:36:45', 1, 'choice', 0, 'A push of a button is all you’ll need to open & close your car trunk.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">When your hands are full of packages, bags and kids, what could be better than being able to close your trunk just by pressing a button? You will say &ldquo;nothing&rdquo; after you experience the convenience of BimmerTech&rsquo;s Power Trunk retrofit.</span></p>\r\n<p><span style=\"font-weight: 400;\">With this kit installed in your BMW, you&rsquo;ll be able to control the lid with:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The trunk release button on the remote key fob</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The button in the trunk handle, and an additional button built in to the inside of the trunk lid</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The trunk release button on the dashboard (if your vehicle has it)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The kick feature if your car is equipped with &nbsp;a factory or retrofitted Comfort Access system with this functionality</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">You can easily operate the trunk whenever you are around your car, and despite the convenience of using the key fob, you&rsquo;re not bound only to it. </span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/IQ9k3ryFs6U\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe><a href=\"https://www.youtube.com/watch?v=IQ9k3ryFs6U\"></a></p>\r\n<p><span style=\"font-weight: 400;\">You can customize the upgrade and choose the position the trunk lid opens to. Just set the lid to the preferred position with your hands and hold the button in the trunk lid for five seconds. </span></p>\r\n<p><span style=\"font-weight: 400;\">What&rsquo;s more, our Power Trunk is equipped with the soft close feature that prevents the lid from slamming. </span></p>\r\n<p><span style=\"font-weight: 400;\">In addition, our Power Trunk features anti-pinch technology. It means that the lid will stop closing automatically in case there is any obstacle on its way, whether it&rsquo;s your or your children\'s hand, or you\'ve just overloaded your trunk.</span></p>', '<p><span style=\"font-weight: 400;\">The installation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help. </span></p>\r\n<p><span style=\"font-weight: 400;\">The process takes up to 3 hours and is fully plug &amp; play. The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Actuator </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Lock </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Trunk lid button </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Module</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness </span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">To learn more about the installation, watch this video:</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/pEVYHW6-41c\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>', NULL, NULL),
(478, 197, 'Power-Trunk-Retrofit-G30', '2019-04-25 12:38:04', '2019-05-13 14:21:52', 1, 'choice', 0, 'A push of a button is all you’ll need to open & close your car trunk.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">When your hands are full of packages, bags and kids, what could be better than being able to close your trunk just by pressing a button? You will say &ldquo;nothing&rdquo; after you experience the convenience of BimmerTech&rsquo;s Power Trunk retrofit.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/MrLa7FuaKTw\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">With this kit installed in your BMW, you&rsquo;ll be able to control the lid with:</span></p>\r\n<p><a href=\"https://www.youtube.com/watch?v=MrLa7FuaKTw\"></a></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The trunk release button on the remote key fob</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The button in the trunk handle, and an additional button built in to the inside of the trunk lid</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The trunk release button on the dashboard (if your vehicle has it)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The kick feature if your car is equipped with a factory or retrofitted Comfort Access system with this functionality</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">You can easily operate the trunk whenever you are around your car, and despite the convenience of using the key fob, you&rsquo;re not bound only to it.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/kRAhlbDViWY\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">You can customize the upgrade and choose the position the trunk lid opens to. Just set the lid to the preferred position with your hands and hold the button in the trunk lid for five seconds.</span></p>\r\n<p><span style=\"font-weight: 400;\">In addition, our Power Trunk features anti-pinch technology. It means that the lid will stop closing automatically in case there is any obstacle on its way, whether it&rsquo;s your or your children\'s hand, or you\'ve just overloaded your trunk.</span></p>', '<p><span style=\"font-weight: 400;\">The installation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help. </span></p>\r\n<p><span style=\"font-weight: 400;\">The process takes up to 3 hours and is fully plug &amp; play. The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Actuator </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Lock </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Trunk lid button </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Module</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness </span></li>\r\n</ul>', NULL, NULL),
(483, 198, 'MapUpdatePremiumCICCICR', '2019-04-26 12:50:54', '2019-05-13 14:31:16', 1, 'choice', 0, 'Plan your rides and detours with precision thanks to a map that’s always spot-on.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">They say time is money, so finding your way around as quickly as possible should be a priority. And keeping your map up-to-date ensures you\'ll always know the best and fastest routes to get to your destination. </span></p>\r\n<p><span style=\"font-weight: 400;\">When you regularly refresh your BMW navigation, your map shows you:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">New roads opened or existing ones closed</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Time-saving detours for your usual rides </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Almost 300 000 new points of interest added each year (hotels, gas stations, cafes, etc.)</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">BMW recommends performing a BMW navigation system map update at least once a year. For anybody who drives a lot, though, it&rsquo;s better to get new information every three to six months. </span></p>\r\n<p><span style=\"font-weight: 400;\">You are free to purchase a PREMIUM map update as a:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Standard one-time update &nbsp;</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Two-time repeat update </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Three-time repeat update &nbsp;</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">In case of our repeat options, the upgrade schedule is very flexible. You can:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Update the BMW GPS map system once a year</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Request a BMW road map update every three/six months if it&rsquo;s available from BMW itself &nbsp;(in some regions BMW releases the update just once a year)</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">Due to this flexibility, BMW GPS map updates are NOT sent automatically. You will need to contact us with your order number and VIN informing us that it&rsquo;s time for a new BMW navigation update. </span></p>', '<p><span style=\"font-weight: 400;\">The BMW map update USB process is effortless and straightforward. The kit has all the elements necessary for the navigation system upgrade:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">A USB stick with the latest map data </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">A BMW Navigation Map Certificate Release Code (FSC code)</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">You will be required to insert the USB stick into the USB port in the glove compartment. To start the update, you will need to type in the FSC activation code. The BMW map download from the pendrive to your head unit might take about 5&ndash;30 minutes &mdash; it depends on when the last BMW iDrive map update was. </span></p>\r\n<p><span style=\"font-weight: 400;\">When the process is finished, the confirmation will appear on your screen.</span></p>\r\n<p><a href=\"https://www.youtube.com/watch?v=nshmUd4-XVU\"><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/nshmUd4-XVU\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></a></p>\r\n<p><span style=\"font-weight: 400;\">If you would like to change the map region in your iDrive system, please contact us with your VIN to get an exact quote. The price specified here covers only the update to the latest map version for the region set in your iDrive by default. &nbsp;&nbsp;</span></p>', NULL, NULL),
