(492, 201, 'RearCamOEMF10_F11_F07_F25', '2019-04-29 08:49:14', '2019-05-14 09:07:38', 1, 'choice', 0, 'Turn parking into a pleasant and easy drill with the BMW original backup camera.', 1, '<p>*PDC is not included in the Rear View Camera (OEM Integration) kit. You can buy it separately here. Without PDC, a static image of a car will be displayed on one side of the screen.&nbsp;</p>\r\n\r\n<p>To learn more about the differences between the cameras, read our detailed <a href=\"https://www.bimmer-tech.net/blog/item/1-bimmertech-blog\" target=\"_blank\">blog post</a><strong>.</strong></p>', '<p>Check our 3 types of backup cameras and choose the park assist kit that suits you.&nbsp;</p>\r\n\r\n<p>To find out whether your vehicle is compatible with one, all or none of the upgrades, please provide your VIN.</p>', NULL, NULL, '<p>If you want to stay completely true to BMW even in your aftermarket choices, we&rsquo;re always happy to give you the options you\'re looking for. With our Rear View Camera (OEM), you get the same park assist upgrade that BMW offers and installs at the factory.</p>\r\n<p>Due to the OEM origin, the kit perfectly integrates into the bodywork of your car as well as your iDrive system. What&rsquo;s more, this BMW backup camera produces the highest picture quality on the market. But these are not the only features that make it stand out.</p>\r\n<p>Our Rear View Camera (OEM) is the only park assist retrofit compatible with Surround View, that provides 360 degree visibility, and Trailer Hitch mode. The latter makes it possible to change the angle of the camera and see the trailer hitch while backing up. And with Park Distance Control, no obstacle will escape your view!</p>\r\n<p>In addition, the wide-angle lens shows you a detailed, full-color and perspective-corrected view of every obstacle behind your car, making parking safe and easy.</p>', '<p><span style=\"font-weight: 400;\">The installation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help. </span></p>\r\n<p><span style=\"font-weight: 400;\">The process itself consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Activation coding (after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Trunk lid&ndash;mounted camera</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Camera module </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The way this BMW rear view camera is mounted is completely lease-friendly as there are no permanent modifications needed. </span></p>', NULL, NULL),
