(496, 186, 'ComfortAccessKit', '2019-04-29 09:47:23', '2019-05-14 11:12:09', 1, 'choice', 0, 'Lock or unlock the doors in your BMW without even taking a key out of your pocket.', 1, NULL, NULL, NULL, NULL, '<p>Unlocking your car has never been more convenient &mdash; BMW Comfort Access means you don&rsquo;t need to use a key or do anything except for touching the handle. So, whenever your hands are full and you can&rsquo;t rummage through your pockets, or you just want to get into your BMW fast, this upgrade will really make a difference.<custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/at1mZ9cRQWU\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p>Our Comfort Access keyless entry package consists of 2 or 4 handles with special remote sensors. They recognize your key at a range of up to 5ft, even if it\'s in your pocket or bag. This way you&rsquo;ll be able to unlock your car by placing your hand inside the handle, or lock it with a single touch on the handle ridges. The sound signal will let you know when the doors are open or closed.</p>\r\n<p>The handles feature a chrome trim and are professionally painted in any available BMW color, to perfectly match your vehicle. Please note that the paint on older vehicles may have faded slightly. In this case, the color of the handles may initially differ from your vehicle, but the difference will reduce with time.</p>\r\n<p>Our Comfort Access system allows you to customize the keyless entry process. In the iDrive menu settings you can choose to lock/unlock all doors or only the driver&rsquo;s door on the first touch. In some models, the system can also be set to automatically close the windows and sunroof, and fold in the mirrors, and no BMW comfort access key programming is needed.</p>\r\n<p>Thanks to the BMW comfort access trunk antenna, our upgrade extends the keyless entry to opening your trunk as well. Just touch the handle and the trunk lid will unlock. To know more, read our blog post on <a rel=\"noopener\" href=\"https://www.bimmer-tech.net/blog/item/57-how-to-bring-the-convenience-of-comfort-access-to-your-bmws-trunk\" target=\"_blank\">how Comfort Access can be integrated with Power Trunk</a>.</p>\r\n<p>Please note that our Comfort Access retrofit is not compatible with the BMW memory functions, such as saved seat settings. These will only work when manually unlocking your vehicle with the BMW remote control key fob associated with each driver profile. In addition, it may not be possible to unlock your vehicle with Comfort Access when it was locked manually with the remote key fob.</p>\r\n<p>BimmerTech does not guarantee that all features will function as described after any future software update, and can not be held liable for any change in the functionality of our BMW Comfort Access aftermarket kit caused by a third-party modification to your vehicle\'s hardware or software.</p>', '<p>The installation is fully plug &amp; play. It takes about 1 hour to assemble one door so that overall time depends on how many handles you order. In addition, no comfort access programming is required.</p>\r\n<p>The kit includes all BMW parts necessary for a complete installation:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">Main control box</li>\r\n<li style=\"font-weight: 400;\">2 or 4 handles</li>\r\n<li style=\"font-weight: 400;\">Trunk antenna</li>\r\n<li style=\"font-weight: 400;\">Wiring harness</li>\r\n</ul>\r\n<p>To learn more about the installation, watch this video:</p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/Pd8mOcC_uIU\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The instructional manual appears in your user dashboard, in the personal account, within 72 hours after the Comfort Access kit is shipped. It will be customized for your specific BMW model. But in case you have any additional questions, our technical support is always ready to help.</span></p>', NULL, NULL),
(497, 201, 'RearCamOEME70_E71', '2019-04-29 09:52:34', '2019-05-14 09:30:30', 1, 'choice', 0, 'Turn parking into a pleasant and easy drill with the BMW original backup camera.', 1, '<p>*PDC is not included in the Rear View Camera (OEM Integration) kit. You can buy it separately here. Without PDC, a static image of a car will be displayed on one side of the screen.&nbsp;</p>\r\n\r\n<p>To learn more about the differences between the cameras, read our detailed <a href=\"https://www.bimmer-tech.net/blog/item/1-bimmertech-blog\" target=\"_blank\">blog post</a><strong>. </strong></p>', '<p>Check our 3 types of backup cameras and choose the park assist kit that suits you.&nbsp;</p>\r\n\r\n<p>To find out whether your vehicle is compatible with one, all or none of the upgrades, please provide your VIN.</p>', NULL, NULL, '<p>If you want to stay completely true to BMW even in your aftermarket choices, we&rsquo;re always happy to give you the options you\'re looking for. With our Rear View Camera (OEM), you get the same park assist upgrade that BMW offers and installs at the factory.</p>\r\n<p>Due to the OEM origin, the kit perfectly integrates into the bodywork of your car as well as your iDrive system. What&rsquo;s more, this BMW backup camera produces the highest picture quality on the market. But these are not the only features that make it stand out.</p>\r\n<p>Our Rear View Camera (OEM) is the only park assist retrofit compatible with Surround View, that provides 360 degree visibility, and Trailer Hitch mode. The latter makes it possible to change the angle of the camera and see the trailer hitch while backing up. And with Park Distance Control, no obstacle will escape your view!</p>\r\n<p>In addition, the wide-angle lens shows you a detailed, full-color and perspective-corrected view of every obstacle behind your car, making parking safe and easy.</p>', '<p><span style=\"font-weight: 400;\">The installation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help. </span></p>\r\n<p><span style=\"font-weight: 400;\">The process itself consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Activation coding (after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Trunk lid&ndash;mounted camera</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Camera module </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The way this BMW rear view camera is mounted is completely lease-friendly as there are no permanent modifications needed.</span></p>', NULL, NULL),
(498, 186, 'SoftCloseRetrofit', '2019-04-29 10:19:09', '2019-05-14 11:13:32', 1, 'choice', 0, 'Hate slamming your doors? This upgrade will turn closing them into a gentle push.', 1, NULL, NULL, NULL, NULL, '<p>Extra convenience can never be too much. And after adding Soft Close to BMW, which makes it possible to shut the doors easily, quietly and securely, you will appreciate the additional comfort.</p>\r\n<p>How do BMW soft close doors work? You upgrade your car with special sensors that activate an electric motor to pull the BMW soft close automatic doors closed whenever they are within 1/4&Prime; of the lock. So, instead of slamming the door shut, you only need to gently push it until it&rsquo;s almost closed. And all this is done with minimal noise.</p>\r\n<p><br /><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/DpeGQTGbeVk\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p>The motorized system also works when you close the BMW soft close doors manually to ensure that they are fully shut.</p>', '<p><span style=\"font-weight: 400;\">The installation is fully plug &amp; play and doesn&rsquo;t require any coding. It takes about 4&ndash;6h.</span></p>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary to add Soft Close to your car:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">4 locks </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">2 metal plates </span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">To learn more about the installation, watch this video:</span><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/hLjfMRxwgPU\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The Soft Close installation manual will be ready and uploaded &nbsp;to your personal account within 72 hours after we ship it. The instructions will be customized for your specific BMW taking into account year/model and other specs. But in case of any additional questions, our technical support is always ready to help.</span></p>', NULL, NULL),
