(512, 202, 'CarPlayUSB', '2019-04-29 12:58:00', '2019-05-14 11:17:11', 1, 'choice', 0, 'The safest, most convenient way to use your iPhone apps while driving.', 1, NULL, NULL, NULL, 'usb_coding', '<p><span style=\"font-weight: 400;\">Do you dream of using Apple Maps on your car screen or listening to Spotify through the BMW speakers? All this is possible with BMW CarPlay &mdash; an original Apple system that lets you use your favorite iPhone apps on the iDrive display.</span></p>\r\n<p><span style=\"font-weight: 400;\">BMW CarPlay upgrade supports devices running iOS up to version 12. With the newest iOS, you can take advantage of Google Maps and Waze while navigating through the city. You\'ll be able to use the best features from both apps, like getting the quickest rerouting that will save you time (Waze), or using navigation even if you\'re offline (Google Maps).</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/KmfDZHQXUTM\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">After BMW CarPlay activation, you can use the factory car microphone for Siri Voice commands. This means that you can listen to and dictate text messages without distracting yourself from the road. Nothing stops you from making calls or checking up on your voicemail either, so you can be as available as you want while driving. In addition, you can ask Siri to turn on your favorite song &mdash; perfect for your driving playlist.</span></p>\r\n<p><span style=\"font-weight: 400;\">With this upgrade you don&rsquo;t need any cables; you wirelessly connect your iPhone to BMW CarPlay over WiFi. It&rsquo;s also very easy to switch between the iDrive and CarPlay interfaces, and operate both with the iDrive controller.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/8sYmji6nuZg\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">Please note that if you have a WiFi Antenna among available addons at the top </span><em><span style=\"font-weight: 400;\">Option </span></em><span style=\"font-weight: 400;\">section, it means that your car isn&rsquo;t equipped with it. We recommend adding the WiFi Antenna to your order as CarPlay won&rsquo;t work without it. </span></p>', '<p><span style=\"font-weight: 400;\">BMW CarPlay activation is performed via easy USB coding. The process is very simple: all you need to do is to save the coding file (that we send to you in an email) to a USB stick and connect it to your car. After following some easy instructions, software will be activated and CarPlay will be available on the iDrive screen.</span></p>', NULL, NULL),
(515, 202, 'CarPlayUSBFullScreen', '2019-04-29 13:27:39', '2019-05-14 11:17:22', 1, 'choice', 0, 'The safest, most convenient way to use your iPhone apps while driving.', 1, NULL, NULL, NULL, 'usb_coding', '<p><span style=\"font-weight: 400;\">Do you dream of using Apple Maps on your car screen or listening to Spotify through the BMW speakers? All this is possible with BMW CarPlay &mdash; an original Apple system that lets you use your favorite iPhone apps on the iDrive display.</span></p>\r\n<p><span style=\"font-weight: 400;\">BMW CarPlay upgrade supports devices running iOS up to version 12. With the newest iOS, you can take advantage of Google Maps and Waze while navigating through the city. You\'ll be able to use the best features from both apps, like getting the quickest rerouting that will save you time (Waze), or using navigation even if you\'re offline (Google Maps).</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/KmfDZHQXUTM\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">After BMW CarPlay activation, you can use the factory car microphone for Siri Voice commands. This means that you can listen to and dictate text messages without distracting yourself from the road. Nothing stops you from making calls or checking up on your voicemail either, so you can be as available as you want while driving. In addition, you can ask Siri to turn on your favorite song &mdash; perfect for your driving playlist.</span></p>\r\n<p><span style=\"font-weight: 400;\">With this upgrade you don&rsquo;t need any cables; you wirelessly connect your iPhone to BMW CarPlay over WiFi. It&rsquo;s also very easy to switch between the iDrive and CarPlay interfaces, and operate both with the iDrive controller.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/8sYmji6nuZg\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">Your BMW is compatible with Apple CarPlay full-screen mode. The file for its activation will be included into the order for free by default.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/_zQMtiHN1VE\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">Please note that if you have a WiFi Antenna among available addons at the top </span><em><span style=\"font-weight: 400;\">Option </span></em><span style=\"font-weight: 400;\">section, it means that your car isn&rsquo;t equipped with it. We recommend adding the WiFi Antenna to your order as CarPlay won&rsquo;t work without it. </span></p>', '<p><span style=\"font-weight: 400;\">BMW CarPlay activation is performed via easy USB coding. The process is very simple: all you need to do is to save the coding file (that we send to you in an email) to a USB stick and connect it to your car. After following some easy instructions, software will be activated and CarPlay will be available on the iDrive screen.</span></p>\r\n<p><span style=\"font-weight: 400;\">You can also activate or deactivate the full-screen mode whenever you like. In order to do that, you just need to use the coding file for this feature with the same instructions. </span></p>', NULL, NULL),
(517, 202, 'CarPlay_cable', '2019-04-29 13:40:56', '2019-05-14 11:20:22', 1, 'choice', 0, 'The safest, most convenient way to use your iPhone apps while driving.', 1, NULL, NULL, NULL, 'codding', '<p><span style=\"font-weight: 400;\">Do you dream of using Apple Maps on your car screen or listening to Spotify through the BMW speakers? All this is possible with BMW CarPlay &mdash; an original Apple system that lets you use your favorite iPhone apps on the iDrive display.</span></p>\r\n<p><span style=\"font-weight: 400;\">BMW CarPlay upgrade supports devices running iOS up to version 12. With the newest iOS, you can take advantage of Google Maps and Waze while navigating through the city. You\'ll be able to use the best features from both apps, like getting the quickest rerouting that will save you time (Waze), or using navigation even if you\'re offline (Google Maps).</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/KmfDZHQXUTM\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">After BMW CarPlay activation, you can use the factory car microphone for Siri Voice commands. This means that you can listen to and dictate text messages without distracting yourself from the road. Nothing stops you from making calls or checking up on your voicemail either, so you can be as available as you want while driving. In addition, you can ask Siri to turn on your favorite song &mdash; perfect for your driving playlist.</span></p>\r\n<p><span style=\"font-weight: 400;\">With this upgrade you don&rsquo;t need any cables; you wirelessly connect your iPhone to BMW CarPlay over WiFi. It&rsquo;s also very easy to switch between the iDrive and CarPlay interfaces, and operate both with the iDrive controller.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/8sYmji6nuZg\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">Please note that if you have a WiFi Antenna among available addons at the top </span><em><span style=\"font-weight: 400;\">Option </span></em><span style=\"font-weight: 400;\">section, it means that your car isn&rsquo;t equipped with it. We recommend adding the WiFi Antenna to your order as CarPlay won&rsquo;t work without it. </span></p>', '<p><span style=\"font-weight: 400;\">BMW CarPlay is activated through a remote cable coding session. It is a very simple process that takes no more than 30 minutes. After you complete your order, we send you a coding cable (if you don\'t have one and add it in the top </span><em><span style=\"font-weight: 400;\">Option</span></em><span style=\"font-weight: 400;\"> section). Once you receive it, you will be able to schedule a coding session for the time that suits you best. During the session, just plug in the cable, follow the instructions from our technician and CarPlay will be unlocked.</span></p>\r\n<p><span style=\"font-weight: 400;\">To prepare for your coding session you will need a laptop running Microsoft Windows and a WiFi internet network that you can connect to in your car. A Mac computer running Windows should work too. The coding cable must be plugged into your laptop&rsquo;s </span><a href=\"https://www.bimmer-tech.net/customer_support/Remote_coding/Instructions/EthernetPort.jpg\"><span style=\"font-weight: 400;\">Ethernet port</span></a><span style=\"font-weight: 400;\"> (if you don&rsquo;t have one, you can use an </span><a href=\"https://www.bimmer-tech.net/customer_support/Remote_coding/Instructions/LAN_MAC.jpg\"><span style=\"font-weight: 400;\">adapter</span></a><span style=\"font-weight: 400;\">).</span></p>\r\n<p><span style=\"font-weight: 400;\">Watch the video to understand the cable activation process better.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/EeNw6MPzpck\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The BimmerTech package includes everything necessary for unlocking CarPlay:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Remote activation service</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface (if you add it to your order in the top </span><em><span style=\"font-weight: 400;\">Option</span></em><span style=\"font-weight: 400;\"> section)</span></li>\r\n</ul>', NULL, NULL),
(520, 202, 'CarPlayCableFullScreen', '2019-04-29 13:59:22', '2019-05-14 11:20:11', 1, 'choice', 0, 'The safest, most convenient way to use your iPhone apps while driving.', 1, NULL, NULL, NULL, 'codding', '<p><span style=\"font-weight: 400;\">Do you dream of using Apple Maps on your car screen or listening to Spotify through the BMW speakers? All this is possible with BMW CarPlay &mdash; an original Apple system that lets you use your favorite iPhone apps on the iDrive display.</span></p>\r\n<p><span style=\"font-weight: 400;\">BMW CarPlay upgrade supports devices running iOS up to version 12. With the newest iOS, you can take advantage of Google Maps and Waze while navigating through the city. You\'ll be able to use the best features from both apps, like getting the quickest rerouting that will save you time (Waze), or using navigation even if you\'re offline (Google Maps).</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/KmfDZHQXUTM\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">After BMW CarPlay activation, you can use the factory car microphone for Siri Voice commands. This means that you can listen to and dictate text messages without distracting yourself from the road. Nothing stops you from making calls or checking up on your voicemail either, so you can be as available as you want while driving. In addition, you can ask Siri to turn on your favorite song &mdash; perfect for your driving playlist.</span></p>\r\n<p><span style=\"font-weight: 400;\">With this upgrade you don&rsquo;t need any cables; you wirelessly connect your iPhone to BMW CarPlay over WiFi. It&rsquo;s also very easy to switch between the iDrive and CarPlay interfaces, and operate both with the iDrive controller.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/8sYmji6nuZg\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">Your BMW is compatible with Apple CarPlay full-screen mode. Its activation will be included into the order for free by default. If you don&rsquo;t want the full-screen mode, it won&rsquo;t be coded on request during the coding session.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/_zQMtiHN1VE\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">Please note that if you have a WiFi Antenna among available addons at the top </span><em><span style=\"font-weight: 400;\">Option </span></em><span style=\"font-weight: 400;\">section, it means that your car isn&rsquo;t equipped with it. We recommend adding the WiFi Antenna to your order as CarPlay won&rsquo;t work without it. </span></p>', '<p><span style=\"font-weight: 400;\">BMW CarPlay is activated through a remote cable coding session. It is a very simple process that takes no more than 30 minutes. After you complete your order, we send you a coding cable (if you don\'t have one and add it in the top </span><em><span style=\"font-weight: 400;\">Option</span></em><span style=\"font-weight: 400;\"> section). Once you receive it, you will be able to schedule a coding session for the time that suits you best. During the session, just plug in the cable, follow the instructions from our technician and CarPlay will be unlocked.</span></p>\r\n<p><span style=\"font-weight: 400;\">To prepare for your coding session you will need a laptop running Microsoft Windows and a WiFi internet network that you can connect to in your car. A Mac computer running Windows should work too. The coding cable must be plugged into your laptop&rsquo;s </span><a href=\"https://www.bimmer-tech.net/customer_support/Remote_coding/Instructions/EthernetPort.jpg\"><span style=\"font-weight: 400;\">Ethernet port</span></a><span style=\"font-weight: 400;\"> (if you don&rsquo;t have one, you can use an </span><a href=\"https://www.bimmer-tech.net/customer_support/Remote_coding/Instructions/LAN_MAC.jpg\"><span style=\"font-weight: 400;\">adapter</span></a><span style=\"font-weight: 400;\">).</span></p>\r\n<p><span style=\"font-weight: 400;\">Watch the video to understand the cable activation process better.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/EeNw6MPzpck\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The BimmerTech package includes everything necessary for unlocking CarPlay:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Remote activation service</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface (if you add it to your order in the top </span><em><span style=\"font-weight: 400;\">Option</span></em><span style=\"font-weight: 400;\"> section)</span></li>\r\n</ul>', NULL, NULL),
(521, 212, 'KeyFobEComAccess', '2019-04-30 06:32:26', '2019-05-13 12:55:48', 1, 'choice', 0, 'Replace a damaged key fob or get a spare one straight from the BMW factory.', 1, NULL, NULL, NULL, NULL, '<p>Sometimes remote key fobs get damaged, and sometimes you need spares for your family. In any of these scenarios you might think that getting a replacement is cumbersome. But we assure you that with BimmerTech the process is simple and smooth.</p>\r\n<p>You can order a BMW key fob from us and get a perfectly matched retrofit in a few days. It comes pre-programmed by BMW itself for your specific model and resembles your factory remote key, having the same look and features. It doesn&rsquo;t require any coding &mdash; you just need to follow a few instructions to get it activated and that&rsquo;s all.</p>\r\n<p>The internal blade from your original key fob will fit perfectly into the replacement. However, if you&rsquo;d like to purchase a new one, you can add it to your order in our Options section.</p>\r\n<p>The BMW replacement key fob will be 100% compatible with your vehicle\'s ignition immobilizer code. It includes an original BMW embedded transponder ignition lock chip.</p>\r\n<p>Please note that we don&rsquo;t fulfill orders without evidence of ownership of the vehicle. After you place an order and make a payment, you need to send a copy of your vehicle registration and driver\'s license, both with the same name, to keyfobs@bimmer-tech.net, complete with your order number.</p>', '<p><span style=\"font-weight: 400;\">The activation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help.</span></p>\r\n<p><span style=\"font-weight: 400;\">To activate your key fob: </span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Turn your car on and off with your existing key </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Insert your new </span>BMW remote key</li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hold it all the way in the slot for 20 seconds until it&rsquo;s activated</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">In order to use Comfort Access with your new key fob, it is necessary to delete your previous key fob from the vehicle\'s memory. If you want a professional BimmerTech technician do it for you, add the Comfort Access Coding and a coding cable to your order in the top </span><em><span style=\"font-weight: 400;\">Option </span></em><span style=\"font-weight: 400;\">section. </span></p>\r\n<p><span style=\"font-weight: 400;\">The Comfort Access Coding is done through a remote cable coding session. It is a very simple process that takes no more than 30 minutes. After you complete your order, we send you a coding cable (if you don\'t have one and add it in the top </span><em><span style=\"font-weight: 400;\">Option</span></em><span style=\"font-weight: 400;\"> section). Once you receive it, you will be able to schedule a coding session for the time that suits you best. During the session, just plug in the cable and follow the instructions from our technician.</span></p>\r\n<p><span style=\"font-weight: 400;\">To prepare for your coding session you will need a laptop running Microsoft Windows and a WiFi internet network that you can connect to in your car. A Mac computer running Windows should work too, but it may not be compatible with some E-series vehicles. The coding cable must be plugged into your laptop&rsquo;s regular USB port.</span></p>\r\n<p><span style=\"font-weight: 400;\">Watch the video to understand the cable activation process better.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/EeNw6MPzpck\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>', NULL, NULL),
(523, 203, '6WBClusterF3x_HUD', '2019-04-30 07:04:29', '2019-04-30 09:21:17', 1, 'choice', 0, 'Experience Comfort, Sport or Eco Pro modes in a new way with a digital instrument cluster.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Amplifying your driving experience is not a whim &mdash; it&rsquo;s making the absolute most of your BMW&rsquo;s potential. And the 6WB BMW OEM Digital Cluster is exactly what your car needs to reach the next level of comfort and confidence behind the wheel. </span></p>\r\n<p><span style=\"font-weight: 400;\">The instrument panel is fully digitized. It has different setups for three driving modes &mdash; a rather usual and calm display for Comfort mode, a touch of blue and eco style features in Eco Pro mode and a more aggressive look in Sport Mode. Sport+ setup appears the same as the Sport one, save for the deactivated traction control. </span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/tWfKnY2pCYI\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The center portion of the 6WB cluster can show your car in real time &mdash; when some of your doors are opened, it is accurately displayed on the panel. When you turn on navigation, the instructions will be also indicated on the digital cluster. </span></p>\r\n<p><span style=\"font-weight: 400;\">In addition, this multifunctional instrument panel shows the information from the driver assistance systems, such as the nearest gas stations, speed limits, etc. </span></p>\r\n<p><span style=\"font-weight: 400;\">Please note that after installation, some of the navigation directions will be shown on the 6WB cluster, not on the HUD. &nbsp;</span></p>', '<p><span style=\"font-weight: 400;\">The process itself consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 1h)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding (after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">6WB digital instrument cluster </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The way this 6WB Digital Cluster mounting is completely lease-friendly as there are no permanent modifications needed. </span></p>\r\n<p><span style=\"font-weight: 400;\">To know more about installation, watch the video:</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/DFNzsh_-SJk\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">You will be able to find the 6WB Digital cluster installation manual in your personal account within 72 hours after the product is shipped. The manual will be created and customized for your exact car. But in case of any additional questions, our technical support is always ready to help. </span></p>', NULL, NULL),
(524, 203, '6WBClusterF3x', '2019-04-30 07:38:37', '2019-04-30 09:12:56', 1, 'choice', 0, 'Experience Comfort, Sport or Eco Pro modes in a new way with a digital instrument cluster.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Amplifying your driving experience is not a whim &mdash; it&rsquo;s making the absolute most of your BMW&rsquo;s potential. And the 6WB BMW OEM Digital Cluster is exactly what your car needs to reach the next level of comfort and confidence behind the wheel. </span></p>\r\n<p><span style=\"font-weight: 400;\">The instrument panel is fully digitized. It has different setups for three driving modes &mdash; a rather usual and calm display for Comfort mode, a touch of blue and eco style features in Eco Pro mode and a more aggressive look in Sport Mode. Sport+ setup appears the same as the Sport one, save for the deactivated traction control. </span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/tWfKnY2pCYI\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The center portion of the 6WB cluster can show your car in real time &mdash; when some of your doors are opened, it is accurately displayed on the panel. When you turn on navigation, the instructions will be also indicated on the digital cluster. </span></p>\r\n<p><span style=\"font-weight: 400;\">In addition, this multifunctional instrument panel shows the information from the driver assistance systems, such as the nearest gas stations, speed limits, etc. </span></p>', '<p><span style=\"font-weight: 400;\">The process itself consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 1h)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding (after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">6WB digital instrument cluster </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The way this 6WB Digital Cluster mounting is completely lease-friendly as there are no permanent modifications needed. </span></p>\r\n<p><span style=\"font-weight: 400;\">To know more about installation, watch the video:</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/DFNzsh_-SJk\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">You will be able to find the 6WB Digital cluster installation manual in your personal account within 72 hours after the product is shipped. The manual will be created and customized for your exact car. But in case of any additional questions, our technical support is always ready to help. </span></p>', NULL, NULL),
