"font-weight: 400;\">Coding (after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">6WB digital instrument cluster </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The way this 6WB Digital Cluster mounting is completely lease-friendly as there are no permanent modifications needed. </span></p>\r\n<p><span style=\"font-weight: 400;\">To know more about installation, watch the video:</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/DFNzsh_-SJk\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">You will be able to find the 6WB Digital cluster installation manual in your personal account within 72 hours after the product is shipped. The manual will be created and customized for your exact car. But in case of any additional questions, our technical support is always ready to help. </span></p>', NULL, NULL),
(526, 203, '6WBCluster5_6_7_X3_X4_Series', '2019-04-30 08:12:42', '2019-05-02 09:59:41', 1, 'choice', 0, 'Experience Comfort, Sport or Eco Pro modes in a new way with a digital instrument cluster.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Amplifying your driving experience is not a whim &mdash; it&rsquo;s making the absolute most of your BMW&rsquo;s potential. And the 6WB BMW OEM Digital Cluster is exactly what your car needs to reach the next level of comfort and confidence behind the wheel. </span></p>\r\n<p><span style=\"font-weight: 400;\">The instrument panel is fully digitized. It has different setups for three driving modes &mdash; a rather usual and calm display for Comfort mode, a touch of blue and eco style features in Eco Pro mode and a more aggressive look in Sport Mode. Sport+ setup appears the same as the Sport one, save for the deactivated traction control. </span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/tWfKnY2pCYI\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The center portion of the 6WB cluster can show your car in real time &mdash; when some of your doors are opened, it is accurately displayed on the panel. When you turn on navigation, the instructions will be also indicated on the digital cluster. </span></p>\r\n<p><span style=\"font-weight: 400;\">In addition, this multifunctional instrument panel shows the information from the driver assistance systems, such as the nearest gas stations, speed limits, etc. </span></p>', '<p><span style=\"font-weight: 400;\">The process itself consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 1h)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding (after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">6WB digital instrument cluster </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The way this 6WB Digital Cluster mounting is completely lease-friendly as there are no permanent modifications needed. </span></p>\r\n<p><span style=\"font-weight: 400;\">To know more about installation, watch the video:</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/DFNzsh_-SJk\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">You will be able to find the 6WB Digital cluster installation manual in your personal account within 72 hours after the product is shipped. The manual will be created and customized for your exact car. But in case of any additional questions, our technical support is always ready to help. </span></p>', NULL, NULL);
INSERT INTO `sylius_product` (`id`, `main_taxon_id`, `code`, `created_at`, `updated_at`, `enabled`, `variant_selection_method`, `average_rating`, `taxon_decription`, `recomended`, `buyers_footer_content`, `buyers_header_content`, `addon_information`, `type`, `description`, `installer`, `flagName`, `flagColor_id`) VALUES
(527, 204, 'PDC_Eseries', '2019-04-30 09:37:17', '2019-04-30 11:49:30', 1, 'choice', 0, 'Know about all the obstacles around your car, to park and manoeuvre in tight spaces.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Tired of bending, twisting and constantly looking around when you try to park or drive out of a space tightly packed with other vehicles? We perfectly understand the feeling, but you can easily change the situation with our cutting-edge park assist retrofit.</span></p>\r\n<p><span style=\"font-weight: 400;\">BMW active Park Distance Control (PDC) equips your car with sensors that use ultrasound to measure the distance to the nearest obstacles. The system turns on when your vehicle is less than 80 cm away from the closest large object and approaching, or less than 30cm when your BMW isn&rsquo;t moving. </span></p>\r\n<p><span style=\"font-weight: 400;\">PDC retrofit warns you about any obstacles with a distinctive acoustic signal, and different warning colors on the iDrive screen as your vehicle draws closer. </span></p>\r\n<p><span style=\"font-weight: 400;\">Park Distance Control kit allows upgrading the front, rear or both bumpers of your BMW. They will be painted to match the exact color of your vehicle. Please note that the default kit contains only 4 sensors for the back of your car. If you want to exchange them for the front or purchase a kit for the whole vehicle, modify your order in the </span><em><span style=\"font-weight: 400;\">Option </span></em><span style=\"font-weight: 400;\">section in the top right corner.</span></p>', '<p><span style=\"font-weight: 400;\">The installation manual for your BMW model will be added into your personal account. Within 72 hours after PDC is shipped, you will receive an email notification that will inform you about the instructions. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help. </span></p>\r\n<p><span style=\"font-weight: 400;\">The process itself consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding (after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">4 (or 8) PDC sensors</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">PDC control unit </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The installation is completely reversible and doesn&rsquo;t require any permanent modifications to your vehicle. </span></p>', NULL, NULL),
(528, 204, 'PDC_Fseries', '2019-04-30 10:06:30', '2019-04-30 11:50:12', 1, 'choice', 0, 'Know about all the obstacles around your car, to park and manoeuvre in tight spaces.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Tired of bending, twisting and constantly looking around when you try to park or drive out of a space tightly packed with other vehicles? We perfectly understand the feeling, but you can easily change the situation with our cutting-edge park assist retrofit.</span></p>\r\n<p><span style=\"font-weight: 400;\">BMW active Park Distance Control (PDC) equips your car with sensors that use ultrasound to measure the distance to the nearest obstacles. The system turns on when your vehicle is less than 80 cm away from the closest large object and approaching, or less than 30cm when your BMW isn&rsquo;t moving. </span></p>\r\n<p><span style=\"font-weight: 400;\">PDC retrofit warns you about any obstacles with a distinctive acoustic signal, and different warning colors on the iDrive screen as your vehicle draws closer. </span></p>\r\n<p><span style=\"font-weight: 400;\">Park Distance Control kit allows upgrading the front, rear or both bumpers of your BMW. They will be painted to match the exact color of your vehicle. Please note that the default kit contains only 4 sensors for the back of your car. If you want to exchange them for the front or purchase a kit for the whole vehicle, modify your order in the </span><em><span style=\"font-weight: 400;\">Option </span></em><span style=\"font-weight: 400;\">section in the top right corner.</span></p>', '<p><span style=\"font-weight: 400;\">The installation manual for your BMW model will be added into your personal account. Within 72 hours after PDC is shipped, you will receive an email notification that will inform you about the instructions. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help. </span></p>\r\n<p><span style=\"font-weight: 400;\">The process itself consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding (after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">4 (or 8) PDC sensors</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">PDC control unit </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The installation is completely reversible and doesn&rsquo;t require any permanent modifications to your vehicle. </span></p>', NULL, NULL),
(529, 174, 'SurroundView', '2019-04-30 10:15:45', '2019-04-30 11:36:52', 1, 'choice', 0, 'Enjoy a 360-degree camera view around your car and don’t let any obstacles sneak up on you.', 1, NULL, NULL, NULL, NULL, '<p>If you thought navigating through narrow roads and in tight parking spaces couldn&rsquo;t get any smarter, you really underestimate BMW. Surround View is the ultimate car camera system that will make difficult traffic situations seem just another daily routine.</p>\r\n<p>Surround View camera technology: how does it work? This intelligent park assist retrofit uses cameras in the exterior mirrors, at the front and back of your car to produce a 360-degree overview around your vehicle. It shows the images on the control display and becomes incredibly handy in:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">Tight parking spaces;</li>\r\n<li style=\"font-weight: 400;\">Junctions;</li>\r\n<li style=\"font-weight: 400;\">Roads with restricted view;</li>\r\n<li style=\"font-weight: 400;\">Unclear traffic situations.</li>\r\n</ul>\r\n<p>360 degree camera view can be activated after your BMW is put in reverse and the rear view camera mode appears on the screen. With the help of the iDrive touch controller you can turn off the RVC systems, instead activating a bird\'s-eye camera system of your car. What&rsquo;s more, the iDrive will remember your choice and you won&rsquo;t have to go through the same procedure every time.</p>', '<p><span style=\"font-weight: 400;\">The manual for installing the </span>360 degree car camera system<span style=\"font-weight: 400;\"> will be added by our technical support to your user dashboard. You will receive an email notification the moment it&rsquo;s there and will be able to log in to your account to check it out. It will be created for your specific BMW model and will contain all the details on the installation. But in case of any additional questions, our technical support is always ready to help. </span></p>\r\n<p><span style=\"font-weight: 400;\">The process itself consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding (after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Surround View module</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">2 exterior mirrors with cameras</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The installation is completely reversible and doesn&rsquo;t require any permanent modifications to your vehicle. </span></p>', NULL, NULL),
(530, 177, 'SmartView_ATV3', '2019-04-30 10:51:36', '2019-05-17 11:23:18', 1, 'choice', 0, 'Mirror your iPhone screen onto the car display and enjoy the power of Apple TV3.', 1, NULL, '<p>Check our 3 types of SmartView devices and choose the mirroring kit that suits you.&nbsp;</p>', NULL, NULL, '<p>Do you want to bring your favorite Apple apps into your favorite car? BimmerTech makes it possible with a functional multimedia device &mdash; SmartView HD Apple TV3 &mdash; that provides plenty of cool features.</p>\r\n<p>This upgrade uses screen mirroring in car &mdash; a technology that lets you cast the screen of your mobile device onto the BMW&rsquo;s display, and stream audio through the car speakers. It means that you can:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">Let your passengers see photos and videos on a high-resolution screen</li>\r\n<li style=\"font-weight: 400;\">Get access to popular navigation apps like Google Maps, Waze or Apple Maps</li>\r\n<li style=\"font-weight: 400;\">Surf the web/check emails while parked</li>\r\n<li style=\"font-weight: 400;\">Stream music from your iPhone/iPad through Spotify, Tidal, etc.</li>\r\n</ul>\r\n<p>In addition, there are native apps included into the Apple TV3 system. You can use Apple TV in car without connecting your iPhone/iPad to SmartView HD &mdash; turn on your favorite TV shows on Hulu, Netflix or HBO for passengers, view live sports as well as check the weather and the latest news.</p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/fl1T-y7sJu8\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p>Screen mirroring over WiFi with Apple TV3 is perfect for users who prefer devices with iOS software. It is built around Apple\'s own hardware and protocols (wireless AirPlay) to ensure complete compatibility with your iPhone. The devices compatible with screen sharing over SmartView Apple TV3 include iPhone, iPad, iPod Touch, etc. (the full list can be found <a href=\"https://support.apple.com/en-gb/HT208728#airplay\">here</a>). &nbsp;</p>\r\n<p>Apple no longer produces Apple TV3 modules. We will continue to provide SmartView HD Apple TV3 using refurbished Apple devices. As refurbished stock, this hardware may show some aesthetic wear, but will still be covered by our warranty as part of the SmartView HD kit.</p>\r\n<p>Please note that screen mirroring of some apps or content may be blocked due to the copyright-holder\'s DRM. BimmerTech is not responsible for the continued compatibility of any third-party apps with SmartView HD Apple TV3. Please confirm that you can screen share the app or content you wish to use over AirPlay.</p>', '<p><span style=\"font-weight: 400;\">The installation instructions for SmartView</span> screen mirroring device<span style=\"font-weight: 400;\"> &nbsp;appear in your personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help. </span></p>\r\n<p><span style=\"font-weight: 400;\">The installation is fully plug &amp; play as well as 100% reversible. The whole process itself may take up to 2h. </span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/7h_b8z7qxGk\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The kit includes all the parts required for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Apple TV3</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Remote control </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Multimedia interface (MMI)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n</ul>', NULL, NULL),
(531, 177, 'SmartView_ATV4', '2019-04-30 11:33:43', '2019-05-17 11:25:58', 1, 'choice', 0, 'Get your iPhone apps onto the iDrive screen and use Apple TV4 to amplify the experience.', 1, NULL, '<p>Check our 3 types of SmartView devices and choose the mirroring kit that suits you.</p>', NULL, NULL, '<p>If you&rsquo;re dreaming of screen sharing your iPhone or iPad apps on your native BMW display, you can say that BimmerTech makes wishes come true.</p>\r\n<p>SmartView HD Apple TV4 uses screen mirroring over WiFi &mdash; a technology that lets you cast the screen of your mobile device onto the BMW&rsquo;s display, and stream audio through the car speakers. It means that our screen mirroring device makes it possible to:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">Let your passengers enjoy the photos and videos on a high-resolution screen</li>\r\n<li style=\"font-weight: 400;\">Gain access to popular navigation apps, for instance Waze, Google Maps, Apple Maps and so on</li>\r\n<li style=\"font-weight: 400;\">Browse the internet or check emails while parked</li>\r\n<li style=\"font-weight: 400;\">Listen to Spotify, Tidal or other music apps through the BMW&rsquo;s stereo</li>\r\n</ul>\r\n<p>What&rsquo;s more, the 4th generation Apple TV, inbuilt into this SmartView device, has its own App Store with thousands of apps and games. Thus, you\'ll be able to run entertainment applications like Amazon Prime Video, Hulu, Netflix and Minecraft straight from the Apple TV in car system without using your phone. You can check the full list of supported apps for your country <a href=\"https://support.apple.com/en-us/HT208083\">here</a>.</p>\r\n<p>Unlike previous generations, Apple TV4 also comes with the Siri virtual assistant. Now instead of typing in the search bar you can tell Siri what you want and confirm your request. How cool is that?</p>\r\n<p>SmartView ATV4 screen mirroring device is created for iOS users who expect the most from their BMW &ldquo;teaming up&rdquo; with an iPhone. It is more versatile, faster and more advanced than Apple TV3. A dual A8 core processor and an improved remote control with a glass trackpad will give you the ultimate experience of mirroring your iPhone, iPad or any other Apple device that supports the Wireless Airplay protocol.</p>\r\n<p>Please note that mirroring of some apps or content through the media streaming box may be blocked due to the copyright-holder\'s DRM. BimmerTech is not responsible for the continued compatibility of any third-party apps with screen sharing software. Please confirm the app or content you wish to use can be streamed over AirPlay.</p>', '<p>The SmartView HD Apple TV4 installation is fully plug &amp; play as well as 100% reversible. The whole process itself may take up to 2h.</p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/7h_b8z7qxGk\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p>The kit includes all the BMW parts required for a complete installation:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">Apple TV4 &nbsp;</li>\r\n<li style=\"font-weight: 400;\">Remote control</li>\r\n<li style=\"font-weight: 400;\">Multimedia interface (MMI) for smartphone mirroring in car</li>\r\n<li style=\"font-weight: 400;\">Wiring harness</li>\r\n</ul>\r\n<p>The instructions for installing the screen mirroring iPhone device will be available in your personal account. You will be able to access them within 72 hours after the product is shipped to you. In case of any questions regarding installation or SmartView HD functions, please contact our technical support team.</p>', NULL, NULL),
(532, 177, 'SmartView_Flex', '2019-04-30 11:59:23', '2019-05-17 11:26:54', 1, 'choice', 0, 'Cast the screen of an Android or iOS phone on the iDrive display with a single device.', 1, NULL, '<p>Check our 3 types of SmartView devices and choose the mirroring kit that suits you.</p>', NULL, NULL, '<p>Screen mirroring your mobile device on the iDrive display is a very handy feature when you need an access to popular navigation apps or want to turn on a movie for your passengers. But being able to connect both iPhones and Android smartphones is even a more useful attribute, especially when, say, your family and friends with different mobile devices want to show off their photos on a bigger screen. And this is exactly what SmartView HD Flex does.</p>\r\n<p>What is screen mirroring? This is a technology that lets you cast the screen of your mobile device onto the BMW&rsquo;s display, and stream audio through the car speakers. Pairing up our screen mirroring device with your smartphone, you can use your favorite apps in your BMW, including Google Maps or Waze to navigate through the city, Spotify or Tidal to stream your favorite music, and so on.</p>\r\n<p>SmartView HD Flex lets you screen share Android and iOS devices as well as phones or tablets running other types of software. SmartView HD Flex supports:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">iOS up to version 12.0</li>\r\n<li style=\"font-weight: 400;\">Android up to version 9.0</li>\r\n<li style=\"font-weight: 400;\">Blackberry 10</li>\r\n<li style=\"font-weight: 400;\">Windows 8.1/10</li>\r\n<li style=\"font-weight: 400;\">Linux</li>\r\n<li style=\"font-weight: 400;\">Other operating systems with AirPlay/Miracast support.</li>\r\n</ul>\r\n<p>Please note that not all devices running these operating systems support screen mirroring over WiFi. Make sure your smartphone or tablet are compatible with screen sharing software before purchasing SmartView HD Flex.</p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/5PguInq3imA\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p>Apart from screen mirroring Android &amp; iOS devices, SmartView HD Flex generates its own wireless network, meaning there is no need for a Personal Hotspot or mobile modem. In addition, it allows screen mirroring iPhone, Samsung or any other device both when the car is parked &amp; in motion. The wireless display and audio streaming has never been more convenient.</p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/qBvaruad0Yo\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p>To keep your SmartView HD Flex working properly, it may occasionally be required to install a firmware update. New SmartView HD Flex units come with the latest firmware preinstalled. If you already have a unit that does not have the latest firmware, update now by <a href=\"https://bimmer-tech.net/customer_support/SmartViewHDFlex/install.img\">downloading the update</a> and following the video instructions.</p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/FLpmLU4tMSM\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p>Please note that mirroring of some apps or content may be blocked due to the copyright-holder\'s DRM. BimmerTech is not responsible for the continued compatibility of any third-party apps with SmartView HD Flex. Please confirm that the app or content you wish to use can be streamed over AirPlay/Miracast.</p>', '<p><span style=\"font-weight: 400;\">The installation instructions appear in your personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help. </span></p>\r\n<p><span style=\"font-weight: 400;\">The installation is fully plug &amp; play as well as 100% reversible. The whole process itself may take up to 2h. </span></p>\r\n<p><span style=\"font-weight: 400;\">The kit includes all the parts required for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Mirroring module &nbsp;</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Multimedia interface (MMI)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n</ul>', NULL, NULL),
(534, NULL, 'SmartViewATV3AddOn', '2019-05-06 10:29:32', '2019-05-06 10:33:44', 1, 'choice', 0, NULL, 0, NULL, NULL, 'This upgrade allows for iPhone screen mirroring which means that you can cast the screen of your iOS device onto the BMW iDrive display. This gives you a chance to show photos or play videos on a hi-res display, as well as play music through your BMW’s speakers.', NULL, NULL, NULL, NULL, NULL),
(535, NULL, 'SmartViewATV4AddOn', '2019-05-06 10:34:04', '2019-05-06 10:35:29', 1, 'choice', 0, NULL, 0, NULL, NULL, 'Iphone screen mirroring and Apple TV4 with an inbuilt App Store will let you use your favorite applications on the BMW iDrive screen in different ways. You can either mirror some apps or use them through the iDrive system without engaging your iPhone. There is also a possibility to use Siri virtual assistant not to take your eyes of the road.', NULL, NULL, NULL, NULL, NULL),
(536, NULL, 'SmartViewFlexAddOn', '2019-05-06 10:39:17', '2019-05-06 10:40:09', 1, 'choice', 0, NULL, 0, NULL, NULL, 'It’s a screen mirroring device that lets you cast the screen of both Android and iOS devices onto your BMW’s display. It has its own WiFi network to connect the smartphone to the iDrive and plays audio through the BMW’s AUX port.', NULL, NULL, NULL, NULL, NULL),
(537, NULL, 'IntKeyBladeE_42_AddOn', '2019-05-07 08:15:29', '2019-05-10 10:55:17', 1, 'choice', 0, NULL, 0, NULL, NULL, 'The key blade from your original key fob will fit perfectly into the replacement. But you can order an extra one in case you lost it or need a spare key.', NULL, NULL, NULL, NULL, NULL),
(538, 182, 'NBT_NBTEVO_act', '2019-05-08 08:12:41', '2019-05-08 13:17:57', 1, 'choice', 0, 'Let us program your NBT/NBT Evo head unit adding a few cool features on the way.', 1, NULL, NULL, NULL, 'codding', '<p>Retrofitting your car with a new BMW navigation system can&rsquo;t be completed without professional and high quality BMW coding. And with a decade of experience, we at BimmerTech know exactly how to do it right.</p>\r\n<p>Our NBT / NBT Evo Remote Software Activation provides you with the service you need in the comfort of your own home. Our competent technician will program your new BMW navigation, update the unit to match the configurations of your vehicle and activate Voice Control and Video &amp; Services in motion that will make trips in your car much more enjoyable.</p>\r\n<p>This way you&rsquo;ll be able to use original BMW maps, control the system with simple verbal commands and turn on movies for your passengers. With such a BMW software update and hardware upgrade, how could your driving experience get any better than that?</p>', '<p>NBT Software Activation is performed through a remote coding session with a dedicated BimmerTech technician.</p>\r\n<p>It is a very simple process that takes no more than 30 minutes. After you complete your order, we send you a coding cable (if you don\'t have one and add it in the top <em>Option</em> section). Once you receive it, you will be able to schedule a coding session for the time that suits you best. During the session, you will need to just plug in the cable, download some BMW coding software and follow the instructions from our technician. <span>Voice Control&nbsp;</span></p>\r\n<p>To prepare for your BMW iDrive update you will need a laptop running Microsoft Windows and a WiFi internet network that you can connect to in your car. A Mac computer running Windows should work too. The coding cable must be plugged into your laptop&rsquo;s <a href=\"https://www.bimmer-tech.net/customer_support/Remote_coding/Instructions/EthernetPort.jpg\">Ethernet port</a> (if you don&rsquo;t have one, you can use an <a href=\"https://www.bimmer-tech.net/customer_support/Remote_coding/Instructions/LAN_MAC.jpg\">adapter</a>).</p>\r\n<p>Watch the video to understand the cable activation process better.</p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/EeNw6MPzpck\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p>The NBT/NBT Evo Software Activation package includes everything necessary for cable coding:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">Remote activation service</li>\r\n<li style=\"font-weight: 400;\">Coding interface (if you add it to your order in the top <em>Option</em> section)</li>\r\n</ul>', NULL, NULL),
(539, 182, 'iDrive_Touch_Contr_Retrofit', '2019-05-08 08:58:10', '2019-05-14 12:40:51', 1, 'choice', 0, 'A touchpad where you write letters instead of using the scroll wheel? Yes, please!', 1, NULL, NULL, NULL, NULL, '<p>If you long for a more comfortable and safer way to use your BMW system, the iDrive Touch Controller is the retrofit designed to satisfy those needs.</p>\r\n<p>Its primary improvement over the older version is the iDrive touchpad. It lets you write with your finger on the top of the iDrive controller and the handwriting recognition technology decodes the letters. It can be used while:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">Typing in the necessary address in maps</li>\r\n<li style=\"font-weight: 400;\">Looking for a video or song in the multimedia section</li>\r\n<li style=\"font-weight: 400;\">Searching contacts or phone numbers</li>\r\n</ul>\r\n<p>This type of input is much safer than the traditional wheel scroll because you don&rsquo;t need to distract yourself from the road choosing the right character &mdash; just write the letter on the touch-sensitive pad and the audio feedback will identify and confirm it.</p>\r\n<p>In addition, you can use the touchpad to zoom in or out on the map. This is a handy feature when you want to see the area in more detail.</p>\r\n<p>If your BMW wasn&rsquo;t equipped with the iDrive Touch Controller from the factory, <a rel=\"noopener\" href=\"https://www.bimmer-tech.net/blog/item/6-upgrading-your-bmw-idrive-controller-to-idrive-touch-with-a-diy-retrofit-kit\" target=\"_blank\">you can easily retrofit it with our kit</a>.</p>', '<p>The iDrive controller replacement instructions will be ready in your personal account within 72 hours after it&rsquo;s shipped. They will contain all the details on how to replace iDrive controller in your specific BMW model. But if you will have questions before, during or after installation, you can always contact our support team.</p>\r\n<p>The process itself consists of 2 main steps:</p>\r\n<ol>\r\n<li style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</li>\r\n<li style=\"font-weight: 400;\">Activation coding (after the installation is finished, it is necessary to schedule a <a rel=\"noopener\" href=\"https://www.youtube.com/watch?v=EeNw6MPzpck\" target=\"_blank\">remote coding session</a> with a BimmerTech technician)</li>\r\n</ol>\r\n<p>The kit includes all the iDrive auto parts necessary for a complete installation:</p>\r\n<ul>\r\n<li>iDrive touch controller</li>\r\n<li>iDrive touch module &nbsp;</li>\r\n<li>Wiring harness</li>\r\n<li>Coding interface</li>\r\n</ul>', NULL, NULL),
(540, NULL, 'Ceram_VerAddOn', '2019-05-08 09:15:14', '2019-05-08 09:58:21', 1, 'choice', 0, NULL, 0, NULL, NULL, 'In this version the iDrive touch controller has a ceramic control knob.', NULL, NULL, NULL, NULL, NULL),
(541, 174, 'Park_assistant', '2019-05-08 09:24:10', '2019-05-08 12:56:30', 1, 'choice', 0, 'Wish your BMW could look for parking spots? With this upgrade it’ll do more than that.', 1, NULL, NULL, NULL, NULL, '<p>Finally you can stop stressing out when parking in tight and inconvenient spaces. The BMW original Parking Assistant system can do most of the work for you, turning the whole process into an easy and instructive experience.</p>\r\n<p>This intelligent parking retrofit uses ultrasonic sensors to scan the area on both sides of your car. The autoparking system detects and measures the size of any space to spot the most suitable place for your vehicle. All you need to do is push the Parking Assistant button in the center console and the parking assist system will start doing its job. However, this is not the greatest feature of this retrofit.</p>\r\n<p>When you park parallel to the road, the assistant can take over steering, braking and acceleration while parking the car according to the system&rsquo;s calculations of the parallel parking distance. It will give you various instructions, like activating the turn signal or changing gear, so that the process is smooth and errorless. And it makes this kind of parking aid irreplaceable.</p>\r\n<p>In compatible vehicles this park assist retrofit also supports Remote Control Parking. It lets you move your vehicle forward or backward in tight spaces from outside the car, using a display key fob. &nbsp;</p>', '<p>In order to install the retrofit and make sure that all the automatic parking systems are set up, it&rsquo;s necessary to closely follow the instructions which are created specifically for your BMW. The installation manual for BMW Parking Assistant will be available for download in your personal account within 72 hours after the product is shipped. You will receive an email notification that will inform you when the instructions are added. If you have any questions during installation, don&rsquo;t hesitate to contact our support team.</p>\r\n<p>The process itself consists of 2 main steps:</p>\r\n<ol>\r\n<li style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</li>\r\n<li style=\"font-weight: 400;\">Activation coding (after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</li>\r\n</ol>\r\n<p>This retrofit is absolutely lease-friendly. The installation doesn&rsquo;t require any permanent modifications to the exterior or interior of your car.</p>\r\n<p>Please note that if you have a BDC Module as an additional option in top right section, it means that your car isn&rsquo;t equipped with certain functionalities and for the Parking Assistant to work, you need t o add it to your order. In case there is no BDC Module, you don&rsquo;t need any additional elements for the kit to work in your car.</p>', NULL, NULL),
(542, NULL, 'BDC_ModuleAddOn', '2019-05-08 09:40:08', '2019-05-08 09:57:49', 1, 'choice', 0, NULL, 0, NULL, NULL, 'Your car is not equipped with certain features for the retrofit to work. But if you add BDC module to your order, the retrofit will be installed and will perform flawlessly.', NULL, NULL, NULL, NULL, NULL),
(543, 177, 'AUX_Port', '2019-05-08 09:44:12', '2019-05-16 08:32:14', 1, 'choice', 5, 'Connect your audio device directly to the car speakers and enjoy the sound!', 1, NULL, NULL, NULL, NULL, '<p>If you vehicle doesn&rsquo;t come with the factory-installed AUX port, it&rsquo;s not a problem anymore. You can order it in a few clicks and install it in your sleep (yes, it&rsquo;s that easy).</p>\r\n<p>After we code AUX port for car to work in your specific model, you will be able to listen to music from your device and enjoy the sound through the BMW&rsquo;s stereo system. And it doesn&rsquo;t matter whether you have a Walkman from your childhood or the latest iPhone&mdash;the BMW original AUX port supports almost any audio device you can connect through the 3.5mm jack.</p>\r\n<p>You can fit it into the glove compartment or any other place that allows easy access. The cable that connects the port to the head unit can be hidden behind the dash, so as not to spoil the interior look of your car.</p>', '<p>How to put an AUX port in your car<span style=\"font-weight: 400;\">? In reality, the process is very simple and takes 1 hour tops. The installation instructions on how to </span>add AUX port in car <span style=\"font-weight: 400;\">will be added to your BimmerTech account. Within 72 hours after the</span> AUX cable<span style=\"font-weight: 400;\"> &amp; port is shipped, you will receive an email notification that the instructions are uploaded.</span></p>\r\n<p><span style=\"font-weight: 400;\">The process itself consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 1h)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\"><a rel=\"noopener\" href=\"https://www.youtube.com/watch?v=EeNw6MPzpck\" target=\"_blank\">Activation coding</a> (after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all the parts necessary for installation:</span></p>\r\n<ul>\r\n<li>AUX cord for car</li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Remote &nbsp;coding service</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The installation is fully plug &amp; play and 100% reversible. </span></p>', NULL, NULL),
(544, 174, 'RemoteControlParking', '2019-05-08 10:04:29', '2019-05-14 12:45:34', 1, 'choice', 0, 'No need to practice gymnastics in tight parking spots. Your BMW will park itself for you.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Tired of crawling out of your BMW in a small garage or exceptionally narrow parking spaces? Already paid tons of money for cosmetic repairs to your doors? By letting the Remote Control Parking retrofit maneuver your car, you can get rid of these problems once and for all!</span></p>\r\n<p><span style=\"font-weight: 400;\">This BMW original upgrade makes it possible to park your BMW without actually sitting inside the vehicle. With the help of the <a rel=\"noopener\" href=\"http://testshop.bimmer-tech.net/products-remote-control-display-key-fob\" target=\"_blank\">Remote Control Display Key Fob</a>, you can control the car by pressing the &ldquo;forwards&rdquo; or &ldquo;backwards&rdquo; button. It can be moved 1/5 times its length in perpendicular parking spaces at a speed of no more than 1 mph.</span></p>\r\n<p><span style=\"font-weight: 400;\">The Remote Control Parking system takes charge of steering, braking and acceleration. Using the sensors and cameras, it analyzes the surroundings and can stop if there is an obstacle in the way. You can also interrupt the process yourself by releasing the button on the key fob. In addition, the engine is started and killed automatically, so there is no need to worry about leaving your car running.</span></p>\r\n<p><span style=\"font-weight: 400;\">If you strive to avoid damaging your BMW or other cars in tight parking spaces, this is the perfect retrofit for you. You can save a great deal of money on regular facelifts and park with real peace of mind. </span></p>', '<p><span style=\"font-weight: 400;\">The installation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help. </span></p>\r\n<p><span style=\"font-weight: 400;\">The process itself consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 1h)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\"><a rel=\"noopener\" href=\"https://www.youtube.com/watch?v=EeNw6MPzpck\" target=\"_blank\">Activation coding</a> (after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Antenna </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Remote Control Display Key Fob </span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">This retrofit is absolutely lease-friendly. The installation doesn&rsquo;t require any permanent modifications to the exterior or interior of your car. </span></p>\r\n<p><span style=\"font-weight: 400;\">Please note that if you have a BDC Module as an additional option in top right section, it means that your car isn&rsquo;t equipped with certain functionalities and for the Remote Control Parking System to work, you need t o add it to your order. In case there is no BDC Module, you don&rsquo;t need any additional elements for the kit to work in your car. </span></p>', NULL, NULL),
(545, 187, 'RCDisplay_keyfob', '2019-05-08 10:19:07', '2019-05-09 11:57:12', 1, 'choice', 0, 'Check your fuel or set a timer for the conditioning without actually getting into the car.', 1, NULL, NULL, NULL, NULL, '<p>Checking up on your BMW can be much easier and faster with a Remote Control Display Key Fob. No matter where you are &mdash; sitting at the office or relaxing in your living room &mdash; you can find out how much fuel you have or whether the alarm is on, without going out.</p>\r\n<p>Our BMW key fob replacement has all the functions of a traditional remote key fob, plus many new stunning features. The LCD touch screen allows you to keep tabs on the central locking information and see if the windows are open or closed. With the alarm system on, you can also adjust settings for the interior sensors.</p>\r\n<p>This BMW key fob functions also include informing you when your BMW has to be serviced or what the lighting status is. In the Mobility section you will see the gas gauge and how many miles you can drive before tanking up.</p>\r\n<p>The finest thing about this touchscreen key fob is that you can set your departure time and be sure that your BMW will have the perfect temperature when you need to hit the road. The Climate Control feature lets you precondition the interior, so it won&rsquo;t be too hot or cold when you set off.</p>\r\n<p>Please note that you cannot park the vehicle remotely using only the Remote Control Display Key Fob. To enjoy this functionality, your BMW must be equipped with the <a rel=\"noopener\" href=\"http://testshop.bimmer-tech.net/products-remote-control-parking-system\" target=\"_blank\">Remote Control Parking</a> feature.</p>\r\n<p>IMPORTANT: <span style=\"font-weight: 400;\">we don&rsquo;t fulfill orders without evidence of ownership of the vehicle. After you place an order and make a payment, you need to send a copy of your vehicle registration and driver\'s license, both with the same name, to keyfobs@bimmer-tech.net, complete with your order number.</span></p>', '<p>Our retrofit doesn&rsquo;t require any BMW key fob programming or physical installation. It comes already pre-coded for your BMW and must be only activated. &nbsp;</p>\r\n<p>The activation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help.</p>', NULL, NULL),
(546, 177, '6FLUSB_AUX', '2019-05-08 10:36:18', '2019-05-16 07:48:23', 1, 'choice', 0, 'Add a USB and 3.5 mm port to your BMW and enjoy music from any device!', 1, NULL, NULL, NULL, NULL, '<p>It doesn&rsquo;t matter which device you want to use for streaming music through your car stereo system &mdash; you should be able to connect either the latest-generation iPhone or an old Walkman. And our USB/AUX Interface retrofit will help you plug in almost any device that has some audio files to play.</p>\r\n<p>The AUX port for car has a 3.5 mm jack which means that you can attach any audio source with a headphone jack to your BMW&rsquo;s head unit. Though to integrate an Apple iPod or Apple iPhone, the BMW Y cable adapter for Apple iPod/iPhone is required.</p>\r\n<p>The USB port in its turn can ensure the best audio playback quality when it comes to streaming music from an external device through the car&rsquo;s stereo system.</p>\r\n<p>In both cases the title of the track being played is displayed either on the control or the radio display. You can operate MP3 players and smartphones directly from the central console.</p>\r\n<p>All common formats are supported (MP3, AAC, WAV and WMA) as well as M3U-format playlists.</p>\r\n<p>If you either have none of the ports or only one of them, it is worth upgrading to the 6FL USB/AUX Interface. It allows you to be flexible with audio devices you want to connect.</p>', '<p>How to put an AUX port in your car <span style=\"font-weight: 400;\">together with the USB port?</span> <span style=\"font-weight: 400;\">The process itself consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 1h)</span></li>\r\n<li style=\"font-weight: 400;\"><a rel=\"noopener\" href=\"https://www.youtube.com/watch?v=EeNw6MPzpck\" target=\"_blank\"><span style=\"font-weight: 400;\">Coding </span></a><span style=\"font-weight: 400;\">(after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Plate with USB and AUX ports </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">ULF2HI module</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">This retrofit is absolutely lease-friendly. The installation doesn&rsquo;t require any permanent modifications to the exterior or interior of your car. </span></p>\r\n<p><span style=\"font-weight: 400;\">The installation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help.</span></p>', NULL, NULL),
(547, 182, 'CIC_Soft_Activ', '2019-05-08 10:47:31', '2019-05-08 13:31:07', 1, 'choice', 0, 'Have your CIC head unit coded for your specific BMW even without leaving home.', 1, NULL, NULL, NULL, NULL, '<p>Retrofitting your car with a BMW navigation system of a new generation can&rsquo;t be completed without professional and high quality coding. And with a decade of experience, we at BimmerTech know exactly how to do it right.</p>\r\n<p>BMW CIC iDrive interface is one of the head units belonging to the Navigation System Professional line. To know more about this iDrive as well as others, read our <a href=\"https://www.bimmer-tech.net/blog/item/54-bmw-cic-nbt-nbtevo\">blog post</a>.</p>\r\n<p>Our BMW CIC Remote Software Activation provides you with the service you need in the comfort of your own home. Our competent technician will program your CIC retrofit to match the configurations of your BMW, as well as activating the latest BMW map update, Voice Control and Video-in-motion, which will make trips in your car much more enjoyable.</p>\r\n<p>After the hardware upgrade and our BMW software update, you&rsquo;ll be able to use original BMW maps, control the system with simple verbal commands and turn on movies for your passengers. How could your driving experience get any better than that?</p>', '<p>CIC Software Activation is performed through a remote coding session with a dedicated BimmerTech technician after all the iDrive auto parts are installed.</p>\r\n<p>BMW navigation update of your new CIC retrofit is a very simple process that takes no more than 30 minutes. After you complete your order, we send you a coding cable (only if you don\'t have one and you add it in the top <em>Option</em> section). &nbsp;Once you receive it, there will be instructions on how to schedule a coding session for the time that suits you best. During the session, you just plug in the cable and follow the instructions from our technician.</p>\r\n<p>To prepare for your BMW iDrive update coding session you will need a laptop running Microsoft Windows and a WiFi internet network that you can connect to in your car. A Mac computer running Windows might not work with some E-Series cars. The coding cable must be plugged into your laptop&rsquo;s USB port.</p>\r\n<p>Watch the video to understand the cable activation process better.</p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/EeNw6MPzpck\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p>The CIC Remote Software Activation package includes everything necessary for cable coding:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">Remote activation service</li>\r\n<li style=\"font-weight: 400;\">Coding interface (if you add it to your order in the top <em>Option</em> section)</li>\r\n</ul>', NULL, NULL);
INSERT INTO `sylius_product` (`id`, `main_taxon_id`, `code`, `created_at`, `updated_at`, `enabled`, `variant_selection_method`, `average_rating`, `taxon_decription`, `recomended`, `buyers_footer_content`, `buyers_header_content`, `addon_information`, `type`, `description`, `installer`, `flagName`, `flagColor_id`) VALUES
(548, 209, 'EnhBT_USBActiv', '2019-05-08 11:37:34', '2019-05-13 11:19:35', 1, 'choice', 0, 'Connect your smartphone to your BMW to enjoy its best features while driving.', 1, NULL, NULL, NULL, 'usb_coding', '<p>There are many things you want to do with your smartphone while you have to focus on driving &mdash; check out a new Spotify playlist through the car&rsquo;s stereo system, or accept calls hands-free without breaking your focus on the road. And with BMW Enhanced Bluetooth Update &amp; USB Port Activation you will be able to do much more than that.</p>\r\n<p><a rel=\"noopener\" href=\"https://www.bimmer-tech.net/blog/item/56-bmw-enhanced-bluetooth\" target=\"_blank\">What is &ldquo;Enhanced Bluetooth&rdquo;</a>? The most obvious benefit of adding this feature to your car is that audio streaming won&rsquo;t just be something you&rsquo;ve read about online anymore. You&rsquo;ll be able to play your favorite tracks through the car&rsquo;s speakers via Bluetooth. In terms of BMW smartphone integration, you&rsquo;ll also have the chance to connect your smartphone via a USB port, ensuring much better sound quality (this activation ensures support for Apple white cable meaning you don&rsquo;t need a BMW Y cable adapter). With Enhanced Bluetooth package activated, it&rsquo;s also possible to pair up multiple devices simultaneously. Listen to music from your passenger&rsquo;s phone and receive calls from your own!</p>\r\n<p>Apart from media streaming functionalities, if you have the Office Menu available in your car, you will get to see SMS messages, notes, emails, calendar or reminders from your phone on the iDrive screen. Please keep in mind that you can only read them, and there is no possibility to edit or send new messages through the car&rsquo;s system with BMW Bluetooth update.</p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/LHUXg6_Ycag\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p>However, in vehicles with the BMW Enhanced Bluetooth with USB and Voice Control feature you&rsquo;ll be able to dictate new text messages and send them without taking your hands of the wheel. Making hands-free calls is also not an exception.</p>\r\n<p>IMPORTANT: The range of functions available after activating Bluetooth strongly depends on the type of your smartphone as well as the design of the BMW hardware and software in your car. For example, if you can&rsquo;t access calendar or read text messages after our activation, it means that your smartphone is not compatible with the factory pre-set configurations of your BMW, and this doesn&rsquo;t let this particular feature work. Visit <a rel=\"noopener\" href=\"https://www.bmwusa.com/owners/bluetooth-technology.html\" target=\"_blank\">bmw.com/bluetooth</a> and check which features you will get for your device and vehicle after unlocking Enhanced Bluetooth and USB port.</p>', '<p><span style=\"font-weight: 400;\">Enhanced Bluetooth &amp; USB port are activated with the help of a USB stick. It&rsquo;s a very simple and quick process:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">You order the activation and make the payment </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">You receive an email with a link to download the coding file as well as installation instructions for your specific BMW </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">After you transfer the coding file to the USB drive, completing the rest of installation takes up to 10-30 min</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The activation is 100% reversible.</span></p>', NULL, NULL),
(549, 209, 'EnhBT_Cable_E', '2019-05-08 11:51:46', '2019-05-13 11:12:05', 1, 'choice', 0, 'Connect your smartphone to your BMW to enjoy its best features while driving.', 1, NULL, NULL, NULL, 'codding', '<p>There are many things you want to do with your smartphone while you have to focus on driving &mdash; check out a new Spotify playlist through the car&rsquo;s stereo system, or accept calls hands-free without breaking your focus on the road. And with BMW Enhanced Bluetooth Update &amp; USB Port Activation you will be able to do much more than that.</p>\r\n<p><a rel=\"noopener\" href=\"https://www.bimmer-tech.net/blog/item/56-bmw-enhanced-bluetooth\" target=\"_blank\">What is &ldquo;Enhanced Bluetooth&rdquo;</a>? The most obvious benefit of adding this feature to your car is that audio streaming won&rsquo;t just be something you&rsquo;ve read about online anymore. You&rsquo;ll be able to play your favorite tracks through the car&rsquo;s speakers via Bluetooth. In terms of BMW smartphone integration, you&rsquo;ll also have the chance to connect your smartphone via a USB port, ensuring much better sound quality (this activation ensures support for Apple white cable meaning you don&rsquo;t need a BMW Y cable adapter). With Enhanced Bluetooth package activated, it&rsquo;s also possible to pair up multiple devices simultaneously. Listen to music from your passenger&rsquo;s phone and receive calls from your own!</p>\r\n<p>Apart from media streaming functionalities, if you have the Office Menu available in your car, you will get to see SMS messages, notes, emails, calendar or reminders from your phone on the iDrive screen. Please keep in mind that you can only read them, and there is no possibility to edit or send new messages through the car&rsquo;s system with BMW Bluetooth update.</p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/LHUXg6_Ycag\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p>However, in vehicles with the BMW Enhanced Bluetooth with USB and Voice Control feature you&rsquo;ll be able to dictate new text messages and send them without taking your hands of the wheel. Making hands-free calls is also not an exception.</p>\r\n<p>IMPORTANT: The range of functions available after activating Bluetooth strongly depends on the type of your smartphone as well as the design of the BMW hardware and software in your car. For example, if you can&rsquo;t access calendar or read text messages after our activation, it means that your smartphone is not compatible with the factory pre-set configurations of your BMW, and this doesn&rsquo;t let this particular feature work. Visit <a rel=\"noopener\" href=\"https://www.bmwusa.com/owners/bluetooth-technology.html\" target=\"_blank\">bmw.com/bluetooth</a> and check which features you will get for your device and vehicle after unlocking Enhanced Bluetooth and USB port.</p>', '<p><span style=\"font-weight: 400;\">Enhanced Bluetooth &amp; USB Port are activated through a remote cable coding session. It is a very simple process that takes no more than 30 minutes. After you complete your order, we send you a coding cable (if you don\'t have one and add it in the top </span><em><span style=\"font-weight: 400;\">Option</span></em><span style=\"font-weight: 400;\"> section). Once you receive it, you will be able to schedule a coding session for the time that suits you best. During the session, just plug in the cable, follow the instructions from our technician and Enhanced Bluetooth will be added to your car&rsquo;s options.</span></p>\r\n<p><span style=\"font-weight: 400;\">To prepare for your coding session you will need a laptop running Microsoft Windows and a WiFi internet network that you can connect to in your car. A Mac computer running Windows should work too, but it may not be compatible with some E-series vehicles. The coding cable must be plugged into your laptop&rsquo;s regular USB port.</span></p>\r\n<p><span style=\"font-weight: 400;\">Watch the video to understand the cable activation process better.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/EeNw6MPzpck\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The Enhanced Bluetooth package includes everything necessary for the cable activation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Remote activation service</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface (if you add it to your order in the top </span><em><span style=\"font-weight: 400;\">Option</span></em><span style=\"font-weight: 400;\"> section)</span></li>\r\n</ul>', NULL, NULL),
