too. The coding cable must be plugged into your laptop&rsquo;s </span><a rel=\"noopener\" href=\"https://www.bimmer-tech.net/customer_support/Remote_coding/Instructions/EthernetPort.jpg\" target=\"_blank\"><span style=\"font-weight: 400;\">Ethernet port</span></a><span style=\"font-weight: 400;\"> (if you don&rsquo;t have one, you can use an </span><a rel=\"noopener\" href=\"https://www.bimmer-tech.net/customer_support/Remote_coding/Instructions/LAN_MAC.jpg\" target=\"_blank\"><span style=\"font-weight: 400;\">adapter</span></a><span style=\"font-weight: 400;\">).</span></p>\r\n<p><span style=\"font-weight: 400;\">Watch the video to understand the cable activation process better.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/EeNw6MPzpck\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The Enhanced Bluetooth package includes everything necessary for the cable activation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Remote activation service</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface (if you add it to your order in the top </span><em><span style=\"font-weight: 400;\">Option</span></em><span style=\"font-weight: 400;\"> section)</span></li>\r\n</ul>', NULL, NULL),
(551, NULL, 'ComAccessCodingAddOn', '2019-05-08 13:01:19', '2019-05-10 09:47:04', 1, 'choice', 0, NULL, 0, NULL, NULL, 'In order to use Comfort Access with your new key fob, it is necessary to delete your previous key fob from the vehicle\'s memory. We do it during a remote coding session with a dedicated BimmerTech technician.', 'codding', NULL, NULL, NULL, NULL),
(552, 210, 'RearCamMMI_i3_MINI', '2019-05-08 13:18:47', '2019-05-14 10:06:09', 1, 'choice', 0, 'A BimmerTech original backup camera with a full-screen image and handy add-ons.', 1, '<p>*PDC is not included in the Rear View Camera (OEM Integration) kit. You can buy it separately <a href=\"http://testshop.bimmer-tech.net/category-pdc-park-distance-control-retrofit-oem-pdcretrofit\" target=\"_blank\">here</a>. Without PDC, a static image of a car will be displayed on one side of the screen.</p>\r\n\r\n<p>To learn more about the differences between the cameras, read our detailed <a href=\"https://www.bimmer-tech.net/blog/item/1-bimmertech-blog\" target=\"_blank\">blog post</a>.</p>', '<p>Check our 3 types of backup cameras and choose the park assist kit that suits you.</p>\r\n\r\n<p>To find out whether your vehicle is compatible with one, all or none of the upgrades, please provide your VIN.</p>', NULL, NULL, '<p><span style=\"font-weight: 400;\">The Rear View Camera (MMI) is created for those drivers who expect more than just a park assist functionality from a BMW backup camera upgrade. It is designed to make your car flexible and compatible with a host of technological upgrades. Because the </span><span style=\"font-weight: 400;\">sky </span><span style=\"font-weight: 400;\">&nbsp;factory pre-set features are not the limit. &nbsp;</span></p>\r\n<p><span style=\"font-weight: 400;\">This BMW rear view camera doesn&rsquo;t use the native camera mode of your car. Instead, its display overrides the iDrive screen when the car is put in reverse. The image takes up the full screen, giving a bigger and clearer picture of what&rsquo;s behind you. </span></p>\r\n<p><span style=\"font-weight: 400;\">This retrofit is ideal for drivers looking for a flexible park assist solution that leaves room for customizing and expanding your vehicle&rsquo;s features. The BMW backup camera kit includes a Multimedia Interface (MMI) &mdash; a BimmerTech original module that makes it easy to add a Front View Camera, one of our mirroring devices (SmartView HD Flex, SmartView Apple TV3 or SmartView Apple TV4).</span></p>', '<p><span style=\"font-weight: 400;\">The installation of the Rear View Camera MMI doesn&rsquo;t require any remote coding and takes up to 3&ndash;4h. The retrofit kit includes all parts necessary to add a rear view camera to your BMW:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Trunk lid&ndash;mounted camera </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Multimedia interface (MMI)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">Please note that the installation requires cutting a small hole in the rear bumper. All the necessary instructions for this step will be included into the manual.</span></p>\r\n<p><span style=\"font-weight: 400;\">To learn more about the installation, watch this video:</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/20r7ZpkXddw\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The manual for the installation will be added to your personal account within 72 hours after shipping the camera. Each manual is compiled for every specific model so it should include all the necessary informations. But if you have any questions, don&rsquo;t hesitate to contact our tech support. </span></p>', NULL, NULL),
(553, 210, 'RearCamMMIE63_E64_E89_F20_F21_F39', '2019-05-08 14:14:54', '2019-05-14 10:06:42', 1, 'choice', 0, 'A BimmerTech original backup camera with a full-screen image and handy add-ons.', 1, '<p>*PDC is not included in the Rear View Camera (OEM Integration) kit. You can buy it separately <a href=\"http://testshop.bimmer-tech.net/category-pdc-park-distance-control-retrofit-oem-pdcretrofit\" target=\"_blank\">here</a>. Without PDC, a static image of a car will be displayed on one side of the screen.</p>\r\n\r\n<p>To learn more about the differences between the cameras, read our detailed <a href=\"https://www.bimmer-tech.net/blog/item/1-bimmertech-blog\" target=\"_blank\">blog post</a>.</p>', '<p>Check our 3 types of backup cameras and choose the park assist kit that suits you.</p>\r\n\r\n<p>To find out whether your vehicle is compatible with one, all or none of the upgrades, please provide your VIN.</p>', NULL, NULL, '<p><span style=\"font-weight: 400;\">The Rear View Camera (MMI) is created for those drivers who expect more than just a park assist functionality from a BMW backup camera upgrade. It is designed to make your car flexible and compatible with a host of technological upgrades. Because the </span><span style=\"font-weight: 400;\">sky </span><span style=\"font-weight: 400;\">&nbsp;factory pre-set features are not the limit. &nbsp;</span></p>\r\n<p><span style=\"font-weight: 400;\">This BMW rear view camera doesn&rsquo;t use the native camera mode of your car. Instead, its display overrides the iDrive screen when the car is put in reverse. The image takes up the full screen, giving a bigger and clearer picture of what&rsquo;s behind you. </span></p>\r\n<p><span style=\"font-weight: 400;\">This retrofit is ideal for drivers looking for a flexible park assist solution that leaves room for customizing and expanding your vehicle&rsquo;s features. The BMW backup camera kit includes a Multimedia Interface (MMI) &mdash; a BimmerTech original module that makes it easy to add a Front View Camera, one of our mirroring devices (SmartView HD Flex, SmartView Apple TV3 or SmartView Apple TV4).</span></p>', '<p><span style=\"font-weight: 400;\">The installation of the Rear View Camera MMI doesn&rsquo;t require any remote coding and takes up to 3&ndash;4h. The retrofit kit includes all parts necessary to add a rear view camera to your BMW:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Trunk lid&ndash;mounted camera </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Multimedia interface (MMI)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">Please note that the installation requires cutting a small hole in the rear bumper. All the necessary instructions for this step will be included into the manual.</span></p>\r\n<p><span style=\"font-weight: 400;\">To learn more about the installation, watch this video:</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/20r7ZpkXddw\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The manual for the installation will be added to your personal account within 72 hours after shipping the camera. Each manual is compiled for every specific model so it should include all the necessary informations. But if you have any questions, don&rsquo;t hesitate to contact our tech support. </span></p>', NULL, NULL),
(554, 212, 'KeyFobE', '2019-05-09 08:26:48', '2019-05-13 13:03:16', 1, 'choice', 0, 'Replace a damaged key fob or get a spare one straight from the BMW factory.', 1, NULL, NULL, NULL, NULL, '<p>Sometimes remote key fobs get damaged, and sometimes you need spares for your family. In any of these scenarios you might think that getting a replacement is cumbersome. But we assure you that with BimmerTech the process is simple and smooth.</p>\r\n<p>You can order a BMW key fob from us and get a perfectly matched retrofit in a few days. It comes pre-programmed by BMW itself for your specific model and resembles your factory remote key, having the same look and features. It doesn&rsquo;t require any coding &mdash; you just need to follow a few instructions to get it activated and that&rsquo;s all.</p>\r\n<p>The internal blade from your original key fob will fit perfectly into the replacement. However, if you&rsquo;d like to purchase a new one, you can add it to your order in our Options section.</p>\r\n<p>The BMW replacement key fob will be 100% compatible with your vehicle\'s ignition immobilizer code. It includes an original BMW embedded transponder ignition lock chip.</p>\r\n<p>Please note that we don&rsquo;t fulfill orders without evidence of ownership of the vehicle. After you place an order and make a payment, you need to send a copy of your vehicle registration and driver\'s license, both with the same name, to keyfobs@bimmer-tech.net, complete with your order number.</p>', '<p>The activation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help.</p>\r\n<p>To activate your key fob:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">Turn your car on and off with your existing key</li>\r\n<li style=\"font-weight: 400;\">Insert your new BMW remote key</li>\r\n<li style=\"font-weight: 400;\">Hold it all the way in the slot for 20 seconds until it&rsquo;s activated</li>\r\n</ul>', NULL, NULL),
