sy to add a Front View Camera, one of our mirroring devices (SmartView HD Flex, SmartView Apple TV3 or SmartView Apple TV4).</span></p>', '<p><span style=\"font-weight: 400;\">The installation of the Rear View Camera MMI doesn&rsquo;t require any remote coding and takes up to 3&ndash;4h. The retrofit kit includes all parts necessary to add a rear view camera to your BMW:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Trunk lid&ndash;mounted camera </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Multimedia interface (MMI)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">Please note that the installation requires cutting a small hole in the rear bumper. All the necessary instructions for this step will be included into the manual.</span></p>\r\n<p><span style=\"font-weight: 400;\">To learn more about the installation, watch this video:</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/20r7ZpkXddw\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The manual for the installation will be added to your personal account within 72 hours after shipping the camera. Each manual is compiled for every specific model so it should include all the necessary informations. But if you have any questions, don&rsquo;t hesitate to contact our tech support. </span></p>', NULL, NULL),
(556, 210, 'RearCamMMIStaticLines', '2019-05-09 08:45:09', '2019-05-14 10:16:55', 1, 'choice', 0, 'A BimmerTech original backup camera with a full-screen image and handy add-ons.', 1, '<p>*PDC is not included in the Rear View Camera (OEM Integration) kit. You can buy it separately <a href=\"http://testshop.bimmer-tech.net/category-pdc-park-distance-control-retrofit-oem-pdcretrofit\">here.</a> Without PDC, a static image of a car will be displayed on one side of the screen.</p>\r\n\r\n<p>To learn more about the differences between the cameras, read our detailed <a href=\"https://www.bimmer-tech.net/blog/item/1-bimmertech-blog\">blog post</a>.</p>', '<p>Check our 3 types of backup cameras and choose the park assist kit that suits you.</p>\r\n\r\n<p>To find out whether your vehicle is compatible with one, all or none of the upgrades, please provide your VIN.</p>', NULL, NULL, '<p><span style=\"font-weight: 400;\">The Rear View Camera (MMI) is created for those drivers who expect more than just a park assist functionality from a BMW backup camera upgrade. It is designed to make your car flexible and compatible with a host of technological upgrades. Because the </span><span style=\"font-weight: 400;\">sky </span><span style=\"font-weight: 400;\">&nbsp;factory pre-set features are not the limit. &nbsp;</span></p>\r\n<p><span style=\"font-weight: 400;\">This BMW rear view camera doesn&rsquo;t use the native camera mode of your car. Instead, its display overrides the iDrive screen when the car is put in reverse. The image takes up the full screen, giving a bigger and clearer picture of what&rsquo;s behind you. </span></p>\r\n<p><span style=\"font-weight: 400;\">This retrofit is ideal for drivers looking for a flexible park assist solution that leaves room for customizing and expanding your vehicle&rsquo;s features. The BMW backup camera kit includes a Multimedia Interface (MMI) &mdash; a BimmerTech original module that makes it easy to add a Front View Camera, one of our mirroring devices (SmartView HD Flex, SmartView Apple TV3 or SmartView Apple TV4).</span></p>', '<p><span style=\"font-weight: 400;\">The installation of the Rear View Camera MMI is absolutely plug &amp; play. It doesn&rsquo;t require any remote coding and takes up to 3&ndash;4h. Moreover, no permanent modifications are needed, so the kit is completely lease-friendly. </span></p>\r\n<p><span style=\"font-weight: 400;\">The retrofit kit includes all parts necessary to add a rear view camera to your BMW:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Trunk lid&ndash;mounted camera </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Multimedia interface (MMI)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">To learn more about the installation, watch this video:</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/ia6YKmxC6Fw\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The manual for the installation will be added to your personal account within 72 hours after shipping the camera. Each manual is compiled for every specific model so it should include all the necessary informations. But if you have any questions, don&rsquo;t hesitate to contact our tech support. </span></p>', NULL, NULL),
