(562, 203, '6WBClusterG01_G30_G31', '2019-05-09 10:36:18', '2019-05-14 12:26:40', 1, 'choice', 0, 'Experience Comfort, Sport or Eco Pro modes in a new way with a digital instrument cluster.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Amplifying your driving experience is not a whim &mdash; it&rsquo;s making the absolute most of your BMW&rsquo;s potential. And the 6WB BMW OEM Digital Cluster is exactly what your car needs to reach the next level of comfort and confidence behind the wheel. </span></p>\r\n<p><span style=\"font-weight: 400;\">The instrument panel is fully digitized. It has different setups for three driving modes &mdash; a rather usual and calm display for Comfort mode, a touch of blue and eco style features in Eco Pro mode and a more aggressive look in Sport Mode. Sport+ setup appears the same as the Sport one, save for the deactivated traction control.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/tWfKnY2pCYI\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The center portion of the 6WB cluster can show your car in real time &mdash; when some of your doors are opened, it is accurately displayed on the panel. When you turn on navigation, the instructions will be also indicated on the digital cluster.</span></p>\r\n<p><span style=\"font-weight: 400;\">In addition, this multifunctional instrument panel shows the information from the driver assistance systems, such as the nearest gas stations, speed limits, etc.</span></p>', '<p><span style=\"font-weight: 400;\">The process itself consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 1h)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding (after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">6WB digital instrument cluster </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The way this 6WB Digital Cluster mounting is completely lease-friendly as there are no permanent modifications needed. </span></p>\r\n<p><span style=\"font-weight: 400;\">To know more about installation, watch the video:</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/DFNzsh_-SJk\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe><span style=\"font-weight: 400;\">You will be able to find the 6WB Digital cluster installation manual in your personal account within 72 hours after the product is shipped. The manual will be created and customized for your exact car. But in case of any additional questions, our technical support is always ready to help.</span></p>', NULL, NULL),
(563, NULL, 'IntKeyBladeF_G_85_AddOn', '2019-05-09 11:12:41', '2019-05-10 10:54:36', 1, 'choice', 0, NULL, 0, NULL, NULL, 'The key blade from your original key fob will fit perfectly into the replacement. But you can order an extra one in case you lost it or need a spare key.', NULL, NULL, NULL, NULL, NULL),
(564, 174, 'RearCameraOEMInt', '2019-05-09 11:12:42', '2019-05-14 10:33:20', 1, 'choice', 0, 'The same look and feel as a factory-installed camera at a much lower price.', 1, '<p>*PDC is not included in the Rear View Camera (OEM Integration) kit. You can buy it separately <a href=\"http://testshop.bimmer-tech.net/category-pdc-park-distance-control-retrofit-oem-pdcretrofit\" target=\"_blank\">here</a>. Without PDC, a static image of a car will be displayed on one side of the screen.</p>\r\n\r\n<p>To learn more about the differences between the rv backup cameras, read our detailed <a href=\"https://www.bimmer-tech.net/blog/item/1-bimmertech-blog\" target=\"_blank\">blog post</a>.</p>', '<p>Check our 3 types of reverse cameras and choose the park assist kit that suits you.</p>\r\n\r\n<p>To find out whether your vehicle is compatible with one, all or none of the upgrades, please provide your VIN.</p>', NULL, NULL, '<p>Like original BMW rear view cameras and parking assist upgrades, but don&rsquo;t want to pay a fortune for options that (in an ideal world) should be factory-installed without any additional fees? Then you will definitely feel right at home with our budget-friendly Rear View Camera (OEM Integration).</p>\r\n<p>This is a BimmerTech rear view camera retrofit designed to use BMW\'s native iDrive display and camera mode. It has all the major benefits of an OEM BMW backup camera kit including automatic activation, Dynamic Parking Lines, and iDrive integration.</p>\r\n<p>Thanks to a split-screen interface with rear view and Park Distance Control (PDC) displays, it looks the same as the factory BMW backup camera retrofit. Unlike the majority of other aftermarket cameras, it&rsquo;s fully compatible with PDC. But the most important benefit is that your car doesn&rsquo;t have to be equipped with it for the BMW rear view camera to work.</p>', '<p>How to install a backup camera like this? The process of adding rear view camera to BMW consists of 2 main steps:</p>\r\n<ol>\r\n<li style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</li>\r\n<li style=\"font-weight: 400;\">Activation coding which is done remotely with a coding cable &mdash; before the installation it is necessary to schedule a <a href=\"https://www.youtube.com/watch?v=EeNw6MPzpck\">remote coding session</a> with a BimmerTech technician.)</li>\r\n</ol>\r\n<p>The kit includes all parts necessary for a complete installation:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">Trunk lid&ndash;mounted camera</li>\r\n<li style=\"font-weight: 400;\">Camera module</li>\r\n<li style=\"font-weight: 400;\">Backup camera wiring harness</li>\r\n<li style=\"font-weight: 400;\">Coding interface</li>\r\n</ul>\r\n<p>The installation is 100% reversible and doesn&rsquo;t require any internal or external modifications to your car.</p>\r\n<p>To learn more about the DIY backup camera, watch this video:</p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/C8sD3lBajRg\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p>The installation instructions prepared for your specific model will be added to your personal account within 72 hours after the purchased product is shipped. If you have any additional questions regarding the BMW rear view camera car kit, our technical support is always ready to help.</p>', NULL, NULL),
(565, 211, 'NBTEVOID5_5_7Series_F_withNBT_NBTEVOID4', '2019-05-09 12:12:03', '2019-05-13 13:21:57', 1, 'choice', 0, 'Switch to the newest-generation iDrive system and enjoy the latest tech perks.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">The most technologically advanced retrofits always bring the greatest deal of comfort, especially when it comes to owning a BMW. Our NBT Evo ID5/ID6 Navigation upgrade will certainly add convenience to using the driver assistance systems as well as infotainment perks.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/4HaUDEj1Oyc\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The kit contains only BMW original parts and FSC-certified codes, so there is no need for aftermarket emulators. It comes either with ID5 or ID6 software &mdash; it&rsquo;s up to you to choose the interface that suits you best and specify it during the purchase.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/tOqXzuSqsqw\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">This BMW NBT Evo upgrade supplies the latest version of the maps for your region, to make navigating through the streets a breeze. In addition, the FSC activation includes such multimedia features as Video &amp; Services in motion, Voice Control and BMW Apps.</span></p>\r\n<p><span style=\"font-weight: 400;\">NBT Evo ID5/ID6 Navigation retrofit also comes with CarPlay built in. This software lets you use iPhone apps like Apple Maps, Waze or Spotify on the native iDrive screen. And with the Siri functionality, driving can&rsquo;t get any safer and comfier. </span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/8sYmji6nuZg\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">To know the full list of features and possibilities of this kit, read our detailed </span><a rel=\"noopener\" href=\"https://www.bimmer-tech.net/blog/item/58-bmw-nbt-evo-id5-id6-idrive-upgrade\" target=\"_blank\"><span style=\"font-weight: 400;\">blog post.</span></a></p>\r\n<p><span style=\"font-weight: 400;\">Please note that the NBT Evo head unit is slightly used, but in a very good condition. All other parts included in the kit are brand new.</span></p>\r\n<p><span style=\"font-weight: 400;\">Remote Services like locking or unlocking the car with a smartphone, flashing the headlights or sounding the horn from afar, may not work in your vehicle. To learn whether Remote features will be available in your BMW after installation or not, <a href=\"http://testshop.bimmer-tech.net/page-contact\">contact us</a> with your VIN.</span></p>', '<p><span style=\"font-weight: 400;\">The installation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help. </span></p>\r\n<p><span style=\"font-weight: 400;\">The process itself consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</span></li>\r\n<li style=\"font-weight: 400;\"><a rel=\"noopener\" href=\"https://www.youtube.com/watch?v=EeNw6MPzpck\" target=\"_blank\"><span style=\"font-weight: 400;\">Coding </span></a><span style=\"font-weight: 400;\">(after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">NBT Evo head unit</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The installation is 100% reversible. No permanent modifications to the interior/exterior of your car are needed. </span></p>', NULL, NULL),
(566, NULL, 'SiriusXM_HDRadioAddOn', '2019-05-09 12:40:42', '2019-05-09 12:45:08', 1, 'choice', 0, NULL, 0, NULL, NULL, 'SiriusXM and HD Radio both are digital forms of broadcast radio that use different technologies. SiriusXM exploits satellite technology and gives access to about 150 radio channels (the exact number depends on your model). HD Radio is an extension of the terrestrial radio broadcasting technology.', 'codding', NULL, NULL, NULL, NULL),
(567, NULL, 'DAB_RadioAddOn', '2019-05-09 12:45:21', '2019-05-09 12:47:33', 1, 'choice', 0, NULL, 0, NULL, NULL, 'Digital audio broadcasting (DAB) is a digital radio standard for broadcasting digital audio radio services.', 'codding', NULL, NULL, NULL, NULL),
