(571, 212, 'KeyFobF_G', '2019-05-09 13:25:05', '2019-05-13 13:05:18', 1, 'choice', 0, 'Replace a damaged key fob or get a spare one straight from the BMW factory.', 1, NULL, NULL, NULL, NULL, '<p>Sometimes remote key fobs get damaged, and sometimes you need spares for your family. In any of these scenarios you might think that getting a replacement is cumbersome. But we assure you that with BimmerTech the process is simple and smooth.</p>\r\n<p>You can order a BMW key fob from us and get a perfectly matched retrofit in a few days. It comes pre-programmed by BMW itself for your specific model and resembles your factory remote key, having the same look and features. It doesn&rsquo;t require any coding &mdash; you just need to follow a few instructions to get it activated and that&rsquo;s all.</p>\r\n<p>The internal blade from your original key fob will fit perfectly into the replacement. However, if you&rsquo;d like to purchase a new one, you can add it to your order in our Options section.</p>\r\n<p>The BMW replacement key fob will be 100% compatible with your vehicle\'s ignition immobilizer code. It includes an original BMW embedded transponder ignition lock chip.</p>\r\n<p>If your G-series car initially came with a touchscreen key fob, you will need a Remote <a rel=\"noopener\" href=\"http://testshop.bimmer-tech.net/products-remote-control-display-key-fob\" target=\"_blank\">Control Display Key Fob</a> as a replacement.</p>\r\n<p>Please note that we don&rsquo;t fulfill orders without evidence of ownership of the vehicle. After you place an order and make a payment, you need to send a copy of your vehicle registration and driver\'s license, both with the same name, to keyfobs@bimmer-tech.net, complete with your order number.</p>', '<p><span style=\"font-weight: 400;\">The activation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help.</span></p>\r\n<p><span style=\"font-weight: 400;\">Before starting the activation process, place your existing key fob away from the vehicle to prevent interference. To activate your new key fob: </span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hold it against the low battery key mark on the side of the steering column </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Press and hold the start/stop button until the &lsquo;no key&rsquo; warning light disappears</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">Find out more about activation in this video:&nbsp;<custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/zFrZecJFksU\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></span></p>', NULL, NULL),
