le=\"font-weight: 400;\">(after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">NBT Evo head unit</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">10.25&Prime; touch screen screen</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">iDrive Touch Controller </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The installation is 100% reversible. No permanent modifications to the interior/exterior of your car are needed. </span></p>', NULL, NULL),
(580, 213, 'KeyFobMINI_R_ComAccess', '2019-05-10 09:12:14', '2019-05-13 13:10:31', 1, 'choice', 0, 'Get a spare MINI key fob or replace the lost one without leaving your home!', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Sometimes remote key fobs get damaged, and sometimes you need spares for your family. In any of these scenarios, you might think that getting a replacement is cumbersome. But we assure you that with BimmerTech, the process is simple and smooth. </span></p>\r\n<p><span style=\"font-weight: 400;\">You can order a MINI remote key fob from us and get a perfectly matched retrofit in a few days. It comes pre-programmed by BMW itself for your specific model and resembles your factory remote key, having the same look and features. It doesn&rsquo;t require any coding &mdash; you just need to follow a few instructions, get it activated and that&rsquo;s all. </span></p>\r\n<p><span style=\"font-weight: 400;\">The internal blade from your original key fob will fit perfectly into the replacement. However, if you&rsquo;d like to order a new one, you can add it to your order in our Options section. </span></p>\r\n<p><span style=\"font-weight: 400;\">Please note that we don&rsquo;t fulfill orders without evidence of ownership of the vehicle. After you place an order and make a payment, you need to send a copy of your vehicle registration and driver\'s license, both with the same name, to keyfobs@bimmer-tech.net complete with your order number.</span></p>', '<p><span style=\"font-weight: 400;\">The activation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help.</span></p>\r\n<p><span style=\"font-weight: 400;\">To activate your key fob: </span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Close all the doors</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Insert the key into the slot</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Turn the ignition switch to KL-R (first turn), switch back within 5 seconds and remove the key</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Within 30 seconds, press and hold the unlock button </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">While holding the unlock button, press and release the lock button 3 times within 10 seconds</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Release both buttons (the doors will lock/unlock to signal a successful initialization)</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Switch the ignition to KL-R to complete the initialization.</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">In order to use Comfort Access with your new key fob, it is necessary to delete your previous key fob from the vehicle\'s memory. If you want a professional BimmerTech technician do it for you, add the Comfort Access Coding and a coding cable to your order in the top </span><em><span style=\"font-weight: 400;\">Option </span></em><span style=\"font-weight: 400;\">section. </span></p>\r\n<p><span style=\"font-weight: 400;\">The Comfort Access Coding is done through a remote cable coding session. It is a very simple process that takes no more than 30 minutes. After you complete your order, we send you a coding cable (if you don\'t have one and add it in the top </span><em><span style=\"font-weight: 400;\">Option</span></em><span style=\"font-weight: 400;\"> section). Once you receive it, you will be able to schedule a coding session for the time that suits you best. During the session, just plug in the cable and follow the instructions from our technician.</span></p>\r\n<p><span style=\"font-weight: 400;\">To prepare for your coding session you will need a laptop running Microsoft Windows and a WiFi internet network that you can connect to in your car. A Mac computer running Windows should work too. The coding cable must be plugged into your laptop&rsquo;s regular USB port.</span></p>\r\n<p><span style=\"font-weight: 400;\">Watch the video to understand the cable activation process better.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/EeNw6MPzpck\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>', NULL, NULL),
(581, 212, 'KeyFob_i3_i8', '2019-05-10 10:25:59', '2019-05-13 13:07:16', 1, 'choice', 0, 'Replace a damaged key fob or get a spare one straight from the BMW factory.', 1, NULL, NULL, NULL, NULL, '<p>Sometimes remote key fobs get damaged, and sometimes you need spares for your family. In any of these scenarios you might think that getting a replacement is cumbersome. But we assure you that with BimmerTech the process is simple and smooth.</p>\r\n<p>You can order a BMW key fob from us and get a perfectly matched retrofit in a few days. It comes pre-programmed by BMW itself for your specific model and resembles your factory remote key, having the same look and features. It doesn&rsquo;t require any coding &mdash; you just need to follow a few instructions to get it activated and that&rsquo;s all.</p>\r\n<p>The internal blade from your original key fob will fit perfectly into the replacement. However, if you&rsquo;d like to purchase a new one, you can add it to your order in our Options section.</p>\r\n<p>The BMW replacement key fob will be 100% compatible with your vehicle\'s ignition immobilizer code. It includes an original BMW embedded transponder ignition lock chip.</p>\r\n<p>Please note that we don&rsquo;t fulfill orders without evidence of ownership of the vehicle. After you place an order and make a payment, you need to send a copy of your vehicle registration and driver\'s license, both with the same name, to keyfobs@bimmer-tech.net, complete with your order number.</p>', '<p><span style=\"font-weight: 400;\">The activation instructions appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help.</span></p>\r\n<p><span style=\"font-weight: 400;\">Before starting the activation process, place your existing key fob away from the vehicle to prevent interference. To activate your new key fob: </span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hold it against the low battery key mark on the side of the steering column </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Press and hold the start/stop button until the &lsquo;no key&rsquo; warning light disappears</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">Find out more about activation in this video:&nbsp;<custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/zFrZecJFksU\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></span></p>', NULL, NULL),
(582, NULL, 'IntKeyBladeMINI_R_55_AddOn', '2019-05-10 11:27:14', '2019-05-10 11:31:31', 1, 'choice', 0, NULL, 0, NULL, NULL, 'The key blade from your original key fob will fit perfectly into the replacement. But you can order an extra one in case you lost it or need a spare key.', NULL, NULL, NULL, NULL, NULL),
