(585, NULL, 'IntKeyFobMINI_F_59_AddOn', '2019-05-10 11:47:02', '2019-05-10 11:49:30', 1, 'choice', 0, NULL, 0, NULL, NULL, 'The key blade from your original key fob will fit perfectly into the replacement. But you can order an extra one in case you lost it or need a spare key.', NULL, NULL, NULL, NULL, NULL),
(586, 186, 'AlarmSystem', '2019-05-10 11:52:06', '2019-05-13 13:18:21', 1, 'choice', 0, 'Secure your car’s interior and exterior with a BMW alarm to avoid theft or break in.', 1, NULL, NULL, NULL, NULL, '<p>Leaving your car either on a public parking lot or on your driveway just outside your house doesn&rsquo;t ensure that your car will be safe and sound when you return. But you can always achieve that peace of mind and ultimate car security feeling by upgrading your BMW with an OEM Anti-Theft Car Alarm System.</p>\r\n<p>This BMW original alarm retrofit is a good way to secure your car from theft or break in. It covers the exterior locks as well as the interior space with the help of the motion sensor installed in the door pillars. It draws attention to any attempted break ins by turning on the built-in siren and hazard warning lights.</p>\r\n<p>The alarm goes off if:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">the door, hood or trunk is opened without the right key or remote control</li>\r\n<li style=\"font-weight: 400;\">there is movement inside the locked car with the motion sensors armed</li>\r\n<li style=\"font-weight: 400;\">the power supply is disconnected</li>\r\n<li style=\"font-weight: 400;\">the car is lifted</li>\r\n</ul>\r\n<p>The security car system is very easy to operate using the remote key fob. What&rsquo;s more, when arming the alarm, you have the option of activating the interior motion sensors (by pressing the locking key on the control once) or leaving them off (by pressing the locking key twice) in case you wish to leave passengers or pets in the car.</p>', '<p>The installation instructions for the OEM car security alarm system appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions on how to install car alarm system, our technical support is always ready to help.</p>\r\n<p>The process itself consists of 2 main steps:</p>\r\n<ol>\r\n<li style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</li>\r\n<li style=\"font-weight: 400;\"><a rel=\"noopener\" href=\"https://www.youtube.com/watch?v=EeNw6MPzpck\" target=\"_blank\">Coding </a>(after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</li>\r\n</ol>\r\n<p>The kit includes all parts necessary for a complete car alarm system installation:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">Motion sensors</li>\r\n<li style=\"font-weight: 400;\">Wiring harness</li>\r\n<li style=\"font-weight: 400;\">Coding interface</li>\r\n</ul>\r\n<p>This retrofit is absolutely lease-friendly. The installation doesn&rsquo;t require any permanent modifications to the exterior or interior of your car.</p>', NULL, NULL),
(587, 214, 'BMWAppsRetrofitUSB', '2019-05-10 12:06:38', '2019-05-13 13:34:51', 1, 'choice', 0, 'Unlock the full potential of your iDrive system with your favorite iPhone apps.', 1, NULL, NULL, NULL, 'usb_coding', '<p><span style=\"font-weight: 400;\">Just imagine how comfortable it would be to listen to Spotify through the car speakers and switch between songs with the help of the iDrive controller. And what about checking out Twitter updates on the BMW native screen? The truth is that it&rsquo;s very easy to arrange with our BMW Apps activation. </span></p>\r\n<p><span style=\"font-weight: 400;\">We add iOS apps to your iDrive system so that you won&rsquo;t need to glance at your iPhone screen every time it lights up. Your social media highlights will be visible on the iDrive display, but not to get distracted from the road while driving, you can get your system to read them for your with the help of Voice Control. Using the same feature you can even make new posts or reply to messages. </span></p>\r\n<p><span style=\"font-weight: 400;\">If you </span>add BMW apps<span style=\"font-weight: 400;\"> to your iDrive, you will get access to Spotify, Pandora Radio, Web Radio, MOG, AUPEO!, Rhapsody and TuneIn. You&rsquo;ll be able to toggle between songs and stations using the iDrive controller. </span></p>\r\n<p><span style=\"font-weight: 400;\">Another important feature is that BMW Apps will allow finding a destination in the map on your iPhone and sending it to the vehicle&rsquo;s navigation. This comes in very handy when you can&rsquo;t use or don&rsquo;t have Voice Control, and don&rsquo;t want to type in the address with the iDrive controller. &nbsp;</span></p>\r\n<p><span style=\"font-weight: 400;\">Among other apps, you&rsquo;ll also be able to use Calendar, Wiki Local, ECO PRO analyzer, Last Mile navigation, Audible, GoPro, etc. To find out about the full list of services available for you and your location, download BMW ConnectedDrive from </span><a rel=\"noopener\" href=\"https://itunes.apple.com/us/app/bmw-connected/id1087277146?mt=8\" target=\"_blank\"><span style=\"font-weight: 400;\">App Store</span></a><span style=\"font-weight: 400;\"> for free. </span></p>', '<p><span style=\"font-weight: 400;\">BMW Apps activation is performed via easy USB coding. The process is very simple: all you need to do is to save the coding file (that we send to you in an email) to a USB stick and connect it to your car. After following some easy instructions, software will be activated and BMW Apps will be available in the iDrive menu.</span></p>', NULL, NULL),
(588, 214, 'BMWAppsCable_F_G', '2019-05-10 12:15:30', '2019-05-13 13:31:38', 1, 'choice', 0, 'Unlock the full potential of your iDrive system with your favorite iPhone apps.', 1, NULL, NULL, NULL, 'codding', '<p><span style=\"font-weight: 400;\">Just imagine how comfortable it would be to listen to Spotify through the car speakers and switch between songs with the help of the iDrive controller. And what about checking out Twitter updates on the BMW native screen? The truth is that it&rsquo;s very easy to arrange with our BMW Apps activation. </span></p>\r\n<p><span style=\"font-weight: 400;\">We add iOS apps to your iDrive system so that you won&rsquo;t need to glance at your iPhone screen every time it lights up. Your social media highlights will be visible on the iDrive display, but not to get distracted from the road while driving, you can get your system to read them for your with the help of Voice Control. Using the same feature you can even make new posts or reply to messages. </span></p>\r\n<p><span style=\"font-weight: 400;\">If you </span>add BMW apps<span style=\"font-weight: 400;\"> to your iDrive, you will get access to Spotify, Pandora Radio, Web Radio, MOG, AUPEO!, Rhapsody and TuneIn. You&rsquo;ll be able to toggle between songs and stations using the iDrive controller. </span></p>\r\n<p><span style=\"font-weight: 400;\">Another important feature is that BMW Apps will allow finding a destination in the map on your iPhone and sending it to the vehicle&rsquo;s navigation. This comes in very handy when you can&rsquo;t use or don&rsquo;t have Voice Control, and don&rsquo;t want to type in the address with the iDrive controller. &nbsp;</span></p>\r\n<p><span style=\"font-weight: 400;\">Among other apps, you&rsquo;ll also be able to use Calendar, Wiki Local, ECO PRO analyzer, Last Mile navigation, Audible, GoPro, etc. To find out about the full list of services available for you and your location, download BMW ConnectedDrive from </span><a href=\"https://itunes.apple.com/us/app/bmw-connected/id1087277146?mt=8\"><span style=\"font-weight: 400;\">App Store</span></a><span style=\"font-weight: 400;\"> for free. </span></p>', '<p><span style=\"font-weight: 400;\">BMW Apps are activated through a remote cable coding session. It is a very simple process that takes no more than 30 minutes. After you complete your order, we send you a coding cable (if you don\'t have one and add it in the top </span><em><span style=\"font-weight: 400;\">Option</span></em><span style=\"font-weight: 400;\"> section). Once you receive it, you will be able to schedule a coding session for the time that suits you best. During the session, just plug in the cable, follow the instructions from our technician and BMW Apps will be unlocked.</span></p>\r\n<p><span style=\"font-weight: 400;\">To prepare for your coding session you will need a laptop running Microsoft Windows and a WiFi internet network that you can connect to in your car. A Mac computer running Windows should work too. The coding cable must be plugged into your laptop&rsquo;s&nbsp;</span><a rel=\"noopener\" href=\"https://www.bimmer-tech.net/customer_support/Remote_coding/Instructions/EthernetPort.jpg\" target=\"_blank\"> <span style=\"font-weight: 400;\">Ethernet port</span></a><span style=\"font-weight: 400;\"> (if you don&rsquo;t have one, you can use an&nbsp;</span><a rel=\"noopener\" href=\"https://www.bimmer-tech.net/customer_support/Remote_coding/Instructions/LAN_MAC.jpg\" target=\"_blank\"> <span style=\"font-weight: 400;\">adapter</span></a><span style=\"font-weight: 400;\">).</span></p>\r\n<p><span style=\"font-weight: 400;\">Watch the video to understand the cable activation process better.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/EeNw6MPzpck\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The BimmerTech package includes everything necessary for unlocking CarPlay:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Remote activation service</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface (if you add it to your order in the top </span><em><span style=\"font-weight: 400;\">Option</span></em><span style=\"font-weight: 400;\"> section)</span></li>\r\n</ul>', NULL, NULL),
(589, 214, 'BMWAppsCable_E', '2019-05-10 12:23:10', '2019-05-15 13:33:17', 1, 'choice', 0, 'Unlock the full potential of your iDrive system with your favorite iPhone apps.', 1, NULL, NULL, NULL, 'codding', '<p><span style=\"font-weight: 400;\">Just imagine how comfortable it would be to listen to Spotify through the car speakers and switch between songs with the help of the iDrive controller. And what about checking out Twitter updates on the BMW native screen? The truth is that it&rsquo;s very easy to arrange with our BMW Apps activation. </span></p>\r\n<p><span style=\"font-weight: 400;\">We add iOS apps to your iDrive system so that you won&rsquo;t need to glance at your iPhone screen every time it lights up. Your social media highlights will be visible on the iDrive display, but not to get distracted from the road while driving, you can get your system to read them for your with the help of Voice Control. Using the same feature you can even make new posts or reply to messages. </span></p>\r\n<p><span style=\"font-weight: 400;\">If you </span>add BMW apps<span style=\"font-weight: 400;\"> to your iDrive, you will get access to Spotify, Pandora Radio, Web Radio, MOG, AUPEO!, Rhapsody and TuneIn. You&rsquo;ll be able to toggle between songs and stations using the iDrive controller. </span></p>\r\n<p><span style=\"font-weight: 400;\">Another important feature is that BMW Apps will allow finding a destination in the map on your iPhone and sending it to the vehicle&rsquo;s navigation. This comes in very handy when you can&rsquo;t use or don&rsquo;t have Voice Control, and don&rsquo;t want to type in the address with the iDrive controller. &nbsp;</span></p>\r\n<p><span style=\"font-weight: 400;\">Among other apps, you&rsquo;ll also be able to use Calendar, Wiki Local, ECO PRO analyzer, Last Mile navigation, Audible, GoPro, etc. To find out about the full list of services available for you and your location, download BMW ConnectedDrive from </span><a rel=\"noopener\" href=\"https://itunes.apple.com/us/app/bmw-connected/id1087277146?mt=8\" target=\"_blank\"><span style=\"font-weight: 400;\">App Store</span></a><span style=\"font-weight: 400;\"> for free. </span></p>', '<p><span style=\"font-weight: 400;\">BMW Apps are activated through a remote cable coding session. It is a very simple process that takes no more than 30 minutes. After you complete your order, we send you a coding cable (if you don\'t have one and add it in the top </span><em><span style=\"font-weight: 400;\">Option</span></em><span style=\"font-weight: 400;\"> section). Once you receive it, you will be able to schedule a coding session for the time that suits you best. During the session, just plug in the cable, follow the instructions from our technician and BMW Apps will be unlocked.</span></p>\r\n<p><span style=\"font-weight: 400;\">To prepare for your coding session you will need a laptop running Microsoft Windows and a WiFi internet network that you can connect to in your car. A Mac computer running Windows should work too, but it may not be compatible with some E-series vehicles. The coding cable must be plugged into a regular USB port.</span></p>\r\n<p><span style=\"font-weight: 400;\">Watch the video to understand the cable activation process better.</span></p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/EeNw6MPzpck\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p><span style=\"font-weight: 400;\">The BimmerTech package includes everything necessary for unlocking CarPlay:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Remote activation service</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface (if you add it to your order in the top </span><em><span style=\"font-weight: 400;\">Option</span></em><span style=\"font-weight: 400;\"> section)</span></li>\r\n</ul>', NULL, NULL),
(590, 215, 'CICNavRetrofitE63_E64', '2019-05-10 12:50:55', '2019-05-13 13:45:04', 1, 'choice', 0, 'An easy way to upgrade your older BMW to a newer navigation system.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">If your older BMW is not equipped with some advanced tech features, it doesn&rsquo;t mean that you have to wait ages saving up for a new vehicle. You can retrofit your favorite car with a BMW CIC upgrade and enjoy the most important tech functionalities, getting real value for your money.</span></p>\r\n<p><a rel=\"noopener\" href=\"https://www.bimmer-tech.net/blog/item/54-bmw-cic-nbt-nbtevo\" target=\"_blank\"><span style=\"font-weight: 400;\">Upgrading your BMW with a newer head unit</span></a><span style=\"font-weight: 400;\">, you get a high definition screen and the latest version of the maps for your region, to make navigating through the streets a breeze. In addition, the CIC remote coding activation, included into the kit, provides you with such multimedia features as Video &amp; Services in motion and Voice Control.</span></p>\r\n<p><span style=\"font-weight: 400;\">Your system will be also equipped with a USB port that can be used in several ways. You can benefit from it by updating your maps with a USB drive every time BMW releases a new version. What is more, through that port you will also be able to extend the capabilities of your car with the help of some </span><a rel=\"noopener\" href=\"https://www.bimmer-tech.net/bmw-idrive-coding/\" target=\"_blank\"><span style=\"font-weight: 400;\">USB coding</span></a><span style=\"font-weight: 400;\"> (the range of possible features will depend on your car&rsquo;s specs). </span></p>\r\n<p><span style=\"font-weight: 400;\">In order to perfectly integrate this iDrive retrofit into the interior of your car, in the top </span><em><span style=\"font-weight: 400;\">Option </span></em><span style=\"font-weight: 400;\">section you can choose among different trim designs, like carbon, piano black, fine wood, etc.</span></p>\r\n<p><span style=\"font-weight: 400;\">Please note that the CIC head unit, screen and the iDrive controller are slightly used, but in a very good condition. All other parts included in the kit are brand new.</span></p>', '<p><span style=\"font-weight: 400;\">The process consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</span></li>\r\n<li style=\"font-weight: 400;\"><a rel=\"noopener\" href=\"https://www.youtube.com/watch?v=EeNw6MPzpck\" target=\"_blank\"><span style=\"font-weight: 400;\">Coding </span></a><span style=\"font-weight: 400;\">(after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all the parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">CIC head unit</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">iDrive controller </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">High definition screen</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">USB port with a USB cable</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The installation is 100% reversible. No permanent modifications to the interior/exterior of your car are needed. The instructions will be available in your user dashboard within 72 hours after the CIC retrofit is shipped. But in case you need any help or have questions, contact our technical support team.</span></p>', NULL, NULL),
(591, 215, 'CICNavRetrofitE9x', '2019-05-10 13:01:25', '2019-05-13 13:48:40', 1, 'choice', 0, 'An easy way to upgrade your older BMW to a newer navigation system.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">If your older BMW is not equipped with some advanced tech features, it doesn&rsquo;t mean that you have to wait ages saving up for a new vehicle. You can retrofit your favorite car with a BMW CIC upgrade and enjoy the most important tech functionalities, getting real value for your money.</span></p>\r\n<p><a rel=\"noopener\" href=\"https://www.bimmer-tech.net/blog/item/54-bmw-cic-nbt-nbtevo\" target=\"_blank\"><span style=\"font-weight: 400;\">Upgrading your BMW with a newer head unit</span></a><span style=\"font-weight: 400;\">, you get a high definition screen and the latest version of the maps for your region, to make navigating through the streets a breeze. In addition, the CIC remote coding activation, included into the kit, provides you with such multimedia features as Video &amp; Services in motion and Voice Control.</span></p>\r\n<p><span style=\"font-weight: 400;\">Your system will be also equipped with a USB port that can be used in several ways. You can benefit from it by updating your maps with a USB drive every time BMW releases a new version. What is more, through that port you will also be able to extend the capabilities of your car with the help of some </span><a rel=\"noopener\" href=\"https://www.bimmer-tech.net/bmw-idrive-coding/\" target=\"_blank\"><span style=\"font-weight: 400;\">USB coding</span></a><span style=\"font-weight: 400;\"> (the range of possible features will depend on your car&rsquo;s specs). </span></p>\r\n<p><span style=\"font-weight: 400;\">In order to perfectly integrate this iDrive retrofit into the interior of your car, in the top </span><em><span style=\"font-weight: 400;\">Option </span></em><span style=\"font-weight: 400;\">section you can choose among different center console trim designs, like fine wood, aluminum, M3, etc.</span></p>\r\n<p><span style=\"font-weight: 400;\">Please note that the CIC head unit, screen and the iDrive controller are slightly used, but in a very good condition. All other parts included in the kit are brand new.</span></p>', '<p><span style=\"font-weight: 400;\">The process consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</span></li>\r\n<li style=\"font-weight: 400;\"><a rel=\"noopener\" href=\"https://www.youtube.com/watch?v=EeNw6MPzpck\" target=\"_blank\"><span style=\"font-weight: 400;\">Coding </span></a><span style=\"font-weight: 400;\">(after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all the parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">CIC head unit</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">iDrive controller </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">High definition screen</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">USB port with a USB cable</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The installation is 100% reversible. No permanent modifications to the interior/exterior of your car are needed. The instructions will be available in your user dashboard within 72 hours after the CIC retrofit is shipped. But in case you need any help or have questions, contact our technical support team.</span></p>', NULL, NULL),
