ne wood, brushed aluminum, real bamboo, etc.</span></p>\r\n<p><span style=\"font-weight: 400;\">Please note that the CIC head unit and screen are slightly used, but in a very good condition. All other parts included in the kit are brand new.</span></p>', '<p><span style=\"font-weight: 400;\">The process consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</span></li>\r\n<li style=\"font-weight: 400;\"><a rel=\"noopener\" href=\"https://www.youtube.com/watch?v=EeNw6MPzpck\" target=\"_blank\"><span style=\"font-weight: 400;\">Coding </span></a><span style=\"font-weight: 400;\">(after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all the parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">CIC head unit</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">High definition screen</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">USB port with a USB cable</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The installation is 100% reversible. No permanent modifications to the interior/exterior of your car are needed. The instructions will be available in your user dashboard within 72 hours after the CIC retrofit is shipped. But in case you need any help or have questions, contact our technical support team.</span></p>', NULL, NULL),
