span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</span></li>\r\n<li style=\"font-weight: 400;\"><a rel=\"noopener\" href=\"https://www.youtube.com/watch?v=EeNw6MPzpck\" target=\"_blank\"><span style=\"font-weight: 400;\">Coding </span></a><span style=\"font-weight: 400;\">(after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p><span style=\"font-weight: 400;\">The kit includes all the parts necessary for a complete installation:</span></p>\r\n<ul>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">CIC head unit</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">iDrive controller </span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">High definition screen</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">USB port with a USB cable</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wiring harness</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Coding interface</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">The installation is 100% reversible. No permanent modifications to the interior/exterior of your car are needed. The instructions will be available in your user dashboard within 72 hours after the CIC retrofit is shipped. But in case you need any help or have questions, contact our technical support team.</span></p>', NULL, NULL),
(596, NULL, 'PnPHarnessAddOn', '2019-05-10 13:31:21', '2019-05-10 13:33:41', 1, 'choice', 0, NULL, 0, NULL, NULL, 'Your car is equipped with a rear view camera and/or PDC. You need to add the PNP Harness to your order.  It is necessary for the upgrade to function properly with your park assist features.', NULL, NULL, NULL, NULL, NULL),
(597, 216, 'ComboxWithBT', '2019-05-10 13:36:41', '2019-05-14 13:16:57', 1, 'choice', 0, 'Enjoy Bluetooth, the Office Menu and a USB audio interface in older BMW models.', 1, NULL, NULL, NULL, NULL, '<p>If you want to breathe new life into your favorite BMW (instead of spending thousands on a new model), revitalizing its multimedia functionalities is the perfect step towards a better driving experience.</p>\r\n<p>Combox Media PnP Retrofit is a module that adds many new features to your iDrive system. Most importantly, your car will be equipped with BMW Bluetooth audio streaming thanks to the <a rel=\"noopener\" href=\"https://www.bimmer-tech.net/blog/item/56-bmw-enhanced-bluetooth\" target=\"_blank\">Enhanced Bluetooth</a> feature. You&rsquo;ll be able to stream music from your MP3 player or smartphone through the car&rsquo;s stereo system.</p>\r\n<p>What&rsquo;s more, your iDrive will support BMW Bluetooth pairing of two devices simultaneously. Listen to music from your passenger&rsquo;s phone and receive calls from your own!</p>\r\n<p>Combox also upgrades BMW Connected Drive &mdash; you get access to the Office Menu where you see SMS messages, notes, emails, calendar or reminders from your phone on the iDrive screen. Please keep in mind that you can only read them, and there is no possibility to edit or send new messages through the car&rsquo;s system.</p>\r\n<p>Combox retrofit provides support for Apple white cable which accounts for a much better BMW Bluetooth iPhone integration &mdash; your iPhone or iPod can be connected to your BMW. This lets you stream music with a much better audio quality and, at the same time, charge the device.</p>\r\n<p>In addition, you will have a chance to enjoy contacts with images and album art covers if the MP3 files contain them (this function is only available via a USB connection through the original &ldquo;white&rdquo; cable).</p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/et8Y6pHMor4\" frameborder=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>\r\n<p>Please note that Bluetooth audio playback and contact photos are not supported by all phones. Visit <a rel=\"noopener\" href=\"http://www.bmwusa.com/bluetooth\" target=\"_blank\">http://www.bmwusa.com/bluetooth</a> to check for compatible devices tested and recommended by BMW.</p>', '<p>In order to install Combox PnP retrofit properly, we will add the instructional manual to your personal account within 72 hours after the upgrade is shipped. It will contain a step-by-step installation instructions for your specific BMW. In case you have any questions, please don&rsquo;t hesitate to contact our technical support.</p>\r\n<p>The process itself consists of 2 main steps:</p>\r\n<ol>\r\n<li style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</li>\r\n<li style=\"font-weight: 400;\"><a rel=\"noopener\" href=\"https://www.youtube.com/watch?v=EeNw6MPzpck\" target=\"_blank\">Coding </a>(after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</li>\r\n</ol>\r\n<p>The kit includes all BMW auto parts necessary for a complete installation:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">Combox unit</li>\r\n<li style=\"font-weight: 400;\">Wiring harness</li>\r\n<li style=\"font-weight: 400;\">Coding interface</li>\r\n</ul>\r\n<p>This retrofit is absolutely lease-friendly. The installation doesn&rsquo;t require any permanent modifications to the exterior or interior of your car.</p>', NULL, NULL),
(598, NULL, 'USB_AUXIntAddOn', '2019-05-10 13:43:04', '2019-05-10 13:52:01', 1, 'choice', 0, NULL, 0, NULL, NULL, 'This retrofit adds an extra USB port to your BMW as well as AUX port with a 3.5 mm input meaning that you can attach any audio source with a headphone jack to your BMW’s head unit and enjoy the music through your car’s stereo system.', NULL, NULL, NULL, NULL, NULL),
(599, 184, '6WACluster', '2019-05-10 14:08:14', '2019-05-17 14:31:11', 1, 'choice', 0, 'Kick it off with a half digital, half analog cluster and enjoy your driving at full blast.', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">If you&rsquo;re tired of staring at the speedometer when it&rsquo;s dark and guessing whether you&rsquo;ll be stopped for speeding or not, a BMW original hybrid instrument panel is exactly what you need. However, a change from a fully analogue to a partially digital cluster makes a difference in many aspects of your driving. </span></p>\r\n<p>The half digital instrument cluster consists of analog gauges with LED lights and digital display in its lower half. During the day it is electroluminescent which enhances the overall look of the car&rsquo;s dashboard. In other words, it feels classy and modern at the same time, and who doesn&rsquo;t want that for their BMW?</p>\r\n<p>This improvement also boosts the overview of the instrument panel at nights making it crisp and clear. So, a quick look at the dash will give all the specs you need to keep track of during driving.</p>\r\n<p>The digital part of the cluster shows all the important control information like Comfort/ECO PRO/Sport/Sport+ modes, navigation, oil temp, current speed in numbers, a basic animation of the car, etc.</p>', '<p><span style=\"font-weight: 400;\">The process itself consists of 2 main steps:</span></p>\r\n<ol>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 1h)</span></li>\r\n<li style=\"font-weight: 400;\"><a rel=\"noopener\" href=\"https://www.youtube.com/watch?v=EeNw6MPzpck\" target=\"_blank\"><span style=\"font-weight: 400;\">Coding </span></a><span style=\"font-weight: 400;\">(after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</span></li>\r\n</ol>\r\n<p>The kit includes all parts necessary for a complete installation:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">6WA instrument panel cluster</li>\r\n<li style=\"font-weight: 400;\">Pin adaptor</li>\r\n<li style=\"font-weight: 400;\">Coding interface</li>\r\n</ul>\r\n<p>The way this 6WA half digital gauge cluster mounting is completely lease-friendly as there are no permanent modifications needed.</p>\r\n<p>You will be able to find the 6WA half digital speedometer installation manual in your personal account within 72 hours after the product is shipped. The manual will be created and customized for your exact car. But in case of any additional questions, our technical support is always ready to help.</p>', NULL, NULL),
(600, 182, 'NBTEVOID4', '2019-05-13 12:24:31', '2019-05-13 14:01:22', 1, 'choice', 0, 'Get a faster system and better graphics with a new ID4 iDrive for your BMW!', 1, NULL, NULL, NULL, NULL, '<p>If you&rsquo;re satisfied with your BMW&rsquo;s iDrive, but lack speed in the system&rsquo;s loading and better contrast in the graphics, NBT Evo ID4 Navigation System retrofit is exactly what you need!</p>\r\n<p>This BMW iDrive upgrade has a more power-packed processor, so the response and boot times will be much faster. In addition, the iDrive interface will look much sharper thanks to the higher image contrast.</p>\r\n<p>The kit contains only BMW original parts and FSC-certified codes, so there is no need for any aftermarket emulators.</p>\r\n<p>This BMW NBT Evo iDrive upgrade supplies the latest version of the maps for your region, to make navigating through the streets a breeze. In addition, the FSC activation includes such multimedia features as Video &amp; Services in motion, Voice Control and BMW Apps. Also if your BMW does not have Bluetooth or USB this NBT Evo retrofit kit will add these options to your car.</p>\r\n<p>NBT Evo ID4 belongs to the Navigation System Professional iDrives, meaning it has lots of multimedia and navigation functionalities. Want to know more about its features and other iDrives? Read our <a rel=\"noopener\" href=\"https://www.bimmer-tech.net/blog/item/54-bmw-cic-nbt-nbtevo\" target=\"_blank\">blog post</a>. &nbsp;</p>\r\n<p>The NBT Evo head unit, screen and iDrive Touch controller are slightly used, but in a very good condition. All other parts included in the kit are brand new.</p>\r\n<p>Please note that Remote Services like locking or unlocking the car with a smartphone, flashing the headlights or sounding the horn from afar, may not work in your vehicle. To learn whether Remote features will be available in your BMW after installation or not, <a rel=\"noopener\" href=\"http://testshop.bimmer-tech.net/page-contact\" target=\"_blank\">contact us</a> with your VIN.</p>', '<p>The installation instructions for NBT Evo ID4 hardware upgrade appear in the personal account within 72 hours after the purchased product is shipped. They are created and customized for each specific model. But in case of any additional questions, our technical support is always ready to help.</p>\r\n<p>The process itself consists of 2 main steps:</p>\r\n<ol>\r\n<li style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</li>\r\n<li style=\"font-weight: 400;\"><a rel=\"noopener\" href=\"https://www.youtube.com/watch?v=EeNw6MPzpck\" target=\"_blank\">Coding </a>(after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</li>\r\n</ol>\r\n<p>The kit includes all parts necessary for a complete installation:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">NBT Evo head unit</li>\r\n<li style=\"font-weight: 400;\">8.8&rdquo; high definition screen</li>\r\n<li style=\"font-weight: 400;\">iDrive Touch Controller</li>\r\n<li style=\"font-weight: 400;\">Wiring harness</li>\r\n<li style=\"font-weight: 400;\">Coding interface</li>\r\n</ul>\r\n<p>The installation is 100% reversible. No permanent modifications to the interior/exterior of your car are needed.</p>', NULL, NULL),
(601, 180, 'TrimToolKit', '2019-05-13 12:33:56', '2019-05-13 14:03:52', 1, 'choice', 0, 'High-quality trim tools for DIY installs that will take good care of your BMW!', 1, NULL, NULL, NULL, NULL, '<p><span style=\"font-weight: 400;\">Dreaming about a professional-grade plastic tool to make DIY BMW installations easy? You already found it! Our four-piece Trim Tool Kit is exactly what you&rsquo;ve been looking for to remove interior trim pieces safely without causing any scratches or dents.</span></p>\r\n<p><span style=\"font-weight: 400;\">The kit includes all the tools you\'ll need for installing new retrofits. Made with vehicle-friendly plastic that\'s durable enough to withstand the job, but easy enough on your vehicle to prevent scratches, cracks and other damage.</span></p>\r\n<p><span style=\"font-weight: 400;\">The ergonomic design makes it easy to slide between the trim and pry to remove it for installation purposes. It&rsquo;s very simple to access the tightest spaces and take off the trim pieces with minimal effort. </span></p>', NULL, NULL, NULL),
(602, 216, 'Combox_NoBT_E_Series', '2019-05-14 13:11:32', '2019-05-14 13:17:15', 1, 'choice', 0, 'Enjoy Bluetooth, the Office Menu and a USB audio interface in older BMW models.', 1, NULL, NULL, NULL, NULL, '<p>If you want to breathe new life into your favorite BMW (instead of spending thousands on a new model), revitalizing its multimedia functionalities is the perfect step towards a better driving experience.</p>\r\n<p>Combox Media PnP Retrofit is a module that adds many new features to your iDrive system. Most importantly, your car will be equipped with BMW Bluetooth audio streaming thanks to the <a rel=\"noopener\" href=\"https://www.bimmer-tech.net/blog/item/56-bmw-enhanced-bluetooth\" target=\"_blank\">Enhanced Bluetooth</a> feature. You&rsquo;ll be able to stream music from your MP3 player or smartphone through the car&rsquo;s stereo system.</p>\r\n<p>What&rsquo;s more, your iDrive will support BMW Bluetooth pairing of two devices simultaneously. Listen to music from your passenger&rsquo;s phone and receive calls from your own!</p>\r\n<p>Combox also upgrades BMW Connected Drive &mdash; you get access to the Office Menu where you see SMS messages, notes, emails, calendar or reminders from your phone on the iDrive screen. Please keep in mind that you can only read them, and there is no possibility to edit or send new messages through the car&rsquo;s system.</p>\r\n<p>Combox retrofit provides support for Apple white cable which accounts for a much better BMW Bluetooth iPhone integration &mdash; your iPhone or iPod can be connected to your BMW. This lets you stream music with a much better audio quality and, at the same time, charge the device.</p>\r\n<p>In addition, you will have a chance to enjoy contacts with images and album art covers if the MP3 files contain them (this function is only available via a USB connection through the original &ldquo;white&rdquo; cable).</p>\r\n<p><custom-iframe style=\"margin: auto;\" src=\"https://www.youtube.com/embed/et8Y6pHMo