border=\"0\" width=\"560\" height=\"315\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" position=\"center\" contenteditable=\"false\"></custom-iframe></p>', '<p>In order to install Combox PnP retrofit properly, we will add the instructional manual to your personal account within 72 hours after the upgrade is shipped. It will contain a step-by-step installation instructions for your specific BMW. In case you have any questions, please don&rsquo;t hesitate to contact our technical support.</p>\r\n<p>The process itself consists of 2 main steps:</p>\r\n<ol>\r\n<li style=\"font-weight: 400;\">Fully plug &amp; play installation (takes up to 3&ndash;4h)</li>\r\n<li style=\"font-weight: 400;\"><a rel=\"noopener\" href=\"https://www.youtube.com/watch?v=EeNw6MPzpck\" target=\"_blank\">Coding </a>(after the installation is finished, it is necessary to schedule a remote coding session with a BimmerTech technician)</li>\r\n</ol>\r\n<p>The kit includes all BMW auto parts necessary for a complete installation:</p>\r\n<ul>\r\n<li style=\"font-weight: 400;\">Combox unit</li>\r\n<li style=\"font-weight: 400;\">Microphone</li>\r\n<li style=\"font-weight: 400;\">Bluetooth antenna</li>\r\n<li style=\"font-weight: 400;\">Wiring harness</li>\r\n<li style=\"font-weight: 400;\">Coding interface</li>\r\n</ul>\r\n<p>This retrofit is absolutely lease-friendly. The installation doesn&rsquo;t require any permanent modifications to the exterior or interior of your car.</p>', NULL, NULL),
