INSERT INTO `sylius_product_translation` (`id`, `translatable_id`, `name`, `slug`, `description`, `meta_keywords`, `meta_description`, `short_description`, `locale`) VALUES
(417, 417, 'BMW LIVE Navigation Map Update 2018/2019', 'bmw-live-navigation-map-update-2018-2019-mapupdateliveenavevo', NULL, 'bmw navigation update, bmw software update, bmw map update, bmw map download, bmw road map, bmw map update usb, bmw navigation system map update, bmw idrive map update,bmw navigation map certificate release code, bmw gps map,  bmw gps map update, bmw codi', 'BMW navigation map update provides the latest info about existing, new and closed routes. Learn more about it and our fast BMW map update USB installation!', '<ul>\r\n	<li>Keep your maps updated without leaving your home</li>\r\n	<li>Take charge of your time and find routes through new, more convenient roads and expressways</li>\r\n	<li>Know exactly where the next gas station, ATM or restaurant is</li>\r\n	<li>Save fuel by choosing the most efficient ways to get to your destination</li>\r\n</ul>', 'en_US'),
(418, 418, 'Front View Camera Retrofit', 'front-view-camera-retrofit-frontcam', NULL, 'Front View Camera, BMW aftermarket front view camera, bmw front view camera retrofit, bmw front camera installation, exterior parking camera, bmw front view camera kit, add front view camera to bmw, diy front view camera, front view camera wiring, bmw par', 'Better safe than sorry — get a BMW aftermarket front view camera at a fair price and enjoy the chance to see all the low obstacles and protect your front lip.', '<ul>\r\n	<li>Helps you avoid scratches, dents or other damages on your BMW front bumper</li>\r\n	<li>Lets you notice any hard-to-see objects and low obstacles in front of your vehicle</li>\r\n	<li>Activated automatically after you shift from reverse into drive</li>\r\n	<li>Overrides the native iDrive mode with a full-screen camera image</li>\r\n	<li>Equipped with a wide angle lens</li>\r\n	<li>Produces a high-quality image</li>\r\n</ul>', 'en_US'),
(420, 420, 'Grill-Friendly Front View Camera for F30', 'grill-friendly-front-view-camera-for-f30-frontcamf30', NULL, 'Front View Camera, BMW aftermarket front view camera, bmw front view camera retrofit, bmw front camera installation, exterior parking camera, bmw front view camera kit, add front view camera to bmw, diy front view camera, front view camera wiring, bmw par', 'The BMW aftermarket front view camera made to fit into the kidney grill is all you need to keep your BMW’s front safe. Click the link and find out more.', '<ul>\r\n	<li>Effortlessly mounts into the F30 kidney grill without any modifications to the vehicle</li>\r\n	<li>Helps you avoid scratches, dents or other damage on your BMW&rsquo;s front bumper</li>\r\n	<li>Lets you see any hard-to-see objects and low obstacles in front of your vehicle</li>\r\n	<li>Activated automatically after you shift from reverse into drive</li>\r\n	<li>Overrides the native iDrive mode with a full-screen camera image</li>\r\n	<li>Equipped with a wide angle lens</li>\r\n	<li>Produces a high-quality image</li>\r\n</ul>', 'en_US'),
(422, 422, 'SiriusXM Satellite Radio USB Activation', 'siriusxm-satellite-radio-activation-usb-siriusactivationusb', NULL, NULL, NULL, '<ul>\r\n	<li>Activate SiriusXM satellite radio in your vehicle, without leaving your home</li>\r\n	<li>Enjoy over 150 radio channels, from Howard Stern and Bloomberg to NFL and Comedy Central</li>\r\n	<li>50% off the typical dealer pricing</li>\r\n	<li>Get a free All Access SiriusXM package for up to 12 months (conditions apply)</li>\r\n</ul>', 'en_US'),
