(521, 529, 'Surround View Retrofit', 'surround-view-retrofit', NULL, 'car camera system, 360 degree camera, cameras for cars, exterior parking camera rear, RVS Systems, Bird\'s Eye View Camera System, Panoramic View,  360 degree car camera, cars top view, side view car', 'The 360 degree car camera system will make sure you are never in a difficult parking situation. Find out more about Surround View retrofit and let it protect your BMW.', '<ul>\r\n	<li>Shows you camera images from different viewing angles on the iDrive screen</li>\r\n	<li>Assists you in parking and difficult traffic situations</li>\r\n	<li>Combines images from several cameras and creates a perfect overview</li>\r\n	<li>Helps to see approaching traffic at junctions or areas with restricted views</li>\r\n</ul>', 'en_US'),
(522, 530, 'SmartView HD Apple TV3', 'smartviewhd-apple-tv3-smartviewhdatv3', NULL, 'smartphone mirroring in car, screen mirroring, screen mirroring iphone, wireless airplay, Apple TV in Car, screen mirroring  Iphone X, screen share,, wireless display, screen mirroring over wifi, screen mirroring device, screen share, screen sharing, mirr', 'Looking for an upgrade for iPhone screen mirroring? SmartView HD Apple TV3 will do exactly what you need, and even more. Check out the upgrade in our webshop.', '<ul>\r\n	<li>Allows streaming videos from your iPhone onto<strong>&nbsp;</strong>the iDrive screen</li>\r\n	<li>Provides audio streaming through your BMW&#39;s AUX port</li>\r\n	<li>Wirelessly connects to any iOS device</li>\r\n	<li>Includes an original Apple TV unit modified to function with the BMW iDrive system</li>\r\n	<li>Gives the possibility to use Apple TV3 native apps without connecting your phone</li>\r\n</ul>', 'en_US'),
(523, 531, 'SmartView HD Apple TV4', 'smartviewhd-apple-tv4-smartviewhdatv4', NULL, 'smartphone mirroring in car, screen mirroring, screen mirroring iphone, wireless airplay, Apple TV in Car, screen share,, wireless display, screen mirroring over wifi, screen mirroring device, screen share, screen sharing, mirror app, screen sharing softw', 'Get Apple TV4 and make the most out of it by mirroring or using your favorite apps on the BMW iDrive screen. Find out more about iPhone Screen Mirroring.', '<ul>\r\n	<li>Lets you mirror your iPhone screen onto the onto the native iDrive display</li>\r\n	<li>Has an inbuilt Apple TV4 with its own App Store which gives the possibility to use apps without connecting your phone</li>\r\n	<li>Allows streaming videos from your iPhone onto the car screen</li>\r\n	<li>Provides audio streaming through your BMW&#39;s AUX port</li>\r\n	<li>Wirelessly connects any iOS device to the BMW iDrive system</li>\r\n</ul>', 'en_US'),
(524, 532, 'SmartView HD Flex', 'smartviewhd-flex-smartviewhdflex', NULL, 'screen mirroring, screen mirroring android, bmw android auto, samsung screen mirroring, screen mirroring iphone, screen mirroring  S10, S9, S8, S7, screen share, samsung smart view, wireless display, screen mirroring over wifi, screen mirroring device, sc', 'Want to cast the screen of Android and iOS devices onto the car’s display? Consider our SmartView HD Flex screen mirroring upgrade which will do that and more.', '<ul>\r\n	<li>Allows streaming videos from your Android smartphone or iPhone onto the iDrive screen</li>\r\n	<li>Lets you use your favorite maps on a bigger display</li>\r\n	<li>Produces its own WiFi network for connecting to mobile devices so no cables or mobile hotspots are needed</li>\r\n	<li>Provides audio playback through your BMW&#39;s AUX port</li>\r\n	<li>Has in-built AirPlay and Miracast receivers</li>\r\n</ul>', 'en_US'),
