(530, 538, 'NBT/NBT Evo Remote Software Activation', 'nbt-nbt-evo-remote-software-activation', NULL, 'bmw coding, bmw navigation update, bmw coding software, bmw navigation system, bmw idrive update, bmw software update', 'Bought a new NBT or NBT Evo system for your car but have no idea how to activate it? Get in touch with us and our pro technician will do all the BMW coding for you!', '<ul>\r\n	<li>Allows you to have your BMW coded without leaving home</li>\r\n	<li>Sets up the NBT or NBT Evo head unit specifically for your vehicle</li>\r\n	<li>Activates Navigation for more comfortable driving</li>\r\n	<li>Unlocks Voice Control and Video &amp; Services in motion features in your BMW iDrive system</li>\r\n</ul>', 'en_US'),
(531, 539, 'iDrive Touch Controller Retrofit', 'idrive-touch-controller-retrofit', NULL, 'iDrive Touch Controller, idrive touchpad, idrive auto parts, idrive touch screen, bmw idrive controller knob, idrive touch module, idrive touch handwriting, idrive controller replacement, handwriting recognition, touch-sensitive pad, bmw parts, beamer car', 'A sleek iDrive Touch Controller with a bigger wheel and touchpad will certainly refresh your BMW’s interior. Click the link and check out its features in detail.', '<ul>\r\n	<li>Equipped with a touchpad on the BMW iDrive controller knob that you can use to write letters while navigating through the system</li>\r\n	<li>Allows more focus on the road</li>\r\n	<li>Designed to amplify the premium look of your BMW</li>\r\n	<li>Provides a quick response to your touch</li>\r\n	<li>Consists entirely of genuine BMW parts</li>\r\n</ul>', 'en_US'),
