(533, 541, 'BMW Parking Assistant Retrofit', 'bmw-parking-assistant-retrofit', NULL, 'Park assist, Intelligent Parking, self parking car, parallel parking distance, autoparking system, automatic parking systems, active park assist, BMW Reversing Assistant, rear park assist, parking aid, rear parking aid, automated parking, bmw park distanc', 'BMW Parking Assistant turns your vehicle into a smart self parking car. Click the link and learn more about parallel parking and detecting perfect parking spots.', '<ul>\r\n	<li>Turns your BMW into a self parking car</li>\r\n	<li>Helps you in difficult parking situations</li>\r\n	<li>Spots suitable parking spaces and notifies you about them on the iDrive screen</li>\r\n	<li>Uses sensors to detect and measure spaces on both sides of your BMW</li>\r\n	<li>Supports you during parallel parking and can control steering, braking and acceleration while parking</li>\r\n	<li>Consists entirely of genuine BMW parts</li>\r\n</ul>', 'en_US'),
