(190, 173, 188, 'SiriusActivation', 3, 4, 2, 0, '2019-04-17 09:30:12', '2019-04-30 07:48:17', 25000, 1, 'SiriusXM Satellite Radio Activation', '<ul>\r\n	<li>\r\n	<p>Activate SiriusXM satellite radio in your vehicle, without leaving your home</p>\r\n	</li>\r\n	<li>\r\n	<p>Enjoy over 150 radio channels, from Howard Stern and Bloomberg to NFL and Comedy Central</p>\r\n	</li>\r\n	<li>\r\n	<p>50% off the typical dealer pricing</p>\r\n	</li>\r\n	<li>\r\n	<p>Get a free All Access SiriusXM package for up to 12 months (conditions apply)</p>\r\n	</li>\r\n</ul>', 1, NULL, 'siriusxm activation, sirius car radio, sirius xm car kit, sirius xm car subscription, sirius xm channels, satellite radio, sirius xm free trial, xm radio channels, sirius streaming, siriusxm packages, xm radio stations, sirius xm channels list 2019, siriu', 'Don’t know what to listen to while driving? Go for SiriusXM activation in your BMW and enjoy more than 150 XM radio channels through your car’s stereo system.', '<p>Looking for the easiest way to add Sirius XM car subscription to your BMW or MINI? Our remote SiriusXM activation process means you&rsquo;ll be enjoying satellite radio in less than 30 minutes, without even leaving your home.</p>\r\n\r\n<p>With around 150 <a href=\"https://www.bimmer-tech.net/blog/item/51-4-satellite-radio-stations-worth-activating-siriusxm-in-your-bmw-for\">XM radio channels</a> to choose from, including news, music, sports and entertainment, you and your family will always find something worth listening to.</p>\r\n\r\n<p>BMW owners often ask: &ldquo;How to get Sirius radio in my car for free for a year?&rdquo;, and the answer is that with BimmerTech it&rsquo;s pretty simple. We use a genuine BMW activation code to add satellite radio to your vehicle, meaning you can benefit from the <a href=\"https://www.siriusxm.com/sxm-learnmore?intcmp=hp_cta_0218_learn&amp;hpid=HP_NEW_LearnAboutMyTrial\">Sirius XM free trial period</a>. If you&rsquo;re the original owner of the car, you may receive the All Access SiriusXM subscription free of charge for up to 12 months (or 2 months in case the BMW/MINI is Certified Pre-Owned).</p>\r\n\r\n<p>What XM radio stations are available for your car depends on its hardware. Visit the <a href=\"http://www.siriusxm.com/channellineup\">SiriusXM official website</a> to check the lineup for your car. Also, have a look at the <a href=\"https://www.siriusxm.com/servlet/Satellite?blobcol=urlimage&amp;blobheadername1=Content-Type&amp;blobheadervalue1=application%2Fpdf&amp;blobkey=id&amp;blobtable=ImageAsset&amp;blobwhere=1283879646761&amp;ssbinary=true\">Sirius XM channels list 2019</a>.</p>\r\n\r\n<p>How do you install Sirius Satellite radio in your car? Identify your BMW/MINI at the top and you will get a full description of Sirius car radio activation in your specific vehicle together with the details on what comes in a Sirius XM car kit.</p>', 'Get up to 150 satellite radio channels activated in your car in less than 30 minutes.'),
(191, 173, 177, 'CarPlayMMI', 25, 26, 2, 0, '2019-04-23 10:44:52', '2019-05-17 14:35:11', 52500, 1, 'BMW CarPlay MMI Retrofit', '<ul>\r\n	<li>Lets you comfortably use the iPhone apps on your native iDrive display</li>\r\n	<li>Uses the factory car microphone to let Siri hear voice commands</li>\r\n	<li>Allows playing videos from a USB thumb drive</li>\r\n	<li>Provides audio playback through your BMW&#39;s AUX port</li>\r\n	<li>Makes it easy to switch between the BMW CarPlay upgrade and your car&rsquo;s interfaces using the iDrive controller</li>\r\n	<li>Compatible with older BMW iDrive generations</li>\r\n</ul>', 1, NULL, 'bmw carplay, apple carplay, bmw carplay retrofit, bmw carplay upgrade, bmw carplay setup, bmw apple carplay upgrade, bmw carplay 2019, bmw apple carplay compatibility, bmw carplay support, bmw carplay activation, bmw carplay update, wireless carplay, bmw', 'Want to use your iPhone apps on the BMW screen in a 2016 or older car? Our BMW CarPlay MMI retrofit will make it happen. Check it out now!', '<p>If you have a 2016 or older car, you can use BMW Apple CarPlay apps on your iDrive screen thanks to our unique retrofit &mdash; CarPlay MMI. Original BMW Apple CarPlay compatibility is limited only to the newest iDrive systems, but our aftermarket solution offers you the same features as the original software, and adds a few more functionalities on top of that. Identify your car to find out more about them.</p>\r\n\r\n<p>CarPlay MMI retrofit supports devices running iOS up to version 12, meaning that you can take advantage of Google Maps and Waze while navigating through the city. BMW CarPlay retrofit will also let you benefit from Apple Maps, Spotify, Siri and other applications on the iDrive screen without actually using the phone.</p>\r\n\r\n<p>Unlike BMW CarPlay activation, our upgrade is compatible with F-series cars that have both newer and older iDrive generations.</p>', 'Not compatible with original Apple CarPlay? Our CarPlay MMI will save the day.'),
(196, 173, 184, 'VividScreen', 43, 44, 2, 0, '2019-04-24 06:38:47', '2019-04-30 07:47:47', 59900, 1, 'VividScreen - iDrive Display for BMW', '<ul>\r\n	<li>Provides twice the screen resolution compared to the OEM iDrive display</li>\r\n	<li>Enhances the quality of the image and contrast for a better viewing experience</li>\r\n	<li>Has the same design as the OEM iDrive screen to maintain the factory look</li>\r\n	<li>Supports SmartView BMW idrive screen mirroring functionality for using iPhone apps on the dashboard display</li>\r\n	<li>Compatible with many technological upgrades not available with the stock screen</li>\r\n</ul>', 1, NULL, 'VividScreen, iDrive Display for BMW, idrive display, idrive screen, split screen idrive, idrive screen upgrade, idrive full screen, touch screen idrive, vividscreen upgrade kit, bmw idrive screen mirror, vividscreen apple tv 4, vividscreen carplay, vivids', 'Fancying a bigger iDrive display for BMW? VividScreen is exactly what you need — check out how a 8.8″ hi-res display renovates the car and brightens the rides.', '<p>How to upgrade 6.5 inch iDrive screen to bigger resolution? The answer is simpler than you&rsquo;ve thought: there is no need to replace the whole iDrive system. All you need to do is swap your stock display for BimmerTech&rsquo;s VividScreen &mdash; an iDrive display for BMW that lets you add the latest technology upgrades to your car and realize its potential.</p>\r\n\r\n<p>The new 8.8&Prime; 1280x480 BMW iDrive screen replacement doubles or triples the pixel density of the stock screen options, as well as sporting noticeably improved contrast for a better overall image quality. iDrive screen upgrade is completely compatible with the BMW system and designed to look the same as a factory installed screen to smoothly fit into your interior.</p>\r\n\r\n<p>You can also make the most of the iDrive display using screen mirroring &mdash; your car becomes compatible with SmartView mirroring functionality. It means that you&rsquo;ll be able to stream the display of your smartphone onto the iDrive full screen. Thanks to the inbuilt Multimedia Interface (MMI), you can also add our rear &amp; front view cameras and the above mentioned mirroring devices for a much lower price if compatible.</p>\r\n\r\n<p>Identify your car and find out the full list of compatible add-ons for the VividScreen upgrade kit. On top of that, learn more about features relatable to your specific model and details on VividScreen installation.</p>', 'A big high-res screen capable of renewing your BMW.'),
(197, 173, 186, 'PowerTrunk', 47, 48, 2, 0, '2019-04-25 09:29:25', '2019-04-26 10:56:36', 69900, 1, 'Power Trunk Release Retrofit', '<ul>\r\n	<li>Allows you to open &amp; close the trunk by pushing a button on your remote key fob, trunk lid, or dashboard</li>\r\n	<li>Stops closing automatically in case of any obstacle for added safety</li>\r\n	<li>Lets you set the exact position the trunk lid opens to</li>\r\n	<li>Based on a high-end motorized system that makes the power trunk lift smooth and easy</li>\r\n</ul>', 1, NULL, 'Power Trunk Release, power trunk release kit, boot release, power trunk release, electric trunk release, power tailgate opener, power trunk release kit installation, open trunk button, power trunk lift, automatic trunk, power trunk closer, aftermarket pow', 'Want to open & close the trunk just by pushing a button? Check out our Power Trunk Release retrofit and confirm to yourself once more that you can’t do without it.', '<p>When your hands are full of packages, bags and kids, what could be better than being able to close your automatic trunk just by pressing a button? You will say &ldquo;nothing&rdquo; after you experience the convenience of BimmerTech&rsquo;s Power Trunk Release retrofit.</p>\r\n\r\n<p>With this kit installed in your BMW, you&rsquo;ll be able to control the lid with:</p>\r\n\r\n<ul>\r\n	<li>The boot release button on the remote key fob</li>\r\n	<li>The button in the trunk handle, and an additional button built in to the inside of the trunk lid</li>\r\n	<li>The open trunk button button on the dashboard (if your vehicle has it)</li>\r\n	<li>The kick feature if your car is equipped with a factory or retrofitted Comfort Access system with this functionality</li>\r\n</ul>\r\n\r\n<p>You can easily open and close the trunk from the inside or whenever you are around your car, and despite the convenience of using the key fob, you&rsquo;re not bound only to it.</p>\r\n\r\n<p>You can customize the electric trunk release and choose the position the lid opens to. In addition, our Power Trunk Release kit features anti-pinch technology. Specify your BMW model or put in your VIN to discover more information about these attributes and power tailgate opener itself.</p>', 'A push of a button is all you’ll need to do to open & close your car trunk.'),
(198, 173, 182, 'MapUpdate', 37, 38, 2, 0, '2019-04-26 11:48:40', '2019-05-13 14:25:06', 11500, 1, 'BMW Navigation Map Update 2018/2019', '<ul>\r\n	<li>Keep your maps updated without leaving your home</li>\r\n	<li>Take charge of your time and find routes through new, more convenient roads and expressways</li>\r\n	<li>Know exactly where the next gas station, ATM or restaurant is</li>\r\n	<li>Save fuel by choosing the most efficient ways to get to your destination</li>\r\n</ul>', 1, NULL, 'bmw navigation update, bmw software update, bmw map update, bmw map download, bmw road map, bmw map update usb, bmw navigation system map update, bmw idrive map update,bmw navigation map certificate release code, bmw gps map,  bmw gps map update, bmw codi', 'BMW navigation map update provides the latest info about existing, new and closed routes. Learn more about it and our fast BMW map update USB installation!', '<p>They say time is money, so finding your way around as quickly as possible should be a priority. And keeping your map up-to-date ensures you&#39;ll always know the best and fastest routes to get to your destination.</p>\r\n\r\n<p>When you regularly refresh your BMW navigation, your map shows you:</p>\r\n\r\n<ul>\r\n	<li>New roads opened or existing ones closed</li>\r\n	<li>Time-saving detours for your usual rides</li>\r\n	<li>Almost 300 000 new points of interest added each year (hotels, gas stations, cafes, etc.)</li>\r\n</ul>\r\n\r\n<p>BMW recommends performing a BMW navigation system map update at least once a year. For anybody who drives a lot, though, it&rsquo;s better to get new information every three to six months.</p>\r\n\r\n<p>Type in your VIN to learn more about the BMW map update USB process as well as what kind of BMW navigation update is available. We offer Premium, Live, Motion, Move, Route, Next, Evo &amp; Way BMW GPS map updates for cars with different configurations.</p>', 'Plan your rides and detours with precision thanks to a map that’s always spot-on.'),
(201, 173, 174, 'BMWRearCamOEM', 11, 12, 2, 0, '2019-04-29 08:12:14', '2019-05-14 09:00:14', 99900, 1, 'BMW Rear View Camera Retrofit (OEM)', '<ul>\r\n	<li>It&rsquo;s the same BMW OEM backup camera that BMW installs at factory</li>\r\n	<li>Consists entirely of genuine BMW parts</li>\r\n	<li>Produces a high-quality image</li>\r\n	<li>Allows to zoom in on the trailer hitch to neatly drive up to the right spot</li>\r\n	<li>Supports Dynamic Parking Lines and Obstacle Marking</li>\r\n	<li>360 degree Surround View camera system available as an optional add-on</li>\r\n</ul>', 1, NULL, 'BMW backup camera, BMW rear view camera, BMW OEM backup camera,  bmw backup camera retrofit, bmw backup camera installation, bmw backup camera kit, bmw rear view camera car kit, add backup camera to bmw, rear view camera retrofit, reverse camera, rv backu', 'Dreaming about a BMW backup camera that would work and look like factory installed? Check out our BMW Rear View Camera (OEM) and make your dreams come true.', '<p>If you want to stay completely true to BMW even in your aftermarket choices, we&rsquo;re always happy to give you the options you&#39;re looking for. Our BMW rear view camera retrofit is exactly the same park assist upgrade that BMW offers and installs at the factory.&nbsp;</p>\r\n\r\n<p>Due to the OEM origin, the BMW backup camera kit perfectly integrates into the bodywork of your car as well as your iDrive system. What&rsquo;s more, this BMW backup camera retrofit produces the highest picture quality on the market. But these are not the only aspects that make it stand out.&nbsp;</p>\r\n\r\n<p>To take advantage of all the BMW rear view camera car kit&rsquo;s features, your vehicle must be equipped with the Park Distance Control (PDC) and iDrive with Navigation System Professional. Please identify your car to find out whether it&rsquo;s compatible with the upgrade and to discover more information about other important functionalities as well as BMW backup camera installation.</p>\r\n\r\n<p>You will be able to check out some DIY backup camera tips that will help you save money on going to an installer together with general professional advice on how to install a backup camera in your specific BMW.&nbsp;</p>', 'Turn parking into a pleasant and easy drill with the BMW original backup camera.'),
(202, 173, 177, 'CarPlay', 23, 24, 2, 2, '2019-04-29 12:44:05', '2019-04-30 07:30:23', 39900, 1, 'BMW Apple CarPlay Activation', '<ul>\r\n	<li>Lets you safely use iPhone apps on your native iDrive screen</li>\r\n	<li>Uses the factory car microphone to let Siri hear voice commands</li>\r\n	<li>Connects your iPhone wirelessly to the BMW iDrive system</li>\r\n	<li>Provides audio playback through your BMW&#39;s stereo system</li>\r\n	<li>Makes it easy to switch between CarPlay and your car&rsquo;s standard interface using the iDrive controller</li>\r\n</ul>', 1, NULL, 'bmw carplay, apple carplay, bmw carplay retrofit, bmw carplay upgrade, bmw carplay setup, bmw apple carplay upgrade, bmw carplay 2019, bmw apple carplay compatibility, bmw carplay support, bmw carplay activation, bmw carplay update, wireless carplay, bmw', 'Apple CarPlay lets you connect an iPhone to the car, and use BMW CarPlay apps on the iDrive screen. Find out why it’s the best way to use your phone in a BMW.', '<p>Do you dream of using Apple Maps on your car screen or listening to Spotify through the BMW speakers? All this is possible with BMW CarPlay &mdash; an original Apple system that lets you use your favorite iPhone apps on the iDrive display.</p>\r\n\r\n<p>BMW Apple CarPlay upgrade supports devices running iOS up to version 12, meaning that you can take advantage of Google Maps and Waze while navigating through the cit</p>\r\n\r\n<p>After BMW CarPlay activation, you can use the factory car microphone for Siri Voice commands. This means that you can listen to and dictate text messages without distracting yourself from the road. With BMW CarPlay upgrade nothing stops you from making calls or checking up on your voicemail either.</p>\r\n\r\n<p>With this upgrade you don&rsquo;t need any cables; you wirelessly connect your iPhone to BMW CarPlay over WiFi. It&rsquo;s also very easy to switch between the iDrive and CarPlay interfaces, and operate both with the iDrive controller.</p>\r\n\r\n<p>Among BMW CarPlay apps you will find Spotify, Tidal, Amazon Music, WhatsApp, SiriusXM Radio, etc. The full list can be found <a href=\"https://www.apple.com/ios/carplay/\">here</a>.</p>', 'The safest, most convenient way to use your iPhone apps while driving.'),
(203, 173, 184, '6WB', 41, 42, 2, 1, '2019-04-30 06:44:18', '2019-04-30 08:55:18', 169900, 1, '6WB BMW OEM Digital Instrument Cluster', '<ul>\r\n	<li>Features a fully digital setup and several sorts of animations</li>\r\n	<li>Offers different looks for three driving modes</li>\r\n	<li>Focuses on speedometer and rev counter gauges in Sport Mode</li>\r\n	<li>Emphasizes an economical driving style in Eco Pro mode</li>\r\n	<li>Displays the car in the center portion of the cluster in the real time</li>\r\n	<li>Consists entirely of genuine BMW parts</li>\r\n</ul>', 1, NULL, 'digital instrument cluster, digital gauge cluster, digital dash, digital dashboard bmw, digital display, instrument panel cluster, digital speedometer, virtual cockpit, custom gauges cluster,  dynamic digital cluster, bmw oem digital cluster', 'BMW Digital Instrument Cluster is exactly what you need to make your car look high-tech. Click the link and learn about numerous cool features of the digital dash.', '<p>Amplifying your driving experience is not a whim&mdash;it&rsquo;s means making the absolute most of your BMW&rsquo;s potential. And the 6WB Digital Instrument Cluster is exactly what your car needs to reach the next level of comfort and confidence within your virtual cockpit.</p>\r\n\r\n<p>The digital gauge cluster is fully digitized. It has different setups for three driving modes &mdash; Comfort, Eco Pro and Sport modes (together with Sport+ mode).</p>\r\n\r\n<p>The center portion of the digital dash can show your car in real time &mdash; when some of your doors are opened, it is accurately displayed on the panel. When you turn on navigation, the instructions will be also indicated on the instrument panel cluster.</p>\r\n\r\n<p>To know more about the digital dashboard BMW features, please identify your car. The details of custom gauges cluster installation will give you a general overview of what instruments are needed and how much time it might take. You can also have a look at our video on <a href=\"https://www.youtube.com/watch?v=DFNzsh_-SJk\">how to change the car instrument cluster to a digital one</a>.</p>', 'Experience Comfort, Sport or Eco Pro modes in a new way with a digital instrument cluster.'),
(204, 173, 174, 'PDCRetrofit', 9, 10, 2, 1, '2019-04-30 09:27:01', '2019-04-30 11:45:01', 69700, 1, 'BMW PDC (Park Distance Control) Retrofit', '<ul>\r\n	<li>Makes parking easy and safe</li>\r\n	<li>Warns you about any tight spaces between your car and obstacles</li>\r\n	<li>Uses ultrasound sensors to detect the distance to nearby objects &nbsp;</li>\r\n	<li>Consists entirely of genuine BMW parts</li>\r\n	<li>Allows retrofitting the front, rear or both bumpers of your vehicle</li>\r\n</ul>', 1, NULL, 'Park Distance Control, bmw active park distance control, parallel parking distances, bmw pdc', 'Park Distance Control is an upgrade that will save your BMW from damage. Follow the link and find out more more about the original BMW parking sensors.', '<p>Tired of bending, twisting and constantly looking around when you try to park or drive out of a space tightly packed with other vehicles? We perfectly understand the feeling, but you can easily change the situation with our cutting-edge park assist retrofit.</p>\r\n\r\n<p>BMW Active Park Distance Control (PDC) equips your car with sensors that use ultrasound to measure the distance to the nearest obstacles. The system turns on when your vehicle is less than 80 cm away from the closest large object and approaching, or less than 30cm when your BMW isn&rsquo;t moving.</p>\r\n\r\n<p>PDC retrofit warns you about any obstacles with a distinctive acoustic signal, and different warning colors on the iDrive screen as your vehicle draws closer.</p>\r\n\r\n<p>If you want to know more about the Park Distance Control upgrade, its features or installation, identify your BMW in the top right corner.</p>', 'Hear and see all the obstacles around your car to park and manoeuvre in tight spaces.'),
(209, 173, 177, 'EnhBTandUSB', 21, 22, 2, 3, '2019-05-08 11:15:49', '2019-05-08 13:37:32', 17500, 1, 'BMW Enhanced Bluetooth Update / USB Port Activation', '<ul>\r\n	<li>Extends the multimedia capabilities of your BMW</li>\r\n	<li>Lets you stream audio from a smartphone or MP3 player via Bluetooth/USB port</li>\r\n	<li>Allows pairing up multiple devices via Bluetooth</li>\r\n	<li>Gives read-only access to SMS messages, email, reminders, etc.</li>\r\n	<li>Provides USB audio playback through the BMW stereo system</li>\r\n	<li>Enables you to use Voice Control to make calls without taking your hands of the wheel</li>\r\n</ul>', 1, NULL, 'Bluetooth Update, media streaming, audio streaming, Enhanced Bluetooth package, bluetooth phone functionality, bmw enhanced bluetooth with usb and voice, bmw bluetooth update, activating bluetooth, bmw smartphone integration, bmw bluetooth audio streaming', 'Do you want to stream music over Bluetooth or turn on some favourite songs via USB port? Then check out our Enhanced Bluetooth update and USB port activation!', '<p>With BMW Enhanced Bluetooth Update &amp; USB Port Activation you will be able to check out a new Spotify playlist through the car&rsquo;s stereo system, or accept calls hands-free without breaking your focus on the road.</p>\r\n\r\n<p><a href=\"https://www.youtube.com/watch?time_continue=98&amp;v=LHUXg6_Ycag\">What is &ldquo;Enhanced Bluetooth&rdquo;</a>? The most obvious benefit of adding this feature to your car is that audio streaming won&rsquo;t just be something you&rsquo;ve read about online anymore. You&rsquo;ll be able to play your favorite tracks through the car&rsquo;s speakers via Bluetooth. In terms of BMW smartphone integration, you&rsquo;ll also have the chance to connect your smartphone via a USB port, ensuring much better sound quality (this activation ensures support for Apple white cable meaning you don&rsquo;t need a BMW Y cable adapter). With <a href=\"https://www.bimmer-tech.net/blog/item/56-bmw-enhanced-bluetooth\">Enhanced Bluetooth package</a> activated, it&rsquo;s also possible to pair up multiple devices simultaneously. Listen to music from your passenger&rsquo;s phone and receive calls from your own!</p>\r\n\r\n<p>Apart from media streaming functionalities, you will have the Office Menu available in your car. Want to learn more about what you will get after the BMW Bluetooth update? Type in your VIN and you will get a full product description with all the details on activation Bluetooth and its features.</p>', 'Connect your smartphone to your BMW to enjoy its best features while driving.'),
(210, 173, 174, 'RearCamMMI', 7, 8, 2, 2, '2019-05-08 13:01:35', '2019-05-08 13:17:28', 69900, 1, 'BMW Rear View Camera Retrofit (MMI)', '<ul>\r\n	<li>Overrides the native iDrive display with a full-screen camera image</li>\r\n	<li>Activates automatically when the car goes into reverse</li>\r\n	<li>Allows adding a mirroring device or front view camera for a lower price</li>\r\n	<li>Produces a high-quality image &nbsp;</li>\r\n	<li>Easily integrated into the trunk handle just like an original BMW backup camera</li>\r\n	<li>Supports Static or Dynamic Parking Lines</li>\r\n</ul>', 1, NULL, 'BMW backup camera, BMW rear view camera, bmw aftermarket backup camera, rv backup camera, bmw backup camera retrofit, bmw backup camera installation, bmw backup camera kit, bmw rear view camera car kit, add backup camera to bmw, rear view camera retrofit,', 'A BMW backup camera with MMI will take your parking to another level. Have the BMW rear view camera image full-screen and no obstacles will escape your sight!', '<p>The Rear View Camera (MMI) is created for those drivers who expect more than just park assist functionality from a BMW aftermarket backup camera. It is designed to make your car flexible and compatible with a host of technological upgrades. Because the factory pre-set features are not the limit. &nbsp;</p>\r\n\r\n<p>This BMW rear view camera doesn&rsquo;t use the native camera mode of your car. Instead, its display overrides the iDrive screen when the car is put in reverse. The reverse camera image takes up the full screen, giving a bigger and clearer picture of what&rsquo;s behind you.</p>\r\n\r\n<p>This retrofit is ideal for drivers looking for a flexible park assist solution that leaves room for customizing and expanding your vehicle&rsquo;s features. The BMW backup camera kit includes a Multimedia Interface (MMI) &mdash; a BimmerTech original module that makes it easy to add a Front View Camera, one of our mirroring devices (SmartView HD Flex, SmartView Apple TV3 or SmartView Apple TV4). Identify your car to find out which add-ons are compatible with your specific BMW.</p>\r\n\r\n<p>If you want to know more about BMW backup camera installation, type in your VIN or choose your model manually. You will see what a regular BMW rear view camera car kit includes together with info on how to add backup camera to BMW.</p>', 'A BimmerTech original backup camera with a full-screen image and handy add-ons.'),
(211, 173, 182, 'NBTEVOID5_ID6', 35, 36, 2, 1, '2019-05-09 11:56:43', '2019-05-15 08:52:07', 170000, 1, 'NBT EVO ID5/ID6 Navigation System Retrofit', '<ul>\r\n	<li>Features a high-definition screen</li>\r\n	<li>Contains only BMW genuine parts including an NBT Evo head unit with ID5 or ID6 interface</li>\r\n	<li>Provides the latest version of the maps for your region</li>\r\n	<li>Comes with a number of activated multimedia features like Video &amp; Services in motion, BMW Apps, etc.</li>\r\n	<li>Lets you use iPhone apps on your new iDrive screen with CarPlay</li>\r\n</ul>', 1, NULL, 'Navigation system retrofit, Navigation system, bmw navigation update, bmw idrive update, nbt evo retrofit, idrive versions, Navigation System Professional, iDrive interface, idrive upgrade, HARDWARE UPGRADE, bmw software update', 'Installing NBT EVO ID5/ID6 navigation system retrofit is just like buying a new car, but much cheaper. Find out more about NBT Evo iDrive and see it for yourself.', '<p>The most technologically advanced retrofits always bring the greatest deal of comfort, especially when it comes to owning a BMW. Our <a href=\"https://www.bimmer-tech.net/blog/item/58-bmw-nbt-evo-id5-id6-idrive-upgrade\">NBT Evo ID5/ID6 navigation system</a> will certainly add convenience to using the driver assistance systems as well as infotainment perks.</p>\r\n\r\n<p>The kit contains only BMW original parts and FSC-certified codes, so there is no need for aftermarket emulators. It comes either with ID5 or ID6 iDrive versions &mdash; it&rsquo;s up to you to choose the iDrive interface that suits you best and specify it during the purchase. It can be easily changed though with the help of simple USB BMW iDrive update.</p>\r\n\r\n<p>This <a href=\"https://www.youtube.com/watch?v=4HaUDEj1Oyc\">BMW NBT Evo retrofit</a> supplies the latest version of the maps for your region. The FSC activation also includes such multimedia features as DVD/Video in Motion, Voice Control and BMW apps. NBT Evo ID5/ID6 belongs to the Navigation System Professional vehicles and comes with CarPlay built in. This software lets you use iPhone apps on the native iDrive screen.</p>\r\n\r\n<p>Please note that NBT Evo ID5/ID6 retrofit is not a BMW software update, but a full hardware upgrade. To get to know more about installation and other features, identify your BMW.</p>', 'Switch to the newest-generation iDrive system and enjoy the latest tech perks.'),
(212, 173, 187, 'KeyFob', 53, 54, 2, 0, '2019-05-10 09:05:31', '2019-05-13 12:44:53', 29900, 1, 'BMW Key Fob', '<ul>\r\n	<li>Get a BMW key fob pre-programmed and matched to your specific model</li>\r\n	<li>Fit your old key blade into the fob or order a new one together with a BMW key fob replacement</li>\r\n	<li>Lock and unlock your car remotely</li>\r\n	<li>Open the trunk without getting out of your BMW</li>\r\n	<li>Sound the horn from a distance when there&rsquo;s a need</li>\r\n</ul>', 1, NULL, 'BMW Key Fob, bmw key fob replacement, bmw key fob programming, remote key fob, lost bmw key fob, bmw key fob functions, bmw key fob battery, remote key fob, key fob with remote start, Lost key fob, bmw oem, beamer car, bmw parts, how to program bmw key fo', 'Damaged your BMW Key Fob? Or want a spare one for your family? Check our our remote key fobs and get one programmed specifically for your BMW.', '<p>Sometimes remote key fobs get damaged, and sometimes you need spares for your family. In any of these scenarios you might think that getting a BMW replacement key fob is cumbersome. But we assure you that with BimmerTech the process is simple and smooth.</p>\r\n\r\n<p>You can order a BMW key fob from us and get a perfectly matched retrofit in a few days. The remote key fob comes pre-programmed by BMW itself for your specific model and resembles your factory remote key, having the same look and features. It doesn&rsquo;t require any BMW key fob programming &mdash; you just need to follow a few instructions to get it activated and that&rsquo;s all. Identify your car to find out the exact price of the BMW key fob for your vehicle.</p>', 'Replace a damaged key fob or get a spare one straight from the BMW factory.'),
(213, 173, 187, 'KeyFobMINI', 51, 52, 2, 1, '2019-05-10 11:13:42', '2019-05-13 12:47:37', 29900, 1, 'MINI Key Fob', '<ul>\r\n	<li>Get a MINI key fob pre-coded for your specific vehicle</li>\r\n	<li>Fit your old key blade into the fob or order a new one together with a MINI key fob replacement</li>\r\n	<li>Lock and unlock your car remotely</li>\r\n	<li>Open the trunk without getting out of your MINI</li>\r\n	<li>Sound the horn from a distance when there&rsquo;s a need</li>\r\n</ul>', 1, NULL, 'MINI Key Fob, MINI key fob replacement, MINI key fob programming, remote key fob, lost key fob, MINI key fob functions, MINI key fob battery, remote key fob, key fob with remote start, MINI OEM, MINI parts', 'Lost you MINI key fob or just want a spare one for your family members? Look at what we have for your MINI and get the key fob with free shipping worldwide!', '<p>Whether your remote key fob is damaged or you just need a spare one, we offer MINI original replacements, perfectly matched to your vehicle.</p>\r\n\r\n<p>The replacement comes pre-coded for your specific vehicle so no MINI key fob programming is needed. Replacing an old or lost key fob doesn&rsquo;t have to be cumbersome and we do our best to make the process as easy as possible.</p>\r\n\r\n<p>If you want to know more about the MINI key fob functions or details on its activation, please identify your car to proceed.</p>', 'Get a spare MINI key fob or replace the lost one without leaving your home!'),
(214, 173, 177, 'BMWAppsRetrofit', 19, 20, 2, 4, '2019-05-10 12:01:24', '2019-05-13 13:26:05', 39900, 1, 'BMW Apps Retrofit', '<ul>\r\n	<li>Lets you see or listen to status updates from social networks like Twitter</li>\r\n	<li>Gives access to Spotify, Pandora Radio and other music apps with audio playback through the BMW stereo system</li>\r\n	<li>Adds Calendar, ECO PRO analyzer, GoPro and many other iOS apps to your iDrive menu</li>\r\n	<li>Allows you to type in a location and send it to the navigation on the BMW screen</li>\r\n	<li>Features a genuine factory BMW Apps activation</li>\r\n</ul>', 1, NULL, 'bmw connected app, bmw connected car, bmw connected app compatibility', 'Want to use your iPhone apps on the BMW screen? Activate the BMW Apps with BimmerTech and get Spotify, Pandora, Deezer and many more, on your car’s display!', '<p>Just imagine how comfortable it would be to listen to Spotify through the car speakers and switch between songs with the help of the iDrive controller. And what about checking out Twitter updates on the BMW native screen? The truth is that it&rsquo;s very easy to arrange with our BMW Apps activation.</p>\r\n\r\n<p>If you add BMW apps to your iDrive, you will get access to:</p>\r\n\r\n<ul>\r\n	<li>Twitter</li>\r\n	<li>Web Radio</li>\r\n	<li>Calendar</li>\r\n	<li>Wiki Local</li>\r\n	<li>ECO PRO Analyzer</li>\r\n	<li>Last Mile Navigation</li>\r\n	<li>Pandora Radio</li>\r\n	<li>MOG</li>\r\n	<li>AUPEO!</li>\r\n	<li>Audible</li>\r\n	<li>Glympse</li>\r\n	<li>Rhapsody</li>\r\n	<li>TuneIn</li>\r\n	<li>GoPro</li>\r\n	<li>Spotify</li>\r\n	<li>Napster</li>\r\n	<li>Deezer</li>\r\n	<li>Many more!</li>\r\n</ul>\r\n\r\n<p>After activation you will need to download a free BMW Connected app that will ensure that you have all the compatible apps on your iDrive display. Through this application, you will also be able to find a destination in the map on your iPhone and send it to the vehicle&rsquo;s navigation. BMW Connected App compatibility is limited only to iOS devices.</p>\r\n\r\n<p>If you wish to know more about the BMW Connected car features, BMW Apps activation or navigation perks, identify your car in the top right corner.</p>', 'Unlock the full potential of your iDrive system with your favorite iPhone apps.'),
(215, 173, 182, 'CICNavSysRetrofit', 33, 34, 2, 2, '2019-05-10 12:43:55', '2019-05-13 13:42:04', 177500, 1, 'BMW CIC Navigation System Retrofit', '<ul>\r\n	<li>Features a high definition screen</li>\r\n	<li>Contains only BMW genuine parts including a CIC head unit updated to the latest BMW software update version</li>\r\n	<li>Includes the latest version of the maps for your region</li>\r\n	<li>Comes with a number of activated multimedia features like Video &amp; Services in motion and Voice Control.</li>\r\n	<li>Adds a USB port that can be used for updating maps or upgrading software</li>\r\n</ul>', 1, NULL, 'BMW CIC Navigation system retrofit, Navigation system, bmw navigation update, bmw idrive update, CIC retrofit, bmw CIC update idrive versions, Navigation System Professional, iDrive interface, idrive upgrade, HARDWARE UPGRADE, bmw software update, bmw map', 'Renew your car with a BMW CIC Navigation System retrofit instead of spending thousands on a new and more modern vehicle. Check out what difference it might make.', '<p>If your older BMW is not equipped with some advanced tech features, it doesn&rsquo;t mean that you have to wait ages saving up for a new vehicle. You can retrofit your favorite car with a BMW CIC Navigation System retrofit and enjoy the most important tech functionalities, getting real value for your money.</p>\r\n\r\n<p><a href=\"https://www.bimmer-tech.net/blog/item/54-bmw-cic-nbt-nbtevo\">Upgrading your BMW with a newer navigation system</a>, you get a high definition screen and the latest BMW map update for your region, to make navigating through the streets a breeze. In addition, the CIC iDrive upgrade coding activation, included into the kit, provides you with such multimedia features as Video &amp; Services in motion and Voice Control.</p>\r\n\r\n<p>Your hardware upgrade will also add a USB port that can be used in several ways. Given that the CIC iDrive interface is a part of Navigation System Professional head unit line, you can benefit from it by updating your maps with a flash drive every time BMW releases a new version. What is more, through that port you will also be able to extend the capabilities of your car with the help of some <a href=\"https://www.bimmer-tech.net/bmw-idrive-coding/\">USB coding</a> (the range of possible features will depend on your car&rsquo;s specs).</p>\r\n\r\n<p>Find out more about the BMW CIC Navigation System retrofit for your car by typing in your VIN or choosing the model &amp; year manually.</p>', 'An easy way to upgrade your older BMW to a newer navigation system.'),
(216, 173, 177, 'Combox', 17, 18, 2, 1, '2019-05-14 12:59:13', '2019-05-14 13:43:56', 69900, 1, 'Combox Media PnP Retrofit', '<ul>\r\n	<li>Extends the multimedia capabilities of your BMW</li>\r\n	<li>Lets you stream audio from a smartphone or MP3 player via Bluetooth</li>\r\n	<li>Allows pairing up multiple devices via Bluetooth</li>\r\n	<li>Gives access to reading SMS messages, email, reminders, etc.</li>\r\n	<li>Provides USB audio playback for iPhone/iPod devices</li>\r\n</ul>', 1, NULL, 'bmw connected drive, bmw bluetooth pairing, bmw bluetooth compatibility, bmw bluetooth compatible phones, bmw bluetooth update, bmw bluetooth audio streaming, bmw bluetooth pairing code, bmw bluetooth iphone, bmw smartphone integration, Enhanced Bluetooth', 'Do you want to enjoy BMW Bluetooth audio streaming in an older BMW? Combox Media PnP retrofit is exactly the upgrade that will make it work. See it for yourself.', '<p>If you want to breathe new life into your favorite BMW (instead of spending thousands on a new model), revitalizing its multimedia functionalities is the perfect step towards a better driving experience.</p>\r\n\r\n<p>Combox Media PnP Retrofit is a module that adds many new features to your iDrive system. Most importantly, your car will be equipped with BMW Bluetooth audio streaming thanks to the <a href=\"https://www.bimmer-tech.net/blog/item/56-bmw-enhanced-bluetooth\" target=\"_blank\">Enhanced Bluetooth</a> feature. You&rsquo;ll be able to stream music from your MP3 player or smartphone through the car&rsquo;s stereo system.</p>\r\n\r\n<p><a href=\"https://www.youtube.com/watch?v=et8Y6pHMor4\" target=\"_blank\">Combox retrofit </a>provides support for Apple white cable which accounts for a much better BMW Bluetooth iPhone integration &mdash; your iPhone or iPod can be connected to your BMW. This lets you stream music with a much better audio quality and, at the same time, charge the device.</p>\r\n\r\n<p>If you want to know more about the BMW Bluetooth pairing, BMW Connected Drive and Bluetooth audio after the combox installation, please identify your car in the top right corner.</p>', 'Enjoy Bluetooth, the Office Menu and a USB audio interface in older BMW models.'),
