INSERT INTO `sylius_taxon_translation` (`id`, `translatable_id`, `name`, `slug`, `description`, `locale`) VALUES
(173, 173, 'Category', 'category', 'This is the first Taxon', 'en_US'),
(174, 174, 'PARKING', 'park_assists', NULL, 'en_US'),
(176, 176, 'CAR AUDIO', 'audio', NULL, 'en_US'),
(177, 177, 'SMARTPHONE', 'smartphone', 'This is the first Taxon.', 'en_US'),
(179, 179, 'CODING', 'coding', 'This is the first Taxon.', 'en_US'),
(180, 180, 'ACCESSORIES', 'convenience', NULL, 'en_US'),
(182, 182, 'NAVIGATION', 'navigation', NULL, 'en_US'),
(184, 184, 'DISPLAYS', 'displays', NULL, 'en_US'),
(186, 186, 'DOORS & TRUNK', 'exterior', NULL, 'en_US'),
(187, 187, 'KEY FOBS', 'outlet', NULL, 'en_US'),
(188, 188, 'SIRIUSXM', 'siriusxm', NULL, 'en_US'),
(190, 190, 'SiriusXM Satellite Radio Activation', 'SiriusXM-Satellite-Radio-Activation-SiriusActivation', 'SiriusXM Satellite radio can be activated through a remote coding session or with a USB stick. The type of the activation depends on the vehicle specs and can be determined only after you type in your VIN. Please identify your car and read the full description of the product together with details on its installation.', 'en_US'),
(191, 191, 'BMW CarPlay MMI Retrofit', 'bmw-carplay-mmi-retrofit', 'BMW CarPlay MMI retrofit is customized for each model separately due to the various configurations of every BMW vehicle. If you wish to read the full CarPlay MMI description for your specific car, type in your VIN or choose the model manually.', 'en_US'),
(196, 196, 'VividScreen - iDrive Display for BMW', 'vividscreen-idrive-display-for-bmw-VividScreen', 'VividScreen iDrive display upgrade is a retrofit prepared for each BMW individually, meaning the kit contents and some small features can vary. In addition, every model is compatible with a different number of extra add-ons. Identify your car and get a full product description for your specific vehicle.', 'en_US'),
(197, 197, 'Power Trunk Release Retrofit', 'power-trunk-release-retrofit-powertrunk', 'Every BMW model is characterized by a certain number of specs. That’s why each Power Trunk Release kit can be a little bit different for different vehicles. Type in your VIN or choose your car manually to read the full description of the upgrade and learn more about Power Trunk Release kit installation in your BMW model.', 'en_US'),
(198, 198, 'BMW Navigation Map Update 2018/2019', 'bmw-navigation-map-update-2018-2019-mapupdate', 'The list of available maps and regions for each BMW may be different due to its individual configurations. Identify your car to find out to which countries the BMW iDrive map update for your specific car extends and which year/quarter is covered.', 'en_US'),
(201, 201, 'BMW Rear View Camera Retrofit (OEM)', 'rear-view-camera-retrofit-oem', 'BMW Rear View Camera (OEM) kit is assembled for each model separately due to the various specs of every BMW vehicle. If you wish to find out more about the BMW backup camera for your specific car, type in your VIN or choose the model manually.', 'en_US'),
(202, 202, 'BMW Apple CarPlay Activation', 'bmw-apple-carplay-activation', 'The type of Apple CarPlay activation (via USB or during a remote coding session) strongly depends on your BMW configurations. If you specify your VIN, you will get a detailed description on BMW CarPlay setup in your vehicle as well as information whether your BMW is compatible with full screen option.', 'en_US'),
(203, 203, '6WB BMW OEM Digital Instrument Cluster', '6wb-bmw-oem-digital-instrument-cluster-6wb', '6WB BMW OEM Digital Cluster is a high-tech solution for a more effective and functional dash. But depending on the model and car’s configurations, it can have a different price for each vehicle due to the kit contents. Please type in your VIN number or select the model & year manually to get the exact quote and full description.', 'en_US'),
(204, 204, 'BMW PDC (Park Distance Control) Retrofit', 'pdc-park-distance-control-retrofit-oem-pdcretrofit', 'Original BMW PDC (Park Distance Control) is a retrofit prepared for each BMW separately. Given that every car has its own configurations, the kit contents and its price may vary. In order to get information concerning your specific vehicle, please fill in the VIN field or choose your model & year manually.', 'en_US'),
(209, 209, 'BMW Enhanced Bluetooth Update / USB Port Activation', 'bmw-enhanced-bluetooth-update-usb-port-activation-enhbtandusb', 'The price and the type of BMW Enhanced Bluetooth Update / USB Port Activation strongly depend on the configurations of your vehicle. In order to find out how we will enable Enhanced Bluetooth and USB port in your specific car (via USB or during a remote coding session), please identify your BMW/MINI.', 'en_US'),
(210, 210, 'BMW Rear View Camera Retrofit (MMI)', 'rear-view-camera-retrofit-mmi', 'BimmerTech assembles every BMW Rear View Camera (MMI) kit for each model separately because every BMW vehicle has a different configuration, and thus requires different BMW parts. Want to learn more about the rear view camera retrofit for your specific car? Identify your BMW.', 'en_US'),
(211, 211, 'NBT EVO ID5/ID6 Navigation System Retrofit', 'nbt-evo-id5-id6-navigation-system-retrofit', 'NBT EVO ID5/ID6 navigation system retrofit may consist of different parts depending on your BMW model and its specs. In order to find out the exact price and features included with the iDrive upgrade for your specific car, identify your vehicle.', 'en_US'),
(212, 212, 'BMW Key Fob', 'bmw-key-fob', 'Each BMW model is compatible with a different BMW key fob. In order to learn about the one designed for your vehicle, type in your VIN or select the model & year. You will get a full description together with details on BMW key fob functions and its activation.', 'en_US'),
(213, 213, 'MINI Key Fob', 'mini-key-fob', 'Type in your VIN or choose your MINI model to learn the exact price of the remote key fob for your car. By identifying your vehicle, you will also get detailed information on the MINI OEM key fob activation as well as additional features relevant to your vehicle.', 'en_US'),
(214, 214, 'BMW Apps Retrofit', 'bmw-apps-retrofit', 'If you want to know which type of BMW Apps activation (via USB or through a remote coding session) is compatible with your vehicle, please type in your VIN so that we could identify your car. You will be able to get more info about BMW Apps features, a short overview of the activation process and the exact price.', 'en_US'),
(215, 215, 'BMW CIC Navigation System Retrofit', 'bmw-cic-navigation-system-retrofit', 'BMW CIC Navigation System retrofit contains a head unit, modules, wiring and different types of trim. To discover what kind of iDrive auto parts are included into the kit for your BMW, specify your model & year, or type in your VIN number. You will get a complete description of the CIC retrofit together with details on its features.', 'en_US'),
(216, 216, 'Combox Media PnP Retrofit', 'bmw-combox-retrofit', 'In order to know the exact price of the Combox retrofit for your BMW model, please type in your VIN. We will provide you with all the information concerning the functionalities and features the Combox is responsible for as well as details on its installation.', 'en_US'),
(217, 217, 'CategoryName216', 'category_name216', NULL, 'en_US');
